rsuit à distance les négotiations avec les preneurs d\'otage',2003,2009),(2011,1,'2014-05-23 00:00:00','2014-05-23 00:00:00',230,'Assaut',99,5,0,0,'Si <i:négotiateur> estime que cela a un intérêt et en vaut la peine, l\'assaut des forces de l\'ordre est donné (l\'issue est à déterminer par les organisateurs)',2003,2010),(2012,1,'2014-05-23 00:00:00','2014-05-23 00:00:00',231,'L\'anniversaire du 1er mois',0,60,1,1,'Le <o:buffet> préparé par <i:intendant> pour célébrer le 1er mois.',2006,NULL),(2013,1,'2014-05-23 00:00:00','2014-05-23 00:00:00',231,'Discours de <i:chef>',5,5,0,1,'<i:chef> fait un discours (préparé par ses soins) pour remercier et encourager chacun pour ce qui a été un mois formidaaaable, mais le meilleur - ou le plus difficile- est encore à venir ! (et va également féciliter l\'intendant <i:intendant> pour ce buffe',2006,2012),(2014,1,'2014-05-23 00:00:00','2014-05-23 00:00:00',208,'Début de <r:TypeReception> de <i:hôte> : Buffet',0,60,-1,1,'Le <o:buffet> de <i:Hôte> pour sa <o:TypeReception>, organisé par <i:aidant>',2008,NULL),(2015,1,'2014-05-23 00:00:00','2014-05-23 00:00:00',208,'Discours de <i:anniversé>',5,5,-1,0,'<i:Hôte> fait un discours pour remercier ses invités de leur venue, et particulièrement <i:aidant> pour son aide pour l\'organisation',2008,2014),(10701,1,'2011-01-11 00:00:00','2011-01-11 00:00:00',107,'Le <o:Message1>',20,10,-1,0,'<i:Postier> arrive et donne <o:Message1> à <i:PL> sur l\'agonie de sa mère <i:RA>',1,NULL),(10702,1,'2011-01-11 00:00:00','2011-01-11 00:00:00',107,'Détection 1',40,10,-1,0,' <o:Message2> arrive à <i:DV> et  <o:Message3> à <i:LS> : sa perception de la Force est étrange quand il passe auprès de l\'autre…',1,10701),(10703,1,'2011-01-11 00:00:00','2011-01-11 00:00:00',107,'Détection 2',60,10,-1,0,' <o:Message4> arrive à <i:DV> et  <o:Message5> à <i:PL> : sa perception de la Force est VRAIEMENT TRES étrange quand il passe auprès de l\'autre… \"Tu sens quelque chose d\'étrange autour de son cou\" (cf. <o:Medaillon1> )',1,10702),(10704,1,'2011-01-01 00:00:00','2011-01-01 00:00:00',107,'Détection 3',85,10,-1,1,'(Si reconnaissance n\'a pas eu lieu avant entre les deux personnages, ou s\'ils n\'ont pas reconnu leurs médaillons).\r\n<i:Postier> et <i:Postier2> vont dire à <i:DV> <i:PL> et <i:LS> : \"Tu sens que la force agie sur vous de la même façon… comme si vous étiez de la même famille…\"',1,10703),(10709,1,'2011-01-01 00:00:00','2011-01-01 00:00:00',107,'Retrouvailles !',99,10,-1,-1,'<i:DV>, <i:PL> et <i:LS> se retrouvent comme famille.',1,10703),(10801,1,'2013-01-01 00:00:00','2013-01-01 00:00:00',108,'Cocktail',1,30,0,0,'Cocktail de bienvenue pour cette nouvelle merveilleuse journée sur notre <o:vaisseau1> \"7 worlds queen\"',NULL,NULL),(10802,1,'2013-01-01 00:00:00','2013-01-01 00:00:00',108,'Buffet',75,40,0,0,'Buffet pour cette nouvelle merveilleuse journée sur notre <o:vaisseau1> \"7 worlds queen\"',NULL,NULL),(10803,1,'2014-07-28 19:56:56','2014-07-28 19:56:56',114,'Démasqués !\r\n',5,5,0,0,'1 PNJ / Orga\r\n- Montrer à <i:Dominus> le joueur incarnant <i:PetitAmi> (sans lui donner son nom) et lui dire que c\'est l\'homme qui était \" avec \" <i:Servante> au <l:Spectacle> hier\r\n- Montrer à <i:Servante> la joueuse incarnant  <i:Maîtresse> (sans lui donner son nom) et lui dire que c\'est la femme qui était \" avec \" <i:Dominus> au <l:Spectacle> hier',NULL,NULL),(10804,1,'2014-07-30 16:05:49','2014-07-30 16:05:49',115,'<i:hôte> présente sa demeure.',2,5,1,1,'<i:hôte> présente sa demeure à <i:Groupe d\'évadés>.',1136,NULL),(10805,1,'2015-03-15 11:46:12','2015-03-15 11:46:12',234,'Arrivée du fiancé',2,5,1,1,'Arrivée du fiancé de <i:none:Lazare>.',2011,NULL),(10806,1,'2015-03-15 20:05:10','2015-03-15 20:05:10',234,'Repas avec le fiancé',20,40,1,0,'<i:none:Mère> propose à <i:none:Fiancé> de passer à table. Ils discutent tous ensemble en attendant l\'arrivée de <i:none:Lazare> et des autres invités.',2011,10805),(10807,5,'2015-03-24 11:06:22','2015-03-24 11:06:22',234,'Arr