DROP TABLE IF EXISTS `generic_resource`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `generic_resource` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `last_updated` datetime NOT NULL,
  `date_created` datetime NOT NULL,
  `version` int(11) NOT NULL,
  `code` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `comment` text COLLATE utf8_unicode_ci,
  `plot_id` int(11) NOT NULL,
  `title` varchar(75) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` text COLLATE utf8_unicode_ci,
  `from_role_id` int(11) DEFAULT NULL,
  `to_role_id` int(11) DEFAULT NULL,
  `possessed_by_role_id` int(11) DEFAULT NULL,
  `object_type_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `fk_generic_ressource_plot_id_idx` (`plot_id`),
  KEY `fk_possessed_by_role_id_idx` (`possessed_by_role_id`),
  KEY `fk_to_role_id_idx` (`to_role_id`),
  KEY `fk_from_role_id_idx` (`from_role_id`),
  KEY `fk_object_type_id_idx` (`object_type_id`),
  CONSTRAINT `fk_from_role_id` FOREIGN KEY (`from_role_id`) REFERENCES `role` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_generic_ressource_plot_id` FOREIGN KEY (`plot_id`) REFERENCES `plot` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_possessed_by_role_id` FOREIGN KEY (`possessed_by_role_id`) REFERENCES `role` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_to_role_id` FOREIGN KEY (`to_role_id`) REFERENCES `role` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2038 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

