<TAGS/><RELATIONS/><PAST_SCENES/><EVENTS><EVENT event_id=\"10702\" is_announced=\"true\"><TITLE><![CDATA[Détection1]]></TITLE><DESCRIPTION><![CDATA[{message2, dénominatif} arrive à <i:DV> : sa perception de la Force est étrange quand il passe auprès de <i:LS>…]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10701\" is_announced=\"true\"><TITLE><![CDATA[Message1]]></TITLE><DESCRIPTION><![CDATA[<i:Postier> va aller donner <o:message1> à <i:PL> sur l\'agonie de sa mère]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10703\" is_announced=\"true\"><TITLE><![CDATA[Détection 2]]></TITLE><DESCRIPTION><![CDATA[{message4, dénominatif} arrive à <i:DV> : sa perception de la Force est étrange quand il passe auprès de <i:PL>…]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10704\" is_announced=\"true\"><TITLE><![CDATA[Chuchotement à <i:DV>]]></TITLE><DESCRIPTION><![CDATA[Tu sens que la force agie sur toi, <i:PL> et <i:LS> de la même façon… comme si vous étiez de la même famille…]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"PL\" id=\"1073\" pipi=\"2\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[La fille de <i:RA> qui ne sait pas que <i:DV> est  son père]]></DESCRIPTION><TAGS><TAG type=\"Traits physiques\" value=\"Séduisant(e )\" weight=\"60\"/><TAG type=\"Sexe\" value=\"Femme\" weight=\"100\"/><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/></TAGS><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1075\" title=\"\"><DESCRIPTION><![CDATA[Ma mère est est très malade et je dois aller sur <l:lieu2> pour lui trouver une plante rare, qui ne pousse qu\'à <l:lieu2>.\n\nJe m\'y rends. Arrivée sur place, on m\'explique qu\'il faut aller dans la campagne, que certaines fermes cultivent cette plante rare. Je fais un bout de chemin, j\'arrive à une ferme et je tombe nez à nez sur un garçon d\'à peu près mon âge, au regard doux et gentil, qui me trouble immédiatement. Mon cœur s\'emballe !\nJe lui demande la plante rare, il accepte : mais à peine il s\'absente quelques instants pour me l\'emballer que déjà il me manque.\n\nJe rentre sur <l:lieu3> et son visage m\'obsède : je crois que c\'est le coup de foudre]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1074\" title=\"\"><DESCRIPTION><![CDATA[Ma mère m\'a élevée seule, sur une lointaine colonie, <l:lieu3>, j\'y ai passé une enfance heureuse dans une certaine aisance, ma mère et quelques domestiques se chargeant de mon éducation.\nElle m\'a avouée qu\'elle s\'était enfuie avec moi sur cette colonie pour fuir un vieux danger l\'ayant contrainte à une vie clandestine et exilée.\n\nEn grandissant, je lui ai demandé qui était son père mais elle me dit qu\'il était mort au combat dans une ancienne guerre. \nElle ne parle que peu de ces \"temps anciens\" et mon principal lien avec ce passé est ce <o:médaillon1>, sans doute un cadeau de naissance que je porte depuis que je suis née. Une tradition familiale m\'a dit ma mère. Mais quelle famille ?]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"10701\" is_announced=\"true\"><TITLE><![CDATA[Message1]]></TITLE><DESCRIPTION/><COMMENT><![CDATA[<i:postier> donne <o:message1> à <i:PL> sur la mort de l\'agonie de sa mère <i:RA>]]></COMMENT><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10709\" is_announced=\"true\"><TITLE><![CDATA[Retrouvailles !]]></TITLE><DESCRIPTION/><COMMENT><![CDATA[Retrouvailles du père <i:DV> et de ses deux enfants : son fils <i:LS> et sa fille <i:PL>….]]></COMMENT><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"Postier2\" id=\"1077\" pipi=\"0\" pipr=\"1\" type=\"PNJ\"><DESCRIPTION><![CDATA[porteur de message]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES/><EVENTS><EVENT event_id=\"10703\" is_announced=\"true\"><TITLE><![CDATA[Détection 2]]></TITLE><DESCRIPTION><![CDATA[{message5, dénominatif} arrive à <i:PL> : sa perception de la Force est étrange quand il passe auprès de <i:DV>…]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10704\" is_announced=\"true\"><TITLE><![CDATA[Chuchotement à <i:PL>]]></TITLE><DESCRIPTION><![CDATA[Tu sens que la force agie sur toi, <i:DV> et <i:LS> de la même façon… comme si vous étiez de la même famille…]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10702\" is_announced=\"true\"><TITLE><![CDATA[Détection1]]></TITLE><DESCRIPTION><![CDATA[{message3, dénominatif} à <i:LS> : sa perception de la Force est étrange quand il passe auprès de<i:DV>…]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10704\" is_announced=\"true\"><TITLE><![CDATA[Chuchotement à <i:LS>]]></TITLE><DESCRIPTION><![CDATA[Tu sens que la force agie sur toi, <i:DV> et <i:PL> de la même façon… comme si vous étiez de la même famille…]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"RA\" id=\"1072\" pipi=\"0\" pipr=\"3\" type=\"PHJ\"><DESCRIPTION><![CDATA[Mère en fuite avec sa fille, ayant confié son fils]]></DESCRIPTION><TAGS><TAG type=\"Âge\" value=\"Vieux\" weight=\"80\"/><TAG type=\"Âge\" value=\"Âge mûr\" weight=\"80\"/><TAG type=\"Sexe\" value=\"Femme\" weight=\"101\"/><TAG type=\"Trait de personnalité\" value=\"Bonté\" weight=\"100\"/></TAGS><RELATIONS><RELATION is_bijective=\"false\" role_id=\"1074\" type=\"Filiation\" weight=\"100\"/><RELATION is_bijective=\"false\" role_id=\"1073\" type=\"Filiation\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"1073\" title=\"\"><DESCRIPTION/></PAST_SCENE><PAST_SCENE past_scene_id=\"1074\" title=\"\"><DESCRIPTION><![CDATA[Inlassablement, <i:DV> me traque partout, tout comme il traque certainement <i:OB>  ! \nJe me suis enfuie sur une de nos lointaines colonies, <l:lieu3>, adoptant une fausse identité.\nLà j\'élève seule ma fille, avec l\'aide de quelques domestiques. Innocente dans mon drame, j\'offrais à ma fille une vie assez opulente.\n\nEn grandissant, <i:PL> me demande qui est son père mais j\'élude la question et lui dit qu\'il est mort au combat dans une ancienne guerre. Je lui avouais néanmoins que je m\'étais enfuie sur cette colonie pour fuir un vieux danger m\'ayant contrainte à cette vie clandestine et exilée.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1072\" title=\"\"><DESCRIPTION><![CDATA[Le côté obscur de la forcea attiré irrésistiblement <i:DV> qui est devenu chaque jour plus dangereux et effrayant, et surtout puissant.\nNos relations sont devenues très tendues avec <i:DV> et nous nous sommes séparés alors que j\'étais sur le point d\'accoucher (ce que je fis très peu de temps après notre séparation). J\'avais  très peur de lui.\nJ\'accouchais finalement de <i:PL> et <i:LS>, une fille et un  garçon. A leur nécessance, conformément à la tradition familiale, j\'offrais un <o:médaillon1> identique ) <i:Ls> et <i:PL>. \n\nMais <iDV> voulait récupérer ses enfants. Alors j\'ai fait appel à <i:OB>, mon vieil ami, pour m\'aider. Je luis confiais <i:LS> pour l\'élever en lui demandant de ne pas me dire où, pour la propre sécurité de l\'enfant.\n\nDe mon côté je m\'enfuyais très loin avec <i:PL> sur <l:lieu3>. Je savais que probablement je ne reverrai jamais plus <i:LS>. J\'étais très triste.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1071\" title=\"\"><DESCRIPTION><![CDATA[Je pourrais dire que dès que j\'ai rencontré <i:RA>, nous nous sommes aimés.\nNous nous sommes rapidement mis en couple, vivions sur sur <l :lieu1>, et n\'avons pas tardé à avoir deux enfants : <i:DV> était un homme merveilleux, je dois dire que nous formions un couple parfait.\nNous avions beaucoup d\'amis, dont <i:OB>, qui avait suivi la voie Jedi.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1075\" title=\"\"><DESCRIPTION><![CDATA[Je suis tombée très malade. \nJ\'ai demandé à <i:RA> de me procurer une certaine plante rare qui ne pousse que sur <l:lieu2> où elle va se rendre.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"10701\" is_announced=\"true\"><TITLE/><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10702\" is_announced=\"true\"><TITLE/><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10704\" is_announced=\"true\"><TITLE/><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10703\" is_announced=\"true\"><TITLE/><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10709\" is_announced=\"true\"><TITLE/><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"DV\" id=\"1071\" pipi=\"3\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[Père sombre à la recherche de ses enfants]]></DESCRIPTION><TAGS><TAG type=\"Âge\" value=\"Vieux\" weight=\"80\"/><TAG type=\"Sexe\" value=\"Homme\" weight=\"101\"/><TAG type=\"Âge\" value=\"Âge mûr\" weight=\"80\"/></TAGS><RELATIONS><RELATION is_bijective=\"true\" role_id=\"1072\" type=\"Amour\" weight=\"60\"/><RELATION is_bijective=\"false\" role_id=\"1074\" type=\"Hiérarchie Asc\" weight=\"100\"/><RELATION is_bijective=\"false\" role_id=\"1073\" type=\"Parent (direct)\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"1072\" title=\"\"><DESCRIPTION><![CDATA[Le côté obscur de la force m\'a attiré irrésistiblement et j\'ai basculé, devenant chaque jour plus dangereux et effrayant, et surtout puissant.\nNos relations sont devenues très tendues avec <i:RA> et nous nous sommes séparés alors qu\'elle était sur le point d\'accoucher (ce qu\'elle fit très peu de temps après notre séparation). Elle avait très peur de moi.\nElle ne m\'intéressait guère mais je voulais récupérer mes enfants, un garçon et une fille. Hélas, elle s\'est enfuie je ne sais où, ayant de surcroût demandé à un complice d\'emmener loin de moi mes enfants. Cela m\'a mis dans une colère noire, car je compris à cet instant que sans doute je ne reverrai plus mes enfants.\n\nJ\'ai tenté sans succès de la pourchasser et la tuer mais elle parvint à échapper à mon courroux, visiblement avec l\'aide de <i:OB> qui m\'a trahi…]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1071\" title=\"\"><DESCRIPTION><![CDATA[Je pourrais dire que dès que j\'ai rencontré <i:RA>, nous nous sommes aimés.\nNous nous sommes rapidement mis en couple, vivions sur sur <l :lieu1>, et n\'avons pas tardé à avoir deux enfants : <i:RA> était tellement séduisante, je dois dire que nous formions un couple parfait.\nNous avions beaucoup d\'amis, dont <i:OB>, qui avait suivi la voie Jedi.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1073\" title=\"\"><DESCRIPTION><![CDATA[Inlassablement, je traque <i:RA> et <i:OB> partout ! Ma quête est longue mais un jour un informateur m\'annonce savoir où se trouve <i:OB> : je le fais parler et au pied d\'un volcan bouillonnant de lave, je me rends dans une caverne à <l:lieu1>.\nC\'est un piège que m\'a tendu <i:OB> !\nNous nous battons de façon épique et je perds le combat, englouti par des coulée de lave en train de refroidir….\n\n<i:OB> m\'abandonne agonisant, me croyant mort…. Mais mes amis de la force obscure me soigne et finalement, quoique diminué, je survis et continue à le traquer… plus discrètement.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1074\" title=\"\"><DESCRIPTION/></PAST_SCENE><PAST_SCENE past_scene_id=\"1075\" title=\"\"><DESCRIPTION/></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"10709\" is_announced=\"true\"><TITLE><![CDATA[Retrouvailles !]]></TITLE><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10702\" is_announced=\"true\"><TITLE/><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10701\" is_announced=\"true\"><TITLE/><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10703\" is_announced=\"true\"><TITLE/><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"10704\" is_announced=\"true\"><TITLE/><DESCRIPTION/><COMMENT/><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"LS\" id=\"1074\" pipi=\"2\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Le fils qui pense que <i:OB> est son père alors que c\'est <i:RA> et <i:DV>]]></DESCRIPTION><TAGS><TAG type=\"Traits physiques\" value=\"Séduisant(e )\" weight=\"60\"/><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Sexe\" value=\"Homme\" weight=\"100\"/></TAGS><RELATIONS><RELATION is_bijective=\"true\" role_id=\"1073\" type=\"Famille éloignée\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"1073\" title=\"\"><DESCRIPTION><![CDATA[Petit, j\'ai été confié à une famille de simples paysans vivant humblement mais honnêtement à <l:lieu2>. Ils ont au début essayé de me faire croire qu\'ils étaient mes parents biologiques, mais ont finalement avoué par me dire que mon père m\'avait confié à eux quand j\'étais petit, un certain <i:OB>.\n\nJe ne le vois que rarement, et mon principal lien avec lui est ce <o:Médaille1>, sans doute un cadeau de naissance que je portais déjà quand j\'ai été confié à ma famille adoptive.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1075\" title=\"\"><DESCRIPTION><![CDATA[Ce jour là, une noble jeune femme d\'à peu près mon âge s\'est présentée à la porte de la ferme. Elle me dit qu\'elle cherchait une plante rare, dont on m\'a dit effectivement qu\'il était difficile d\'en trouver ailleurs que sur <l:lieu2>. Elle m\'en demande pour sa mère malade.\n\nMais je ne l’écoute guère. Les traits de son visage sont si fins que j’en suis presque ému, elle me trouble. Elle est noble et je ne suis que paysan, mais mon cœur s\'emballe.\nJ’accepte de lui donner de cette plante rare pour sa mère malade et à peine je m\'absente quelques instants pour en chercher et me l\'emballer que déjà elle me manque.\n\nElle m’annonce repartir sur <l:lieu3> où elle vit, et tandis que je contemple sa silhouette disparaître de ma vue, que déjà son visage m\'obsède : je crois que c\'est le coup de foudre !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"10709\" is_announced=\"true\"><TITLE><![CDATA[Retrouvailles !]]></TITLE><DESCRIPTION/><COMMENT><![CDATA[Retrouvailles du père <i:DV> et de ses deux enfants : son fils <i:LS> et sa fille <i:PL>….]]></COMMENT><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"OB\" id=\"1075\" pipi=\"2\" pipr=\"1\" type=\"PHJ\"><DESCRIPTION><![CDATA[L\'ami de <i:RA> qui a confié le fils]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Homme\" weight=\"100\"/><TAG type=\"Âge\" value=\"Vieux\" weight=\"80\"/><TAG type=\"Âge\" value=\"Âge mûr\" weight=\"80\"/></TAGS><RELATIONS><RELATION is_bijective=\"true\" role_id=\"1072\" type=\"Amitié\" weight=\"100\"/><RELATION is_bijective=\"true\" role_id=\"1074\" type=\"Parentée indirecte\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"1073\" title=\"\"><DESCRIPTION><![CDATA[Inlassablement, <i:DV> me traque partout, tout comme il traque certainement <i:RA>  ! \nSa quête est sur le point d\'aboutir alors je lui tend un piège : je l\'attire dans un endroit dangereux de <l:lieu1> en lui faisant passer une information par un informateur, et <i:DV> vient à moi.\n\nIl arrive donc dans cette caverne au pied d\'un volcan bouillonant de lave, mon piège se referme sur lui et nous nous battons de façon épique : il perd le combat, englouti par des coulée de lave en train de refroidir….\nJ\'abandonne <i:DV> là, agonisant  atrocement jusqu\'à la mort. C\'est tout ce que mérite les partisans de la Force Obscure !\n\nRentré chez moi, je continue à élever <i:LS> avant de le confier à une famille de simples paysans, vivant humblement mais honnêtement sur <l:lieu2>\n\nJe sens déjà la Force en <i:LS>. Puis je m\'enfuis car d\'autres missions m\'appellent, et ma présence peut mettre <iLS> en danger. Il ne sait rien de sa vraie famille et la rupture avec cette dernière est sans doute son plus grand atout sécurité. Il ne lui reste finalement que cet étrange <o:médaillon1> que lui a laissé sa mère.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1071\" title=\"\"><DESCRIPTION><![CDATA[A cette époque j\'avais déjà pas mal avancé sur la voie Jedi. J\'avais de nombreux amis, dont <i:RA> qui avait épousé <i:DV> un homme bon, avec lequel elle formait sur <l:lieu1> le couple parfait.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1072\" title=\"\"><DESCRIPTION><![CDATA[Ce jour là <i:RA> me contacte en pleine panique. Elle venait d\'accoucher de deux enfants jumeaux. J\'étais heureux pour elle mais <i:DV> avait basculé du côté obscur de la force et était devenu méchant et dangeeux. Elle avait peur pour ses deux enfants.\n\nElle me demande d\'emmener au loin son garçon <i:LS> pour le protéger. Elle me demande de ne pas me dire où, dans l\'intérêt de la sécurité de l\'enfant (si <i:DV> retrouvait <i:RA>, il ne valait mieux pas qu\'elle sache ou puisse avouer où se trouvait <i:LS>).\nJ\'accepte d\'emmener très loin <i:LS>.\n\nDe son côté, elle m\'annonce qu\'elle va fuir avec sa fille <i:LS> ailleurs, sans me dire où non plus, dans l\'intérêt de la sécurité de cette petite.\nJ\'abandonne <i:RA> en larmes, séparée de son fils….]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"1071\" is_public=\"true\"><TITLE><![CDATA[Un amour de jeunesse]]></TITLE><DESCRIPTION><![CDATA[<i:DV> et <i:RA> se sont  connus sur <l:lieu1>, ils se sont aimés. A cette époque, <i:DV> était un être doux et gentil.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"25\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"25\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1074\" is_public=\"true\"><TITLE><![CDATA[Enfance Riche]]></TITLE><DESCRIPTION><![CDATA[<i:RA> élève seule <i:PL> à <l:lieu3> et occulte complètement la question de l\'identité du père de <i:PL>.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"21\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"21\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1072\" is_public=\"true\"><TITLE><![CDATA[Très Méchant]]></TITLE><DESCRIPTION><![CDATA[<i:DV>  est Jedi et bascule du côté obscur de la Force. Il devient très \'méchant\'.\n<i:DV> et <i:RA> se séparent. Elle accouche quelques jours après de deux faux jumeaux, <i:PL> et <i:LS> qui portent chacun une <o:medaille1>\n\n<i:DV> est furieux, tente sans succès de tuer <i:RA> qui s\'enfuit avec <i:PL>.\nNéanmoins <i:OB> parvient à \" voler \" <i:LS>.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"24\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"24\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1073\" is_public=\"true\"><TITLE><![CDATA[Enfance Humble]]></TITLE><DESCRIPTION><![CDATA[<i:OB> combat la force obscure et à <l:lieu1> tend un piège à <i:DV>.\n<i:OB> défigure <i:DV> qui tombe dans de la lave.\n<i:OB> rentre seul et fait élever <i:LS> dans une humble famille sur <l:lieu2> et lui cache son père (la famille humble pense que c\'est <i:OB>)]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"21\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"21\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1075\" is_public=\"true\"><TITLE><![CDATA[La rencontre]]></TITLE><DESCRIPTION><![CDATA[<i:LS> et <i:PL> se rencontrent sur <l:Lieu2> et tombent immédiatement amoureux.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"15\" time_unit=\"d\"/><ABSOLUTE day=\"15\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS><EVENT absolute_timing=\"01/10/2014 12:35\" duration=\"10\" id=\"10704\" is_planned=\"true\" is_public=\"true\" timing=\"85\"><TITLE><![CDATA[Détection 3]]></TITLE><DESCRIPTION><![CDATA[(Si reconnaissance n\'a pas eu lieu avant entre les deux personnages, ou s\'ils n\'ont pas reconnu leurs médaillons).\n<i:Postier> et <i:Postier2> vont dire à <i:DV> <i:PL> et <i:LS> : \"Tu sens que la force agie sur vous de la même façon… comme si vous étiez de la même famille…\"]]></DESCRIPTION><PREDECESSORS><PREDECESSOR id=\"10703\"/></PREDECESSORS><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1\"/></GENERIC_PLACES></EVENT><EVENT absolute_timing=\"01/10/2014 10:40\" duration=\"10\" id=\"10701\" is_planned=\"false\" is_public=\"true\" timing=\"20\"><TITLE><![CDATA[Le <o:Message1>]]></TITLE><DESCRIPTION><![CDATA[<i:Postier> arrive et donne <o:Message1> à <i:PL> sur l\'agonie de sa mère <i:RA>]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1\"/></GENERIC_PLACES></EVENT><EVENT absolute_timing=\"01/10/2014 13:00\" duration=\"10\" id=\"10709\" is_planned=\"true\" is_public=\"true\" timing=\"99\"><TITLE><![CDATA[Retrouvailles !]]></TITLE><DESCRIPTION><![CDATA[<i:DV>, <i:PL> et <i:LS> se retrouvent comme famille.]]></DESCRIPTION><PREDECESSORS><PREDECESSOR id=\"10703\"/></PREDECESSORS><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1\"/></GENERIC_PLACES></EVENT><EVENT absolute_timing=\"01/10/2014 11:15\" duration=\"10\" id=\"10702\" is_planned=\"false\" is_public=\"true\" timing=\"40\"><TITLE><![CDATA[Détection 1]]></TITLE><DESCRIPTION><![CDATA[<o:Message2> arrive à <i:DV> et  <o:Message3> à <i:LS> : sa perception de la Force est étrange quand il passe auprès de l\'autre…]]></DESCRIPTION><PREDECESSORS><PREDECESSOR id=\"10701\"/></PREDECESSORS><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1\"/></GENERIC_PLACES></EVENT><EVENT absolute_timing=\"01/10/2014 11:50\" duration=\"10\" id=\"10703\" is_planned=\"false\" is_public=\"true\" timing=\"60\"><TITLE><![CDATA[Détection 2]]></TITLE><DESCRIPTION><![CDATA[<o:Message4> arrive à <i:DV> et  <o:Message5> à <i:PL> : sa perception de la Force est VRAIEMENT TRES étrange quand il passe auprès de l\'autre… \"Tu sens quelque chose d\'étrange autour de son cou\" (cf. <o:Medaillon1> )]]></DESCRIPTION><PREDECESSORS><PREDECESSOR id=\"10702\"/></PREDECESSORS><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1\"/></GENE