PAST_SCENE><PAST_SCENE id=\"1000503\" is_public=\"true\"><TITLE><![CDATA[Evénement passé à l\'age de 6 ans]]></TITLE><DESCRIPTION><![CDATA[Past Scene de 6]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"18\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS/><GENERIC_PLACES/><GENERIC_RESOURCES/></PLOT><PLOT author=\"1\" creation_date=\"1385313489000\" id=\"113\" is_evenemential=\"true\" is_mainstream=\"false\" is_public=\"true\" last_update_date=\"1385313489000\" title=\"Evt - Célébration Retour d\'un ami\"><DESCRIPTION>Les personnages sont venus assister à une réception donnée dans son &lt;l:Demeure&gt; à &lt;l:LieuDemeure&gt; par &lt;i:Hôte&gt; pour célébrer son retour de &lt;l:LieuLointain&gt;, absent depuis 1 an</DESCRIPTION><PITCH_ORGA>Les personnages sont venus assister à une réception donnée dans son &lt;l:Demeure&gt; à &lt;l:LieuDemeure&gt; par &lt;i:Hôte&gt; pour célébrer son retour de &lt;l:LieuLointain&gt;, absent depuis 1 an</PITCH_ORGA><PITCH_PNJ>Les personnages sont venus assister à une réception donnée dans son &lt;l:Demeure&gt; à &lt;l:LieuDemeure&gt; par &lt;i:Hôte&gt; pour célébrer son retour de &lt;l:LieuLointain&gt;, absent depuis 1 an</PITCH_PNJ><PITCH_PJ>&lt;i:Hôte&gt; vous a invité vous et plusieurs de ses proches à assister à une réception donnée dans sa &lt;l:Demeure&gt; à &lt;l:LieuDemeure&gt; pour célébrer son retour de &lt;l:LieuLointain&gt;, où il était parti depuis 1an.</PITCH_PJ><TAGS/><ROLES><ROLE code=\"Hôte\" id=\"1130\" pipi=\"0\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[Accueille et organise une réception pour fêter son retour.]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1132\" title=\"\"><DESCRIPTION><![CDATA[Je suis rentré de <l:LieuLointain>, où ma mission s\'est bien déroulée ce qui m\'a pas mal enrichi. J\'ai pris une belle <l:Demeure> à <l:LieuDemeure> et j\'ai contacté tous mes proches afin de célébrer mon retour. Je leur ai envoyé un message leur annonçant \"Je suis de retour de <l:lieulointain> et j\'organise une grande fête où j\'espère que vous pourrez assister\"\n\nIl faudra d\'ailleurs que je prépare quelques lignes d\'un court discours, et me préparer à répondre à de nombreuses questions !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1131\" title=\"\"><DESCRIPTION><![CDATA[Il y a un an, je suis parti à <l:lieulointain> qui était alors en proie à de forts troubles et rapidement tombé guerre. J\'ai prévenu tous mes amis de mon départ sans leur préciser mon lieu de destination.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"1131\" is_announced=\"true\"><TITLE><![CDATA[Fête]]></TITLE><DESCRIPTION><![CDATA[La fête]]></DESCRIPTION><COMMENT><![CDATA[Buffet avec banderolle welcome back, etc.]]></COMMENT><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"Invité\" id=\"1131\" pipi=\"0\" pipr=\"0\" type=\"PJG\"><DESCRIPTION><![CDATA[<i:Invité> connaît <i:Hôte>]]></DESCRIPTION><TAGS/><RELATIONS><RELATION is_bijective=\"true\" role_id=\"1130\" type=\"Connaît\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"1132\" title=\"\"><DESCRIPTION><![CDATA[J\'ai  reçu un message de <i:Hôte>, quelle chance ! \nLe message disait qu\'Hôte rentrait de <l:LieuLointain>, visiblement sa mystérieuse destination et il s\'est installé dans une belle <l:Demeure> à <l:LieuDemeure> où il organise prochainement une réception pour célébrer son retour :j\'ai hâte de le retrouver là bas !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1131\" title=\"\"><DESCRIPTION><![CDATA[Il y a un an, je suis parti à <l:lieulointain> qui était alors en proie à de forts troubles et rapidement tombé guerre. J\'ai prévenu tous mes amis de mon départ sans leur préciser mon lieu de destination.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"1131\" is_public=\"true\"><TITLE><![CDATA[Départ d\'<i:Hôte> pour <l:LieuLointain>]]></TITLE><DESCRIPTION><![CDATA[Hôte part, ce que savent les autres]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"1\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"1\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1132\" is_public=\"true\"><TITLE><![CDATA[Retour d\'<i:Hôte> pour <l:LieuLointain>]]></TITLE><DESCRIPTION><![CDATA[Hôte revient, ce que savent les autres. Envoi d\'invitation pour une fête en sa <l:Demeure> à <l:LieuDemeure>.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"15\" time_unit=\"d\"/><ABSOLUTE day=\"15\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS><EVENT absolute_timing=\"01/10/2014 10:06\" duration=\"2\" id=\"1131\" is_planned=\"true\" is_public=\"true\" timing=\"1\"><TITLE><![CDATA[Fête]]></TITLE><DESCRIPTION><![CDATA[Fête donnée en sa <l:Demeure> à <l:LieuDemeure>.pour tous les invités (buffet)]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1131\"/></GENERIC_PLACES></EVENT></EVENTS><GENERIC_PLACES><GENERIC_PLACE code=\"LieuLointain\" id=\"1131\"><TAGS><TAG type=\"&gt; Lieu Superficie\" value=\"&gt; Pays-Planète\" weight=\"100\"/><TAG type=\"Situation politique\" value=\"EnGuerre\" weight=\"100\"/></TAGS><COMMENT><![CDATA[<l:LieuLointain> est en guerre]]></COMMENT></GENERIC_PLACE></GENERIC_PLACES><GENERIC_RESOURCES/></PLOT><PLOT author=\"4\" creation_date=\"1387062000000\" id=\"110\" is_evenemential=\"false\" is_mainstream=\"false\" is_public=\"true\" last_update_date=\"1387062000000\" title=\"La chasse au trésor\"><DESCRIPTION>Les 6 personnages sont dans un lieu clos et souhaitent trouver un trésor qui est caché à proximité. &#13;\n&lt;I:Kebab&gt;, &lt;I:BloodyMary&gt; et &lt;I:Armando&gt; possèdent un fragment de la carte et sont à la recherche des autres morceaux. Le but est de rassembler tous les fragments pour récupérer le trésor. Sauf qu\'à l\'emplacement du trésor, il n\'y a que des cailloux... Seul &lt;I:Armando&gt; sait que le trésor n\'existe pas car c\'est lui qui a créé la carte (en tant que &lt;I:Barberaze&gt;).</DESCRIPTION><TAGS><TAG type=\"Sources\" value=\"PRC-GN-SIGL2014\" weight=\"100\"/><TAG type=\"Type intrigue\" value=\"Résoudre une énigme - (Polti)\" weight=\"80\"/><TAG type=\"Sources\" value=\"Un pirate ne meurt jamais\" weight=\"100\"/></TAGS><ROLES><ROLE code=\"Dona\" id=\"1106\" pipi=\"0\" pipr=\"2\" type=\"PJ\"><DESCRIPTION><![CDATA[Cherche le trésor de Kebab]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1104\" title=\"\"><DESCRIPTION><![CDATA[J\'ai entendu parler d\'une rumeur d\'un formidable trésor caché par <i:Barberaze>. \nJ\'ai entendu dire que ce dernier était mort… Peut-être pourrais-je tenter de m\'emparer du trésor…  Seulement, par où commencer ?]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Gaspard\" id=\"1101\" pipi=\"0\" pipr=\"3\" type=\"PHJ\"><DESCRIPTION><![CDATA[Gaspard qui se fait passer pour <i:Kebab>]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1105\" title=\"\"><DESCRIPTION><![CDATA[J\'ai parlé avec <i:Kebab> pour qu\'il partage son trésor avec moi. Malheureusement, il avait un peu trop bu et la discution a tourné à la dispute. \nDans la fureur du moment, j\'ai perdu le contrôle et quand j\'ai récupéré mes esprits… Il était mort à mes pieds. J\'ai décidé de mettre son masque et de me faire passer pour lui pour que personne ne se rende compte qu\'il est mort et pour récupérer le trésor. J\'espère que j\'arriverais à jouer le rôle sans être démasqué !\n\n<i:Gaspard> n\'est plus ! Vive <i:Kebab>]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Ramon\" id=\"1105\" pipi=\"0\" pipr=\"2\" type=\"PJ\"><DESCRIPTION><![CDATA[Cherche le trésor de <i:Kebab>]]></DESCRIPTION><TAGS><TAG type=\"Trait de personnalité\" value=\"Fourberie\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Vil\" weight=\"70\"/></TAGS><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1104\" title=\"\"><DESCRIPTION><![CDATA[J\'ai entendu parler d\'une rumeur d\'un formidable trésor caché par <i:Barberaze>. \nJ\'ai entendu dire que ce dernier était mort… Peut-être pourrais-je tenter de m\'emparer du trésor…  Seulement, par où commencer ?]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Barberaze\" id=\"1103\" pipi=\"0\" pipr=\"3\" type=\"PHJ\"><DESCRIPTION><![CDATA[Un terrible criminel qui est mort il y a quelques années.]]></DESCRIPTION><TAGS><TAG type=\"Trait de personnalité\" value=\"Fourberie\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Vil\" weight=\"70\"/></TAGS><RELATIONS><RELATION is_bijective=\"true\" role_id=\"1107\" type=\"Amitié\" weight=\"80\"/></RELATIONS><PAST_SCENES/><EVENTS/></ROLE><ROLE code=\"Armando\" id=\"1102\" pipi=\"0\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Est en fait <I:Barberaze>.]]></DESCRIPTION><TAGS><TAG type=\"Trait de personnalité\" value=\"Vil\" weight=\"70\"/><TAG type=\"Trait de personnalité\" value=\"Fourberie\" weight=\"80\"/></TAGS><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1106\" title=\"\"><DESCRIPTION><![CDATA[Je connais bien <i:Kebab> même s\'il ne sait pas que je le connais puisque je  l\'ai connu en tant que <I:Barberaze>. J\'ai remarqué qu\'il agissait étrangement depuis quelques jours… Serait-ce à cause du trésor qui le rend si nerveux ?]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1103\" title=\"\"><DESCRIPTION><![CDATA[Tout le monde pense que j\'étais fabuleusement riche et que mon trésor était caché quelque part. Je me fais passer pour <i:Barberaze> qui est mort il y a quelques années et qui était un dangereux criminel.\nLa vérité est que j\'ai créé moi-même cette légende et que le trésor n\'existe pas. Pour renforcer la légende, j\'ai créé une carte puis je l\'ai découpée en 3 morceaux que j\'ai donnés à mes proches.\nJ\'ai gardé un <o:MorceauCarte1>  évidemment pour que personne ne puisse la recréer. En tant que <i:Barberaze> j\'ai donné un <o:MorceauCarte2> à <i:BloodyMary> et  un <o:MorceauCarte3> à <i:Kebab> un autre criminel. J\'ai des relations amicales avec eux.\nMais je dois surtout éviter que quelqu\'un ne découvre que le trésor n\'existe pas !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Kebab\" id=\"1107\" pipi=\"0\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Autre meurtrier mort]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1105\" title=\"\"><DESCRIPTION><![CDATA[Ma véritable identité est <i:Gaspard>. J\'ai parlé avec <i:Kebab> pour qu\'il partage son trésor avec moi. Malheureusement, il avait un peu trop bu et la discussion a tourné à la dispute. \nDans la fureur du moment, j\'ai perdu le contrôle et quand j\'ai récupéré mes esprits… Il était mort à mes pieds. J\'ai décidé de mettre son masque et de me faire passer pour lui pour que personne ne se rende compte qu\'il est mort et pour récupérer le trésor. J\'espère que j\'arriverai à jouer le rôle sans être démasqué !\n\n<i:Gaspard> n\'est plus ! Vive <i:Kebab>]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1101\" title=\"\"><DESCRIPTION><![CDATA[J\'ai récupéré les affaires de <i:Kebab> en me débarassant du coprs  après l\'avoir tué. \nA ma grande surprise, en y regardant de plus prêt, j\'ai trouvé  <o:MorceauCarte3> : le bougre cachait un trésor : ce trésor est désormais mon but mais je n\'ai qu\'un morceau sur une carte qui doit être composée de 2, 3, 4 ou 5 morceaux…]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1101\" title=\"\"><DESCRIPTION><![CDATA[J\'ai récupéré les affaires de <i:Kebab>en me débarrassant du corps après l\'avoir tué. \nÀ ma grande surprise, en y regardant de plus près, j\'ai trouvé  <o:MorceauCarte3> : le bougre cachait un trésor quelque part : ce trésor est désormais mon but mais je n\'ai qu\'un morceau sur une carte qui doit être composée de 2, 3, 4 sinon 5 morceaux…]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"BloodyMary\" id=\"1104\" pipi=\"0\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Cherche le trésor de <i:Barberaze>]]></DESCRIPTION><TAGS/><RELATIONS><RELATION is_bijective=\"true\" role_id=\"1107\" type=\"Amitié\" weight=\"80\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"1106\" title=\"\"><DESCRIPTION><![CDATA[Je connais bien <i:Kebab> et j\'ai remarqué qu\'il agissait étrangement depuis quelques jours… Serait-ce à cause du trésor ? Je devrais aller lui en parler… Et récupérer mon morceau de la carte !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1103\" title=\"\"><DESCRIPTION><![CDATA[Je connais depuis longtemps <i:Barberaze> qu\'on dit  fait fort riche.\nUn jour il m\'a donné un <o:MorceauCarte2> qui est un fragment d\'une carte pour accéder à son trésor. Je garde le document précieusement.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1102\" title=\"\"><DESCRIPTION><![CDATA[Le <o:MorceauCarte2> a disparu ! C\'est arrivé il y a quelques jours, je suis à peu près sûr que c\'est <i:Kebab> qui me l\'a volé, je l\'ai senti tournant autour de moi ces derniers temps ! Je dois absolument la récupérer et trouver le trésor !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"1105\" is_public=\"false\"><TITLE><![CDATA[Le faux <i:Kebab>]]></TITLE><DESCRIPTION><![CDATA[Kebab est mort tué par <i:Kebab> qui a pris sa place. Personne n\'est au courant mais son comportement risque de le trahir.\n\nNote : le personnage es transféré à Kebab]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"12\" time_unit=\"d\"/><ABSOLUTE day=\"12\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1103\" is_public=\"false\"><TITLE><![CDATA[Le trésor de <i:Barberaze>]]></TITLE><DESCRIPTION><![CDATA[Armando en tant que <i:Barberaze> fait courir la légende sur sa richesse et son trésor, coupe la carte en trois et distribue un bout à <i:BloodyMary> et un autre à …. Il garde le troisième.\n\nNote : ne pas mettre le paragraphe à Kebab car c\'est Gaspard qui prend son identité.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"14\" time_unit=\"M\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"14\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1106\" is_public=\"false\"><TITLE><![CDATA[Un étrange comportement]]></TITLE><DESCRIPTION><![CDATA[<i:Kebab> a un comportement étrange depuis quelques jours…]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"1105\"/></PREDECESSORS><GENERIC_PLACES/><TIME><RELATIVE time=\"4\" time_unit=\"d\"/><ABSOLUTE day=\"4\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1104\" is_public=\"false\"><TITLE><![CDATA[Le trésor]]></TITLE><DESCRIPTION><![CDATA[J\'ai entendu parlé d\'une rumeur d\'un formidable trésor caché par <i:Barberaze>. Maintenant qu\'il est mort, je pourrais tenter de m\'emparer du trésor… Seulement, par ou commencer ?]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"1103\"/></PREDECESSORS><GENERIC_PLACES/><TIME><RELATIVE time=\"5\" time_unit=\"M\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"5\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1102\" is_public=\"false\"><TITLE><![CDATA[Récupération d\'une partie de la carte]]></TITLE><DESCRIPTION><![CDATA[<i:BloodyMary> : J\'avais un bout de la carte au trésor de mon père, mais il a disparu il y a quelques jours. Je suis à peu près sûr que c\'est <i:Kebab> qui me l\'a volé ! Je dois absolument la récupérer et trouver le trésor !]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"20\" time_unit=\"d\"/><ABSOLUTE day=\"20\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1101\" is_public=\"false\"><TITLE><![CDATA[Récupération d\'une partie de la carte]]></TITLE><DESCRIPTION><![CDATA[<i:Gaspard récupère un morceau de la carte sur le cadavre du vrai <i:Kebab> qu\'il vient de tuer.]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"1105\"/></PREDECESSORS><GENERIC_PLACES/><TIME><RELATIVE time=\"2\" time_unit=\"d\"/><ABSOLUTE day=\"2\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS><EVENT absolute_timing=\"01/10/2014 12:45\" duration=\"1\" id=\"1101\" is_planned=\"true\" is_public=\"false\" timing=\"90\"><TITLE><![CDATA[Découverte du trésor]]></TITLE><DESCRIPTION><![CDATA[Si les fragments <o:MorceauCarte1>, <o:MorceauCarte2> et <o:MorceauCarte3> sont réunis, alors le trésor peut être découvert (<L:Cachette>). \nOn se rend alors compte qu\'il ne contient que des cailloux…]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/></EVENT></EVENTS><GENERIC_PLACES/><GENERIC_RESOURCES><GENERIC_RESOURCE code=\"MorceauCarte2\" id=\"1103\"><TAGS><TAG type=\"Générique Ressources\" value=\"Partiel : morceau ou fragment de\" weight=\"100\"/><TAG type=\"- Type Ressource\" value=\"&gt;&gt;Document (sous type)\" weight=\"90\"/><TAG type=\"Document\" value=\"Plan et Carte\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Fragment de la carte au trésor]]></COMMENT></GENERIC_RESOURCE><GENERIC_RESOURCE code=\"MorceauCarte1\" id=\"1102\"><TAGS><TAG type=\"- Type Ressource\" value=\"&gt;&gt;Document (sous type)\" weight=\"90\"/><TAG type=\"Générique Ressources\" value=\"Partiel : morceau ou fragment de\" weight=\"100\"/><TAG type=\"Document\" value=\"Plan et Carte\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Fragment de la carte au trésor]]></COMMENT></GENERIC_RESOURCE><GENERIC_RESOURCE code=\"MorceauCarte3\" id=\"1104\"><TAGS><TAG type=\"- Type Ressource\" value=\"&gt;&gt;Document (sous type)\" weight=\"90\"/><TAG type=\"Document\" value=\"Plan et Carte\" weight=\"100\"/><TAG type=\"Générique Ressources\" value=\"Partiel : morceau ou fragment de\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Fragment de la carte au trésor]]></COMMENT></GENERIC_RESOURCE><GENERIC_RESOURCE code=\"CoffreTrésor\" id=\"1101\"><TAGS><TAG type=\"- Type Ressource\" value=\"&gt;Meuble Coffre et Placard\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Le conteneur du trésor]]></COMMENT></GENERIC_RESOURCE></GENERIC_RESOURCES></PLOT><PLOT author=\"1\" creation_date=\"1385313489000\" id=\"999899\" is_evenemential=\"false\" is_mainstream=\"false\" is_public=\"false\" last_update_date=\"1385313489000\" title=\"Life\"><DESCRIPTION>Life</DESCRIPTION><TAGS/><ROLES><ROLE code=\"Life\" id=\"999899\" pipi=\"0\" pipr=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[Vie du personnage]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1000119\" title=\"\"><DESCRIPTION><![CDATA[Tombe dans les escaliers et doit porter un platre 3 mois]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000124\" title=\"\"><DESCRIPTION><![CDATA[Son chien Tobi meurt]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000109\" title=\"\"><DESCRIPTION><![CDATA[S\'étouffe avec un bonbon]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000098\" title=\"\"><DESCRIPTION><![CDATA[Naissance]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000114\" title=\"\"><DESCRIPTION><![CDATA[Premier appartement]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000103\" title=\"\"><DESCRIPTION><![CDATA[Entrée à l\'école primaire]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"1000119\" is_public=\"true\"><TITLE><![CDATA[Evénement passé à l\'age de 22 ans]]></TITLE><DESCRIPTION><![CDATA[Past Scene de 22]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"6\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1000124\" is_public=\"true\"><TITLE><![CDATA[Evénement passé à l\'age de 27 ans]]></TITLE><DESCRIPTION><![CDATA[Past Scene de 27]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"1\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1000103\" is_public=\"true\"><TITLE><![CDATA[Evénement passé à l\'age de 6 ans]]></TITLE><DESCRIPTION><![CDATA[Past Scene de 6]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"22\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1000098\" is_public=\"true\"><TITLE><![CDATA[Evénement passé à l\'age de 1 ans]]></TITLE><DESCRIPTION><![CDATA[Past Scene de 1]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"27\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1000114\" is_public=\"true\"><TITLE><![CDATA[Evénement passé à l\'age de 17 ans]]></TITLE><DESCRIPTION><![CDATA[Past Scene de 17]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"11\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1000109\" is_public=\"true\"><TITLE><![CDATA[Evénement passé à l\'age de 12 ans]]></TITLE><DESCRIPTION><![CDATA[Past Scene de 12]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"16\" time_unit=\"Y\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS/><GENERIC_PLACES/><GENERIC_RESOURCES/></PLOT><PLOT author=\"2\" creation_date=\"1386975600000\" id=\"111\" is_evenemential=\"false\" is_mainstream=\"false\" is_public=\"true\" last_update_date=\"1386975600000\" title=\"L\'amour ne connaît pas de loi\"><DESCRIPTION>Issu des tables claudiennes (par JC Hoog.)&#13;\nTransformation : Bastien</DESCRIPTION><TAGS><TAG type=\"Type intrigue\" value=\"Remords - (Polti)\" weight=\"40\"/><TAG type=\"Type intrigue\" value=\"Jalousie - (Polti)\" weight=\"60\"/><TAG type=\"Tag Univers\" value=\"Harry Potter Anglais Fantastique (Univers)\" weight=\"80\"/><TAG type=\"Type intrigue\" value=\"Être traqué - (Polti)\" weight=\"15\"/><TAG type=\"Sentiments Intrigue\" value=\"Erotisme\" weight=\"30\"/><TAG type=\"Sentiments Intrigue\" value=\"Violence\" weight=\"10\"/><TAG type=\"Sentiments Intrigue\" value=\"Amour\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Super-Héros U.S. (Univers)\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Star Wars (Univers)\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Ancien Régime Fr (Univers)\" weight=\"80\"/><TAG type=\"Type intrigue\" value=\"Adultère - (Polti)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Grèce Antique (Univers)\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"XiXème siècle Britannique (Univers)\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Contemporain France (Univers)\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Contemporain Anglais (Univers)\" weight=\"80\"/></TAGS><ROLES><ROLE code=\"Minna\" id=\"111003\" pipi=\"1\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[Jouisseuse, elle est frivole et hésite encore entre <i:Theo> et <i:Max>, mais après tout, pourquoi choisir ?\nElle a profité que <i:Marie> était en taule pour se payer un avant-goût dans le lit de <i:Max>]]></DESCRIPTION><TAGS><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"90\"/><TAG type=\"Sexe\" value=\"Femme\" weight=\"100\"/><TAG type=\"Trait de personnalité\" value=\"Fourberie\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Fou\" weight=\"50\"/><TAG type=\"Situation Maritale\" value=\"Célibataire\" weight=\"80\"/><TAG type=\"Traits physiques\" value=\"Séduisant(e )\" weight=\"70\"/></TAGS><RELATIONS><RELATION is_bijective=\"false\" role_id=\"111001\" type=\"Hiérarchie Asc\" weight=\"10\"/><RELATION is_bijective=\"false\" role_id=\"111004\" type=\"Amour\" weight=\"25\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111001\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie>, l\'autre pouffe, a organisé un coup, il est un peu bancal mais elle insiste pour qu\'on le fasse. Elle est tellement exaltée que je n\'ai pas eu le cœur de dire non.\n<I:Theo> a insisté pour en faire partie, je ne suis pas sûre qu\'il soit assez mature mais il a court-circuité tout le monde en allant directement voir <i:Marie> : elle a vraiment une mauvaise influence sur lui.\n\nTout s\'est mal passé, comme je le craignais <i:Theo> a tout foiré, et <I:Minna> s\'est faite choper : elle en a pris pour 20 ans fermes. Je ne sais pas si j\'aurai la force de l\'attendre.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111004\" title=\"\"><DESCRIPTION><![CDATA[Putain de merde ! Fais chier !\nJ\'ai une semaine de retard, je suis tombée enceinte : c\'était pas du tout prévu, et je sais pas quoi faire ! \nCa ne peut être que <i:Max>, je me suis tapé personne d\'autre depuis longtemps…\n\nComment je vais faire bordel… Je peux pas m\'occuper d\'un gosse toute seule, j\'arrive même pas à m\'occuper de moi-même, je suis qu\'une paumée…\nFaut que je récupère <i:Max>, malgré ses grands airs je sais que s\'est un type bien qui ne fuira pas ses responsabilités. Mais maintenant que <i:Marie> est revenue ça va être plus compliqué.\nSurtout qu\'avec ma réputation de trainée et de menteuse, comment je vais faire pour le convaincre que le gamin est de lui si je décide de lui dire la vérité ?\n\nPutain j\'ai trop déconné, c\'est la merde!]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111003\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie> vient de débarquer, elle a réussi à s\'évader !\nElle me manquait pas vraiment, mais je pense qu\'en m\'arrangeant bien, ça peut faire du drama ! Cool … cool, cool, cool...\n\nMaintenant il va falloir la cacher, mais ça devrait aller, elle est pas connue dans le coin.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111000\" title=\"\"><DESCRIPTION><![CDATA[Mon ami <i:Max>, son petit fère <i:Theo>, la petite amie de <i:Max>, la jolie <i:Marie>,  et moi, avons tous décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111002\" title=\"\"><DESCRIPTION><![CDATA[Ca y est !\nJ\'ai enfin réussis à me taper <i:Max> ! Plus que <i:Theo>, le petit frère, et j\'ai fait le grand chelem !\nPutain c\'était cool, je me suis bien éclaté. Enfin jusqu\'à ce que <i:Theo> débarque dans la chambre, après ça <i:Max> n\'était plus tellement à ce qu\'il faisait.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Max\" id=\"111004\" pipi=\"1\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[Anarchiste peu convaincu. Il aime <i:Marie>. Il a été chamboulé par l\'arrestation de <i:Marie>. Il s\'est consolé dans les bras de <i:Minna> et regrette aujourd\'hui. Il supporte de moins en moins l\'exaltation de <i:Marie>.\nTout ce qu\'il souhaite c\'est éviter que <i:Minna> mette le grappin sur son frère <i:Theo>]]></DESCRIPTION><TAGS><TAG type=\"Situation Maritale\" value=\"Célibataire\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Charismatique\" weight=\"60\"/><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Sympathique\" weight=\"60\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"70\"/><TAG type=\"Sexe\" value=\"Homme\" weight=\"100\"/></TAGS><RELATIONS><RELATION is_bijective=\"false\" role_id=\"111003\" type=\"Amour\" weight=\"60\"/><RELATION is_bijective=\"false\" role_id=\"111001\" type=\"Amour\" weight=\"80\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111001\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie>, a organisé un coup, il est un peu bancal mais elle insiste pour qu\'on le fasse. Elle est tellement exaltée que personne dans \"la bande\" n\'a jamais eu le cœur de dire non.\n<i:Theo> veut en être je lui ai dit non : pas prêt, pas assez mature… mais il m\'a court-circuité et <i:Marie> a annoncé qu\'elle l\'emmenait.\nAinsi elle a dfinalement cédé.\n\nComme c\'était à craindre, tout s\'est mal passé, <i:Theo> a foiré et <I:Marie> s\'est faite choper. 20 ans fermes. Je ne sais pas si j\'aurai la force de l\'attendre.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111003\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie> vient de débarquer, elle a réussi à s\'évader !\nJe suis fou de joie, mais ça n\'arrange pas mes dilemmes. Ma relation avec <i:Minna> va être compliquée!\n\nEn plus, maintenant il va falloir cacher <i:Marie>, mais ça devrait aller, elle est pas connue dans le coin.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111002\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie> était enfermée depuis 15j et <i:Theo> commençait à déconner grave. Ma vie n\'avait plus de saveur. Seule <i:Minna> restait auprès de moi pour me soutenir. Elle a profité de ma faiblesse et un soir où j\'avais particulièrement le cafard, elle s\'est retrouvée dans mon lit.\n<i:Theo> nous a surpris et il est parti en claquant la porte, nous n\'en avons plus rediscuté depuis.\n\nJ\'aime toujours <i:Marie> mais c\'est vrai que je me remets en doute maintenant qu\'elle est enfermée pour 20 ans. Et <i:Minna> est plutôt cool.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111000\" title=\"\"><DESCRIPTION><![CDATA[Ma petite amie <i:Marie>, ma grande amie <i:Minna>, et mon frère cadet <i:Theo> et moi avons décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Marie\" id=\"111001\" pipi=\"3\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Rebelle pure et dure,  condamnée à 20 ans de réclusion criminelle, elle vient de s\'échapper au bout de 3 mois. Elle aime <i:Max> et en veut à <i:Theo> pour l\'avoir fait tombée.]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Femme\" weight=\"100\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Charismatique\" weight=\"70\"/><TAG type=\"Statut Affectif\" value=\"Amoureux(se)\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Fou\" weight=\"30\"/><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Sanguin\" weight=\"70\"/></TAGS><RELATIONS><RELATION is_bijective=\"false\" role_id=\"111002\" type=\"Haine/Conflit/rivalité\" weight=\"60\"/><RELATION is_bijective=\"false\" role_id=\"111004\" type=\"Amour\" weight=\"80\"/><RELATION is_bijective=\"false\" role_id=\"111003\" type=\"Haine/Conflit/rivalité\" weight=\"50\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111000\" title=\"\"><DESCRIPTION><![CDATA[Mon petit ami <i:Max>, le petit frère de ce dernier <i:Theo>, notre amie <i:Minna> et moi, avons tous décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111003\" title=\"\"><DESCRIPTION><![CDATA[Saloperie ! Je l\'ai fait ! J\'ai juste pété la tête de ce gardien et je suis dehors.\n\nJ\'ai réussi à m\'échapper, je ne purgerai pas ma peine, je suis libre !\n\nJe suis direct allé retrouvé ma bande, ils sauront me cacher.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111002\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie> était enfermée depuis 15j et <i:Theo> commençait à déconner grave. Ma vie n\'avait plus de saveur. Seule <i:Minna> restait auprès de moi pour me soutenir. Elle a profité de ma faiblesse et un soir où j\'avais particulièrement le cafard, elle s\'est retrouvée dans mon lit.\n<i:Theo> nous a surpris et il est parti en claquant la porte, nous n\'en avons plus rediscuté depuis.\n\nJ\'aime toujours <i:Marie> mais c\'est vrai que je me remets en doute maintenant qu\'elle est enfermée pour 20 ans. Et <i:Minna> est plutôt cool.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Theo\" id=\"111002\" pipi=\"1\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Frère de <i:Max>, il l\'admire et le révère. Un peu jaloux de sa relation avec son frère il a du mal à supporter <i:Marie>.\nIl voudrait bien se taper <i:Minna>]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Homme\" weight=\"100\"/><TAG type=\"Trait de personnalité\" value=\"Charismatique\" weight=\"-30\"/><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"80\"/><TAG type=\"Situation Maritale\" value=\"Célibataire\" weight=\"80\"/><TAG type=\"Statut Affectif\" value=\"Amoureux(se)\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Naïf\" weight=\"60\"/></TAGS><RELATIONS><RELATION is_bijective=\"false\" role_id=\"111003\" type=\"Amour\" weight=\"80\"/><RELATION is_bijective=\"false\" role_id=\"111001\" type=\"Haine/Conflit/rivalité\" weight=\"15\"/><RELATION is_bijective=\"true\" role_id=\"111004\" type=\"Fratrie\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111003\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie> vient de débarquer, elle a réussi à s\'évader !\nElle ne me manquait pas vraiment, mais c\'est vrai que je me sentait un peu coupable, et puis <i:Max> était au trente-sixième dessous, donc c\'est plutôt cool.\n\nMaintenant il va falloir la cacher, mais ça devrait aller, elle est pas connue dans le coin.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111002\" title=\"\"><DESCRIPTION><![CDATA[J\'ai chopé <i:Max> en train de tromper <i:Marie> avec <i:Minna>. Putain ça fait chier !  Non que j\'apprécie particulièrement <i:Marie>, mais pour moi <i:Max> était le grand frère idéalisé, aujourd\'hui j\'ai réalisé que ce n\'était qu\'un homme.\nEt puis je suis dingue de <i:Minna>, je l\'aime à mourir, comment je vais faire maintenant ? <i:Max> est tellement mieux que moi…]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111001\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie>, a organisé un coup, j\'ai réussis à la convaincre de me prendre, la belle <i:Minna> m\'a arangée le coup. Je sais que mon frère <i:Max> s\'est opposé à ça, il me trouvait pas prêt et il avait peut être raison.\nTout s\'est pas passé comme prévu, j\'ai foiré et <i:Marie> s\'est faite choper.\nJe crois que du coup mes chances de me faire <i:Minna> sont minces.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111000\" title=\"\"><DESCRIPTION><![CDATA[Mon frère <i:Max>, la petite amie de ce dernier <i:Marie>, ma belle amie <i:Minna>, et moi avons tous décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"111003\" is_public=\"true\"><TITLE><![CDATA[L\'évasion]]></TITLE><DESCRIPTION><![CDATA[Le casse du siècle ! <i:Marie> s\'évade de son lieu de détention. Elle rejoint aussitôt son groupe.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"1\" time_unit=\"d\"/><ABSOLUTE day=\"1\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111001\" is_public=\"true\"><TITLE><![CDATA[L\'Arrestation]]></TITLE><DESCRIPTION><![CDATA[<i:Marie>, <i:Max>, <i:Minna> aidés par <i:Theo> ont organisé un braquage. Mais tout ne s\'est pas passé comme prévu, <i:Theo> a merdé et <i:Marie> s\'est faite chopée. Les autres ont pu s\'enfuir]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"3\" time_unit=\"M\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"3\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111002\" is_public=\"false\"><TITLE><![CDATA[La faute]]></TITLE><DESCRIPTION><![CDATA[<i:Minna> profite de la dépression de <i:Max>, causée par l\'enfermement de <i:Marie>, pour s\'infiltrer dans son lit. <i:Theo> les a surpris.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"15\" time_unit=\"d\"/><ABSOLUTE day=\"15\" hour=\"\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111000\" is_public=\"false\"><TITLE><![CDATA[Association de malfaiteurs]]></TITLE><DESCRIPTION><![CDATA[<i:Marie>, <i:Max>, <i:Minna>et <i:Theo> s\'associent au sein d\'une association criminelle.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"6\" time_unit=\"M\"/><ABSOLUTE day=\"\" hour=\"\" minute=\"\" month=\"6\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111004\" is_public=\"false\"><TITLE><![CDATA[Les fâcheuses conséquences]]></TITLE><DESCRIPTION><![CDATA[<i:Minna>  fait un test de grossesse et s\'est le drame, elle est enceinte de <i:Max>]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><RELATIVE time=\"12\" time_unit=\"h\"/><ABSOLUTE day=\"\" hour=\"12\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS/><GENERIC_PLACES/><GENERIC_RESOURCES/></PLOT><PLOT author=\"1\" creation_date=\"1385313489000\" id=\"999901\" is_evenemential=\"false\" is_mainstream=\"false\" is_public=\"false\" last_update_date=\"1385313489000\" title=\"Life\"><DESCRIPTION>Life</DESCRIPTION><TAGS/><ROLES><ROLE code=\"Life\" id=\"999901\" pipi=\"0\" pipr=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[Vie du personnage]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1000318\" title=\"\"><DESCRIPTION><![CDATA[Premier flirt]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000298\" title=\"\"><DESCRIPTION><![CDATA[Naissance]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000323\" title=\"\"><DESCRIPTION><![CDATA[A une aventure d\'un soir]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000309\" title=\"\"><DESCRIPTION><![CDATA[Tombe dans les escaliers et doit porter un platre 3 mois]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000314\" title=\"\"><DESCRIPTION><![CDATA[Trouve son premier emploi]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past