"><TAGS><TAG type=\"&gt; Type Ressource\" value=\"&gt; Arme\" weight=\"100\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"50\"/></TAGS><COMMENT><![CDATA[Arme possédée par <i:TUEUR>]]></COMMENT></GENERIC_RESOURCE><GENERIC_RESOURCE code=\"ARME3\" id=\"1095\" object_type_id=\"0\"><TAGS><TAG type=\"&gt; Type Ressource\" value=\"&gt; Arme\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Arme possédée par <i:POLICE>]]></COMMENT></GENERIC_RESOURCE><GENERIC_RESOURCE code=\"MESSAGE1\" id=\"1097\" object_type_id=\"0\"><TAGS><TAG type=\"&gt; Type Ressource\" value=\"&gt;&gt; Document\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Message pour <i:CHEF> : Pas de nouvelles de <i:ESPION> depuis plus de deux mois. Attendons confirmation pour lancer enquête.]]></COMMENT></GENERIC_RESOURCE><GENERIC_RESOURCE code=\"TRAVAUX\" id=\"1091\" object_type_id=\"0\"><TAGS><TAG type=\"&gt; Type Ressource\" value=\"&gt;&gt; Document\" weight=\"90\"/><TAG type=\"&gt;&gt; Document\" value=\"Document textuel (Document)\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Objet recherché par tout le monde. Contient des informations importantes.]]></COMMENT></GENERIC_RESOURCE><GENERIC_RESOURCE code=\"IDENTITE\" id=\"1094\" object_type_id=\"0\"><TAGS><TAG type=\"&gt; Type Ressource\" value=\"&gt; Représentation\" weight=\"50\"/><TAG type=\"&gt;&gt; Document\" value=\"Identité (Document)\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Document prouvant l\'identité réelle de <i:POLICE>]]></COMMENT></GENERIC_RESOURCE><GENERIC_RESOURCE code=\"ORDRE1\" id=\"1096\" object_type_id=\"0\"><TAGS><TAG type=\"&gt; Type Ressource\" value=\"&gt; Messages et Invitations (Document)\" weight=\"100\"/><TAG type=\"&gt; Type Ressource\" value=\"&gt;&gt; Document\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Message à remettre à <i:TUEUR> de la part de <i:CHEF>, durant la soirée :\n\n\"Tue <i:SCI> et débarasse-toi de son corps. N\'en parle pas à <i:CONTRE>.]]></COMMENT></GENERIC_RESOURCE></GENERIC_RESOURCES></PLOT><PLOT author=\"1\" creation_date=\"1406148356000\" id=\"114\" is_evenemential=\"false\" is_mainstream=\"false\" is_public=\"true\" last_update_date=\"1400796000000\" title=\"Rencontre embarassante - VF1\"><DESCRIPTION>&lt;i:Servante&gt;, la servante de &lt;i:Dominus&gt; et &lt;i:Domina&gt;, s\'absente pendant ses heures de service pour discrètement retrouver son petit ami &lt;i:PetitAmi&gt;: si &lt;i:Domina&gt; la surprend, elle est fichue. Malheureusement pendant son escapade, elle tombe nez à nez avec son maître &lt;i:Dominus&gt; avec son amante &lt;i:Maîtresse&gt;.</DESCRIPTION><PITCH_ORGA>&lt;i:Servante&gt;, la servante de &lt;i:Dominus&gt; et &lt;i:Domina&gt;, s\'absente pendant ses heures de service pour discrètement retrouver son petit ami &lt;i:PetitAmi&gt;: si &lt;i:Domina&gt; la surprend, elle est fichue. Malheureusement pendant son escapade, elle tombe nez à nez avec son maître &lt;i:Dominus&gt; avec son amante &lt;i:Maîtresse&gt;.</PITCH_ORGA><PITCH_PNJ/><PITCH_PJ/><TAGS><TAG type=\"Sentiments Intrigue\" value=\"Amour\" weight=\"50\"/><TAG type=\"Tag Univers\" value=\"Trône de Fer / Game of Thrones\" weight=\"101\"/></TAGS><ROLES><ROLE code=\"Servante\" id=\"111006\" pipi=\"3\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Servante pour <i:Dominus> et <i:Domina>. S\'absentant régulièrement pendant son service pour rejoindre au <l:Spectacle>  son petit ami <i:PetitAmi> (depuis quelques mois) et notamment hier (alors que son jour de congés est aujourd\'hui).  Sauf qu\'hier elle y a surpris <i:Dominus> avec sa maîtresse <i:Maîtresse>.]]></DESCRIPTION><TAGS/><RELATIONS><RELATION description=\"&lt;i:Servante&gt; est au service de &lt;i:Domina&gt; sa maîtresse\" is_bijective=\"false\" role_id=\"111007\" type=\"Hiérarchie Asc\" weight=\"101\"/><RELATION description=\"&lt;i:Servante&gt; est au service de &lt;i:Dominus&gt; son maître\" is_bijective=\"false\" role_id=\"111008\" type=\"Hiérarchie Asc\" weight=\"101\"/><RELATION description=\"&lt;i:Servante&gt; et &lt;i:PetitAmi&gt; sont amants.\" is_bijective=\"true\" role_id=\"111010\" type=\"Amour\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111006\" title=\"\"><DESCRIPTION><![CDATA[Aujourd\'hui je vais au <l:Spectacle> : la place est fort chère pour moi et catastrophe, je me suis trompée sur le prix de la place : il me manque quelques sous pour rentrer, et le caissier ne veut rien savoir. \nUn galant jeune homme sort de la file pour déposer au caissier les quelques sous manquant et nous rentrons ainsi tous deux. Je le gratifie d\'un sourire, il se présente et me dit s\'appeler <i:PetitAmi>. Je le trouve charmant avec ses airs assurés et son élégance toute naturelle. \nNous faisons connaissances, il vit bourgeoisement, je lui dit que je ne suis \"que\" domestique en la <l:Demeure> de <i:Domina> et <i:Dominus> mais cela ne semble pas le gêner que nous ne soyons pas vraiment de la même condition sociale.\n\nQuelques jours se sont écoulés, et nous flirtons ensemble. Il a découvert que j\'aime beaucoup le <l:Spectacle> et il m\'offre la place chaque semaine pour que puissions nous retrouver, enfin quand son emploi du temps le permet (parfois, il me faut m\'y rendre secrètement pendant mes heures de service).]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111008\" title=\"\"><DESCRIPTION><![CDATA[Merveilleuse Catastrophe ! <i:PetitAmi> vient de me laisser un petit billet doux où il me dit qu\'il m\'attend à la séance de 16h30 au <l:Spectacle> , où nous avons l\'habitude de nous retrouver !  \nIl a dû changer son programme, nous ne devions y aller que DEMAIN, car c\'est mon jour de congés hebdomadaire !\nTant pis j\'y avais… Il faudra que je prépare malgré tout une bonne explication auprès de <i:Domina> qui ne manquera pas de surprendre - et s\'offusquer - de mon absence...]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111009\" title=\"\"><DESCRIPTION><![CDATA[Je me rends donc au <l:Spectacle>. Les lieux sont dans la pénombre et j\'ai beaucoup de mal à retrouver <i:PetitAmi> au milieu de toute cette foule. \nIl a belle allure et d\'une élégance irrésistible. Moi aussi je me suis mise sur mon 31, enfin...  aussi vite que j\'ai pu.\nUne fois assis, il me prend par les épaules, j\'adore quand il fait cela. Ces instants me paraissent aussi délicieux qu\'interminables quand un peu de lumière regagne la salle: c\'est l\'entracte.\nUn homme deux rangs devant nous se lève et se retourne, sans doute pour rejoindre les lavabos : Ciel ! c\'est <i:Dominus> ! Il me regarde, voit la main de <i:PetitAmi> (qu\'il connaît peut-être qui sait ?) autour de mes épaules, et je vois une jeune femme penchée sur <i:Dominus> : ce n\'est pas <i:Domina>.\nJe ne peux distinguer à cette distance qui est cette femme... Sans doute la poule de Monsieur ? Nos regards se croisent avec  <i:Dominus> je suis bouleversée d\'embarras, mais il le semble autant. \nIl sait que je me suis absenté pendant mon services et pourrait me licencier sans mes gages ! mais cette poule ? si Madame <i:Domina> venait à l\'apprendre.... \nJe crois qu\'à présente nous nous tenons l\'un l\'autre ! \nNous sortons de la salle du <l:Spectacle> sans nous dire un mot avec <i:Dominus>]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Domina\" id=\"111007\" pipi=\"2\" pipr=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[Est mariée avec <i:Dominus> , ils ont embauché <i:Servante> comme servante en fixant son jour hebdomadaire de congés à aujourd\'hui.]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Femme\" weight=\"101\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:Domina&gt; et &lt;i:Dominus&gt; sont officiellement mariés\" is_bijective=\"true\" role_id=\"111008\" type=\"Mariage\" weight=\"101\"/><RELATION description=\"&lt;i:Domina&gt; a &lt;i:Servante&gt; comme servante\" is_bijective=\"false\" role_id=\"111006\" type=\"Hiérarchie Desc\" weight=\"101\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111008\" title=\"\"><DESCRIPTION><![CDATA[Mais où est-elle passée ? Ce n\'est pas son jour de congés pourtant aujourd\'hui elle devrait être à son service : son congés c\'est DEMAIN !\nQuand je la reverrai, je lui demanderai où ellle est passé. Je la paye pour faire son service, pas pour disparaître quand je la cherche !\nDe plus je ne peux demander à mon mari de m\'aider à reprendre <i:Servante>, d\'une part parce qu\'il ne s\'occupe guère des affaires du personnel, d\'autre part parce qu\'il m\'a dit qu\'il rentrerait très tard ce soir, ayant beaucoup de travail aujourd\'hui.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111007\" title=\"\"><DESCRIPTION><![CDATA[Depuis 3 mois, cela ne va pas bien entre mon époux <i:Dominus> et moi, et nous sommes tout le temps en train de nous chamailler pour un rien. Je crois que depuis le temps que nous sommes mariés, nous nous sommes un peu éloignés l\'un de l\'autre. La moindre occasion est devenu le prétexte à une dispute.\nJ\'espère au moins qu\'il ne fréquente personne d\'autre que moi !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Maîtresse\" id=\"111009\" pipi=\"1\" pipr=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[A une liaison avec <i:Dominus> , un homme marié, qu\'elle rencontre chaque semaine en secret. Hier ils se sont vu au <l:Spectacle>]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"111009\" title=\"\"><DESCRIPTION><![CDATA[<i:Dominus> m\'a fait porter ce matin une belle surprise : une place pour aller le retrouver au <l:Spectacle> ! J\'en suis ravie. \nJe me mets un peu sur mon 31 et je l\'y retrouve à 17h. Il y a énormément de monde et dans la pénombre, j\'ai beaucoup de mal à le retrouver dans la foule.\nIl m\'a acheté quelques chocolats que nous dégustons pendant le <l:Spectacle> comme deux enfants. \n\nA l\'entracte, nous réalisons que nous avons du chocolat plein les doigts et convenons d\'aller nous laver les mains. Il semble bouleversé en revenant, mais ne dit pourquoi. Je n\'ose lui poser de question sur le coup : il a certainement du reconnaître une connaissance avec laquelle il est en affaire, et du fait du caractère particulier et récent de notre liaison, nous ne faisons que commencer à parler de nos affaires privées : peut-être est-il gêné d\'être vu avec moi (et non son épouse <i:Domina>) ?]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111007\" title=\"\"><DESCRIPTION><![CDATA[Il y a deux mois, j\'ai rencontré, puis me suis rapproché de <i:Dominus>, un homme marié. Entre nous est née bien vite une passion torride et nous essayons de nous voir le plus souvent possible, dans des endroits chaque fois différents.... avec elle j\'ai l\'impression d\'avoir retrouvé mes 20ans.\nOh ! nous ne nous racontons pas grand chose de bien sorcieurs, nous sommes juste heureux de nous retrouver, nous amuser, et passer du bon temps si vous voyez ce que je veux dire !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"PetitAmi\" id=\"111010\" pipi=\"0\" pipr=\"2\" type=\"PJ\"><DESCRIPTION><![CDATA[Le petit ami depuis quelques mois de <i:Servante>, ils se retrouvent régulièrement au <l:Spectacle>.]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Homme\" weight=\"101\"/></TAGS><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"111009\" title=\"\"><DESCRIPTION><![CDATA[Je retrouve <i:Servante> au <l:Spectacle> comme convenu, toujours ravissante. Moi aussi je me suis mis sur mon 31.\nIl y a énormément de monde dans la pénombre, j\'ai beaucoup de mal à la retrouver dans la foule. Une fois assis dans la pénombre, je la prends par les épaules, je la sens heureuse de se lover contre moi.\nCes instants me paraissent aussi délicieux qu\'interminables quand un peu de lumière regagne la salle : c\'est l\'entracte.\nBeaucoup de gens en profitent pour se lever et se diriger vers les lavabos, j\'ai l\'impression que cet entracte brise le charme de ce tendre moment avec <i:Servante>, et j\'aimerais que le <l:Spectacle> reprenne le fil au plus vite.\nQuand le <l:Spectacle> reprend, je sens <i:Servante> plus tendue... Je n\'ose lui en parler sur le moment. Quand nous nous reverrons, j\'aborderai peut être les raisons de sa contrariété : ai-je fait ou dit  quelque chose ? ou plutôt omis de faire/dire quelque chose ?\nAh! ce que les femmes sont compliquées parfois !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111008\" title=\"\"><DESCRIPTION><![CDATA[Demain c\'est le jour de congés de <i:Servante> et nous devions nous retrouver au <l:Spectacle>. Malheureusement, j\'ai une journée bien chargée demain, et nous ne pourrons sans doute pas nous retrouver au <l:Spectacle> comme nous en avons l\'habitude.\nJe viens de faire porter à <i:Servante> un petit biller doux et je lui dis que je l\'attends à 16h30 au <l:Spectacle> : elle est si maligne qu\'elle arrive toujours à s\'absenter pendant ses heures de services sans que sa maîtresse <i:Domina> ne lui créée trop de soucis.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111005\" title=\"\"><DESCRIPTION/></PAST_SCENE><PAST_SCENE past_scene_id=\"111006\" title=\"\"><DESCRIPTION><![CDATA[Aujourd\'hui je me suis rendu au <l:Spectacle> et dans la file d\'attente, il y a une jeune femme qui visiblement s\'est trompée sur le prix de la place et à laquelle il manque quelques sous pour rentrer. Le caissier ne veut rien savoir. Je sors de la file et offre les quelques sous manquant à la jolie malheureuse, qui me gratifie du plus charmant des sourires. Elle me dit s\'appeler <i:Servante>. Nous faisons connaissance, et me dit être domestique en la <l:Demeure> de <i:Dominus> et <i:Domina> où elle travaille dur, n\'ayant qu\'une journée de congés par semaine pour aller se divertir.\nJe suis immédiatement séduit par son sourire.\nQuelques jours se sont écoulés et nous flirtons déjà ensemble. J\'ai découvert que <i:Servante> adore le <l:Spectacle>, et je lui offre la place chaque semaine pour que nous puissions nous retrouver, enfin,... quand mon emploi du temps le permet (je crois qu\'elle me retrouve ainsi parfois pendant ses heures de service).]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Dominus\" id=\"111008\" pipi=\"3\" pipr=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[<i:Dominus> est marié avec <i:Domina>,ils ont embauché <i:Servante> comme servante en fixant son jour hebdomadaire de congés à aujourd\'hui.\n<i:Dominus> a depuis quelques mois une liaison avec <i:Maîtresse> qu\'il rencontre en secret. Hier il l\'a rencontrée au <l:Spectacle> mais malheureusement, il s\'y est fait surprendre par <i:Servante>, qui se divertit pendant ses heures de service !]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Homme\" weight=\"101\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:Dominus&gt; et &lt;i:Domina&gt; sont secrètement amants.\" is_bijective=\"true\" role_id=\"111009\" type=\"Amour\" weight=\"101\"/><RELATION description=\"&lt;i:Dominus&gt; a &lt;i:Servante&gt; comme servante\" is_bijective=\"false\" role_id=\"111006\" type=\"Hiérarchie Desc\" weight=\"101\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111009\" title=\"\"><DESCRIPTION><![CDATA[J\'ai fait porter ce matin à <i:Maîtresse> une surprise : une place pour aller le retrouver au <l:Spectacle> ! \nNous n\'y sommes jamais allé ensemble, et j\'ai raconté à mon épouse <i:Domina> que je rentrerai tard ce soir du fait d\'une surcharge de travail.\n<i:Maitresse> me retrouve, toujours aussi élégante.\nIl y a énormément de monde dans la pénombre et j\'ai beaucoup de mal à le retrouver dans la foule. Je lui ai acheté à l\'accueil quelques chocolats que nous dégustons pendant le <l:Spectacle> comme deux enfants !\nA l\'entracte, nous réalisons que avons du chocolat plein les doigts et convenons d\'aller nous laver les mains. Dès que je me lève pour rejoindre les lavabos, je découvre que peu derrière nous se trouve <i:Servante>, avec un jeune homme. Nos regards se croisent.\nLe jeune homme regarde ailleurs et dans la faible luminosité, je le distingue trop mal pour le reconnaître. Mais si j\'en crois la main du jeune homme autour des épaules de <i:Servante>, ils sont proches ! \nIl est évident qu\'elle a remarqué que je n\'étais pas avec mon épouse, et connaît peut-être même <i:Maîtresse>. Je suis bouleversé d\'embarras, mais elle le semble autant. Je viens de réaliser que ce n\'est pas son jour de congés aujourd\'hui, et que si mon épouse découvre les raisons de son absence, elle est licenciée sur le champ et sans ses gages ! Bref nous nous tenons l\'un l\'autre ! \nNous sortons de la salle du Spectacle sans nous dire un mot avec <i:Servante>]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111007\" title=\"\"><DESCRIPTION><![CDATA[Depuis 3 mois, cela ne va pas bien entre mon épouse <i:Domina> et moi, et nous sommes tout le temps en train de nous chamailler pour un rien. Je crois que depuis le temps que nous sommes mariés, nous nous sommes un peu éloignés l\'un de l\'autre. La moindre occasion est devenue le prétexte à une dispute.\nJ\'espère au moins qu\'elle ne fréquente personne d\'autre que moi. Pas comme moi !....\nEn effet, il y a deux mois j\'ai rencontré - puis me suis rapproché - de <i:Maîtresse>. Entre nous est née bien vite une passion torride et nous essayons de nous voir le plus souvent possible, dans des endroits chaque fois différents.... \nAvec elle j\'ai l\'impression d\'avoir retrouvé mes 20ans !\nOh ! nous ne nous racontons pas grand-chose de bien sorciers, nous sommes juste heureux de nous retrouver, nous amuser, et passer du bon temps si vous voyez ce que je veux dire !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"111007\" is_public=\"false\"><TITLE><![CDATA[Liaison <i:Dominus> et <i:Maîtresse>]]></TITLE><DESCRIPTION><![CDATA[<i:Dominus> a pris <i:Maîtresse> pour maîtresse, en secret de son épouse <i:Domina>.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"2\" year=\"1\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111008\" is_public=\"false\"><TITLE><![CDATA[Absence de <i:Servante>]]></TITLE><DESCRIPTION><![CDATA[<i:Servante> quitte discrètement <l:Demeure> pendant ses heures de service pour rejoindre son flirt <i:PetitAmi>. Malheureusement <i:Domina> s\'en aperçoit.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1135\"/></GENERIC_PLACES><TIME><ABSOLUTE day=\"1\" hour=\"3\" isAbsoluteDay=\"false\" isAbsoluteHour=\"true\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"0\" year=\"1\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111009\" is_public=\"false\"><TITLE><![CDATA[Au <l:Spectacle>]]></TITLE><DESCRIPTION><![CDATA[Au <l:Spectacle> se retrouvent <i:Servante> (pendant ses heures de service) avec <i:PetitAmi>  (comme d\'habitude) et <i:Dominus> avec sa maîtresse <i:Maîtresse> (c\'est la première fois qu\'ils se retrouvent là).\nMalheureusement <i:Servante> et  <i:Dominus> vont tomber nez à nez l\'un sur l\'autre]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"111008\"/></PREDECESSORS><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1134\"/></GENERIC_PLACES><TIME><ABSOLUTE day=\"1\" hour=\"5\" isAbsoluteDay=\"false\" isAbsoluteHour=\"true\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"0\" year=\"1\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111006\" is_public=\"false\"><TITLE><![CDATA[Flirt <i:PetitAmi> et <i:Servante>]]></TITLE><DESCRIPTION><![CDATA[<i:PetitAmi> et <i:Servante> flirtent ensemble.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"31\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"2\" year=\"1\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111005\" is_public=\"false\"><TITLE><![CDATA[Embauche de <i:Servante>]]></TITLE><DESCRIPTION><![CDATA[<i:Dominus> et <i:Domina>  embauchent <i:Servante> comme servante à leur <l:Demeure>]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"31\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"11\" year=\"1\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS><EVENT absolute_timing=\"01/04/2015 11:20\" duration=\"5\" id=\"10803\" is_planned=\"false\" is_public=\"false\" timing=\"5\"><TITLE><![CDATA[Démasqués !]]></TITLE><DESCRIPTION><![CDATA[1 PNJ / Orga\n- Montrer à <i:Dominus> le joueur incarnant <i:PetitAmi> (sans lui donner son nom) et lui dire que c\'est l\'homme qui était \" avec \" <i:Servante> au <l:Spectacle> hier\n- Montrer à <i:Servante> la joueuse incarnant  <i:Maîtresse> (sans lui donner son nom) et lui dire que c\'est la femme qui était \" avec \" <i:Dominus> au <l:Spectacle> hier]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/></EVENT></EVENTS><GENERIC_PLACES><GENERIC_PLACE code=\"Demeure\" id=\"1135\" object_type_id=\"1\"><TAGS><TAG type=\"Fonction Lieu\" value=\"Habitation et Résidence\" weight=\"100\"/><TAG type=\"Richesse\" value=\"Riche\" weight=\"100\"/><TAG type=\"&gt; Lieu Superficie\" value=\"&gt; Edifice - Batîment\" weight=\"100\"/></TAGS><COMMENT><![CDATA[La demeure de <i:Domina> et <i:Dominus>]]></COMMENT></GENERIC_PLACE><GENERIC_PLACE code=\"Spectacle\" id=\"1134\" object_type_id=\"2\"><TAGS><TAG type=\"Fonction Lieu\" value=\"Lieu Divertissement\" weight=\"100\"/><TAG type=\"&gt; Lieu Superficie\" value=\"&gt; Edifice - Batîment\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Un lieu de spectacle]]></COMMENT></GENERIC_PLACE></GENERIC_PLACES><GENERIC_RESOURCES/></PLOT><PLOT author=\"1\" creation_date=\"1400796000000\" id=\"203\" is_evenemential=\"true\" is_mainstream=\"false\" is_public=\"true\" last_update_date=\"1418677441000\" title=\"(Evt) Annonce Fiançailles\"><DESCRIPTION>Les personnages participent à une réception donnée en l\'honneur de l\'annonce des fiançailles de deux d\'entre eux</DESCRIPTION><PITCH_ORGA>Les personnages participent à une réception festive, donnée à &lt;l:none:lieu&gt; par &lt;i:none:fiancé&gt; et &lt;i:none:fiancée&gt; pour célébrer l\'annonce de leur fiançailles.</PITCH_ORGA><PITCH_PNJ>Les personnages participent à une réception festive, donnée à &lt;l:none:lieu&gt; par &lt;i:none:fiancé&gt; et &lt;i:none:fiancée&gt; pour célébrer l\'annonce de leur fiançailles.</PITCH_PNJ><PITCH_PJ>Vous participez à une réception festive, donnée à &lt;l:none:lieu&gt; par &lt;i:none:fiancé&gt; et &lt;i:none:fiancée&gt; pour célébrer l\'annonce de leur fiançailles.</PITCH_PJ><TAGS><TAG type=\"Tag Univers\" value=\"France Steampunk 1863-1912 (Jules Verne)-Univ\" weight=\"90\"/><TAG type=\"Ambiance intrigue\" value=\"Gaie\" weight=\"100\"/><TAG type=\"Tag Univers\" value=\"Grèce Antique (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Ancien Régime Fr (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Espace2xxx - conquête spatiale\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Contemporain France (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Harry Potter Anglais Fantastique (Univers)\" weight=\"90\"/><TAG type=\"Ambiance intrigue\" value=\"Solenelle\" weight=\"60\"/><TAG type=\"Tag Univers\" value=\"Contemporain Anglais (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Star Wars (Univers)\" weight=\"90\"/><TAG type=\"Occasions Spéciales\" value=\"Fête\" weight=\"100\"/><TAG type=\"Tag Univers\" value=\"Trône de Fer / Game of Thrones\" weight=\"90\"/><TAG type=\"Occasions Spéciales\" value=\"Fiançailles\" weight=\"100\"/><TAG type=\"Tag Univers\" value=\"XiXème siècle Britannique (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Super-Héros U.S. (Univers)\" weight=\"90\"/><TAG type=\"Ambiance intrigue\" value=\"Huis-clos\" weight=\"-101\"/></TAGS><ROLES><ROLE code=\"TousParticipants\" id=\"2018\" pipi=\"0\" pipr=\"0\" type=\"TPJ\"><DESCRIPTION><![CDATA[Tous les participants à la fête]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES/><EVENTS/></ROLE><ROLE code=\"fiancé\" id=\"2004\" pipi=\"0\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[Célèbre ses fiançailles avec <i:fiancée>  à <l:lieu>.]]></DESCRIPTION><TAGS><TAG type=\"Situation Maritale\" value=\"Fiancé(e )\" weight=\"100\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:fiancée&gt; et &lt;i:aidant&gt;  se connaissent\" is_bijective=\"true\" role_id=\"2007\" type=\"Haine/Conflit/rivalité\" weight=\"-101\"/><RELATION description=\"&lt;i:fiancé&gt; et &lt;i:fiancée&gt;  s\'aiment et se fiancient\" is_bijective=\"true\" role_id=\"2005\" type=\"Amour\" weight=\"100\"/><RELATION description=\"&lt;i:fiancé&gt; et &lt;i:aidant&gt;  sont proches \" is_bijective=\"true\" role_id=\"2006\" type=\"Haine/Conflit/rivalité\" weight=\"-101\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"2006\" title=\"\"><DESCRIPTION><![CDATA[Nous avons décidé d\'organiser une fête pour nos fiançailles à <i:fiancée> et moi. Le choix n\'était guère facile, et nous avons pris du temps pour faire la liste. Et finalement, nous nous sentions bien fiers lorsque les <o:carton> pour la fête sont partis, et plus encore lorsque nous avons reçu les réponses réponses (presque) toutes positives. \nNous avons demandé à notre cher <i:aidant> de nous aider pour l\'organisation de la fête, mais bien vite il s\'est avéré que son talent d\'organisation était tel que nous lui avons confié intégralement l\'organisation de la fête.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2005\" title=\"\"><DESCRIPTION><![CDATA[<i:fiancée> et moi nous fréquentons depuis déjà pas mal de temps et nous avons parlé de passer aux choses \"sérieuses\".\nJe me souviendrai je pense toute ma vie du moment où j\'ai demandé à <i:fiancée> de se fiancer avec moi, et toute ma vue durant je me souviendrai de son \"oui\".]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2008\" title=\"\"><DESCRIPTION><![CDATA[Tout est en place, <i:aidant> a vraiment fait les choses bien et semble ravi. Les invités ne vont plus tarder à arriver ! Peu de temps après le début de la fête <i:fiancée> et moi avons d\'ailleurs préparé un petit discours (Note : à préparer par vous deux) pour remercier les invités de leur venue et particulièrement <i:aidant> pour son aide.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"2005\" is_announced=\"true\"><TITLE><![CDATA[Le discours]]></TITLE><DESCRIPTION><![CDATA[Il est convenu avec <i:aidant> que je fasse un discours (A préparer) pour remercier les invités de leur venue (et ce que ne sait pas <i:aidant>, c\'est que j\'en profiterai pour le remercier chaleureusement pour son aide pour l\'organisation !).]]></DESCRIPTION><COMMENT><![CDATA[A préparer par  <i:fiancée> et  <i:fiancé>]]></COMMENT><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"invité\" id=\"2006\" pipi=\"0\" pipr=\"2\" type=\"PJG\"><DESCRIPTION><![CDATA[Invité à la fête des fiançailles de <i:fiancée> avec <i:fiancé>, organisé par <i:aidant>]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"2008\" title=\"\"><DESCRIPTION><![CDATA[Je ne dois pas me mettre en retard, c\'est l\'heure pour partir à la fête des fiançailles de <i:fiancée> et <i:fiancé>. <i:aidant> est renommé pour savoir organiser des fêtes, cela va être un grand moment !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2007\" title=\"\"><DESCRIPTION><![CDATA[En ce moment, je travaille beaucoup pour que la fête des fiançailles de <i:fiancée> et <i:fiancée> soit très réussie, je pense qu\'ils vont être ravis]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2006\" title=\"\"><DESCRIPTION><![CDATA[J\'ai reçu ce matin un <o:carton> pour la célébration des fiançailles de <i:fiancé> et <i:fiancée>. Cela fait déjà quelques temps qu\'ils se \"fréquentent\" et je suis très heureux de pouvoir partager avec eux ce moment pour célébrer leur bonheur.\nD\'après le carton, c\'est <i:aidant> qui a pris en charge l\'organisation de la fête, cela devrait être très réussi !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"fiancée\" id=\"2005\" pipi=\"0\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[Célèbre ses fiançailles avec <i:fiancé>  à <l:lieu>.]]></DESCRIPTION><TAGS><TAG type=\"Situation Maritale\" value=\"Fiancé(e )\" weight=\"100\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:fiancé&gt; et &lt;i:aidant&gt;  sont proches \" is_bijective=\"true\" role_id=\"2006\" type=\"Haine/Conflit/rivalité\" weight=\"-101\"/><RELATION description=\"&lt;i:fiancé&gt; et &lt;i:aidant&gt;  se connaissent\" is_bijective=\"true\" role_id=\"2007\" type=\"Haine/Conflit/rivalité\" weight=\"-101\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"2008\" title=\"\"><DESCRIPTION><![CDATA[Tout est en place, <i:aidant> a vraiment fait les choses bien et semble ravi. Les invités ne vont plus tarder à arriver ! Peu de temps après le début de la fête <i:fiancé> et moi avons d\'ailleurs préparé un petit discours (Note : à préparer par vous deux) pour remercier les invités de leur venue et particulièrement <i:aidant> pour son aide.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2006\" title=\"\"><DESCRIPTION><![CDATA[Nous avons décidé d\'organiser une fête pour nos fiançailles à <i:fiancé> et moi. Le choix n\'était guère facile, et nous avons pris du temps pour faire la liste. Et finalement, nous nous sentions bien fiers lorsque les <o:carton> pour la fête sont partis, et plus encore lorsque nous avons reçu les réponses (presque) toutes positives.\nNous avons demandé à notre cher <i:aidant> de nous aider pour l\'organisation de la fête, mais bien vite il s\'est avéré que son talent d\'organisation était tel que nous lui avons confié intégralement l\'organisation de la fête.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2005\" title=\"\"><DESCRIPTION><![CDATA[<i:fiancé> et moi nous fréquentons depuis déjà pas mal de temps et nous avons parlé de passer aux choses \"sérieuses\".\nJe me souviendrai je pense toute ma vie du moment où il m\'a demandé de se fiancer avec moi, et toute ma vue durant je me souviendrai de mon \"oui\".]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"2005\" is_announced=\"true\"><TITLE><![CDATA[Le discours]]></TITLE><DESCRIPTION><![CDATA[Il est convenu avec <i:aidant>  que <i:fiancé> et moi fassions un discours pour remercier les invités de leur venue (et particulièrement <i:aidant> de son aide pour l\'organisation !).]]></DESCRIPTION><COMMENT><![CDATA[A préparer par  <i:fiancée> et  <i:fiancé>]]></COMMENT><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"aidant\" id=\"2007\" pipi=\"0\" pipr=\"2\" type=\"PJ\"><DESCRIPTION><![CDATA[<i:aidant> a aidé <i:fiancéé> et <i:fiancée> à organiser sa fête de fiançailles qui se tient à <l:lieu>.]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"2008\" title=\"\"><DESCRIPTION><![CDATA[Tout est en place, je suis très satisfait de mon travail, <i:fiancée> et <i:fiancé>semblent absolument ravis ! Les invités ne vont plus tarder à arriver !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2006\" title=\"\"><DESCRIPTION><![CDATA[<i:fiancée> et <i:fiancé> qui me sont si chers sont venus pour m\'annoncer une grande nouvelle : ils vont se fiancer ! Cela fait quelques temps qu\'ils se \"fréquentent\", je ne suis donc pas tant surpris que très heureux pour eux.\nIls souhaitent organiser une fête pour l\'occasion et sont venus quérir mon conseil. J\'ai pas mal d\'idées, et dépassées par ma créativité en la matière, ils me donnent carte blanche pour l\'organisation de la fête. La première urgence est de lancer les invitations, et bien vite les <o:carton> partent aux invités, tandis (presque) tous sont revenus avec une réponses positive]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"2005\" is_announced=\"true\"><TITLE><![CDATA[Le discours]]></TITLE><DESCRIPTION><![CDATA[Il est convenu avec <i:fiancée> et <i:fiancé> qu\'ils fassent un discours pour remercier les invités]]></DESCRIPTION><COMMENT><![CDATA[A préparer par  <i:fiancée> et  <i:fiancé>]]></COMMENT><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"2005\" is_public=\"false\"><TITLE><![CDATA[Décision de se fiancer]]></TITLE><DESCRIPTION><![CDATA[<i:fiancé> et <i:fiancée> décident de se fiancer et demandent à <i:aidant> de leur organiser une fête à <l:lieu>  pour marquer l\'évènement.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"9\" year=\"2014\"/></TIME></PAST_SCENE><PAST_SCENE id=\"2007\" is_public=\"false\"><TITLE><![CDATA[Préparatifs]]></TITLE><DESCRIPTION><![CDATA[Les préparatifs se mettent en place]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"2006\"/></PREDECESSORS><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"8\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"3\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"2006\" is_public=\"false\"><TITLE><![CDATA[Invitations]]></TITLE><DESCRIPTION><![CDATA[Les cartons d\'invitation partent]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"2005\"/></PREDECESSORS><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"0\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"2008\" is_public=\"false\"><TITLE><![CDATA[Aller à la fête]]></TITLE><DESCRIPTION><![CDATA[Les invités partent à 