ue=\"Trône de Fer / Game of Thrones\" weight=\"90\"/></TAGS><ROLES><ROLE code=\"aidant\" id=\"2025\" pipi=\"0\" pipr=\"2\" pjgp=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[<i:aidant> a aidé <i:hôte> à organiser <r:TypeReception> à <l:lieu>.]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"2019\" title=\"La fête est imminente !\"><DESCRIPTION><![CDATA[Tout est en place, je suis très satisfait de mon travail, et <i:hôte> semble ravi ! Les invités ne vont plus tarder à arriver ! Je sais que <i:hôte> a prévu de faire un petit discours pour remercier les invités de leur venue.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2017\" title=\"La &lt;r:TypeReception&gt; de &lt;i:hôte&gt;\"><DESCRIPTION><![CDATA[<i:hôte> est venu me trouver car il souhaitait donner un <r:TypeReception>\r\n<i:hôte> souhaitait avoir mon avis et mon conseil. Nous avons commencé à en discuter et je me suis montré très inspiré. Après une brêve discussion, <i:hôte> m\'a finalement confié l\'intégralité de l\'organisation de sa fête qui se tiendra à <l:lieu>, ne s\'occupant que de sélectionner les invités. De mon côté j\'étais très enthousiaste.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2018\" title=\"L\'invitation\"><DESCRIPTION><![CDATA[Après en avoir longuement débattu avec <i:hôte>, ça y est ! Les <o:carton> d\'invitation pour sa  <r:TypeReception> partent ! Nous sommes tous deux très excités à la perspective de cette  réception !\r\n(Quelques jours après, le flot des réponses, presque toutes positives, arrivent : j\'en informe <i:hôte>)]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"invité\" id=\"2026\" pipi=\"0\" pipr=\"2\" pjgp=\"100\" type=\"PJG\"><DESCRIPTION><![CDATA[Invité par <i:hôte> qui donne <r:TypeReception> organisé par <i:aidant>]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"2018\" title=\"L\'invitation\"><DESCRIPTION><![CDATA[J\'ai reçu un <o:carton>, une invitation pour la  <r:TypeReception> de <i:h[ote>. C\'est <i:aidant> qui s\'occupe d\'organiser la fête, et je lui renvoie ma confirmation que je participerai.\r\nIl va très certainement y avoir beaucoup de gens intéressant, je suis enchanté à la perspective de cette r2ception qui se tiendra à <l:lieu>.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2019\" title=\"Le départ\"><DESCRIPTION><![CDATA[Je ne dois pas me mettre en retard, c\'est l\'heure pour partir à la <r:TypeReception> de <i:hôte>. <i:aidant> est renommé pour savoir organiser des fêtes, cela va être un grand moment !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"hôte\" id=\"2024\" pipi=\"0\" pipr=\"5\" pjgp=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[L\'hôte qui accueille tous les personnages en sa demeure <l:lieu> pour <r:TypeReception>, dont toute l\'organisation a été confiée a <i:aidant>]]></DESCRIPTION><TAGS/><RELATIONS><RELATION description=\"&lt;i:hôte&gt; et &lt;i:invité&gt; se connaissent\" is_bijective=\"true\" role_id=\"2026\" type=\"Connaît\" weight=\"100\"/><RELATION description=\"&lt;i:hôte&gt; et &lt;i:aidant&gt; se connaissent bien\" is_bijective=\"true\" role_id=\"2025\" type=\"Connaît\" weight=\"101\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"2018\" title=\"L\'invitation\"><DESCRIPTION><![CDATA[Après en avoir longuement débattu avec <i:aidant>, ça y est ! Les <o:carton>  d\'invitation pour ma  <r:TypeReception> partent !  Nous sommes tous deux très excités à la perspective de cette réception !\r\n(Quelques jours après, le flot des réponses, presque toutes positives, arrivent : j\'en informe <i:aidant>)]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2017\" title=\"Une &lt;r:TypeReception&gt;\"><DESCRIPTION><![CDATA[Aujourd\'hui, j\'ai pris une grande décision : je compte organiser <r:TypeReception> !\r\nJ\'en ai parlé avec <i:aidant> car je souhaitais bénéficier de son conseil pour ce qui est de l\'organisation. Après une brêve discussion, je me suis aperçu que <i:aidant>  avait beaucoup d\'idées sur la question, aussi je lui ai confié l\'intégralité de l\'organisation de <r:TypeReception> qui se tiendra à <l:lieu>. Je ne m\'occuperai que de sélectionner les invités. De son côté <i:aidant> était très enthousiaste et a accepté.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2019\" title=\"La fête est imminente !\"><DESCRIPTION><![CDATA[Tout est en place, <i:aidant> a vraiment fait les choses bien, nous sommes tous deux ravis. Les invités ne vont plus tarder à arriver !\r\nJ\'ai prévu de faire un petit discours (à préparer) pour remercier mes invités de leur venue et particulièrement <i:aidant> de son aide.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"TousParticipants\" id=\"2027\" pipi=\"0\" pipr=\"0\" pjgp=\"0\" type=\"TPJ\"><DESCRIPTION><![CDATA[Tous les participants à <r:TypeReception>]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES/><EVENTS><EVENT event_id=\"2014\" is_announced=\"false\"><TITLE><![CDATA[Ouverture buffet]]></TITLE><DESCRIPTION><![CDATA[Ouverture du buffet]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES><GENERIC_RESOURCE generic_resource_id=\"2021\" quantity=\"1\"/><GENERIC_RESOURCE generic_resource_id=\"2020\" quantity=\"1\"/></GENERIC_RESOURCES></EVENT></EVENTS></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"2019\" is_public=\"false\"><TITLE><![CDATA[La <r:TypeReception> de <i:hôte> est imminente]]></TITLE><DESCRIPTION><![CDATA[Les préparatifs se mettent en place. Les invités partent vers <r:TypeReception> de <i:hôte>]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"2018\"/></PREDECESSORS><GENERIC_PLACES/><TIME><ABSOLUTE day=\"\" hour=\"1\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"\" month=\"\" year=\"\"/></TIME></PAST_SCENE><PAST_SCENE id=\"2018\" is_public=\"false\"><TITLE><![CDATA[Invitations]]></TITLE><DESCRIPTION><![CDATA[Les cartons d\'invitation partent]]></