ight=\"100\"/><TAG type=\"Tag Univers\" value=\"XiXème siècle Britannique (Univers)\" weight=\"80\"/><TAG type=\"Type intrigue\" value=\"Venger un proche - (Polti)\" weight=\"50\"/></TAGS><ROLES><ROLE code=\"GRANDPERE\" id=\"1124\" pipi=\"0\" pipr=\"0\" pjgp=\"0\" type=\"PHJ\"><DESCRIPTION><![CDATA[Chef de la famille.\r\n\r\nHomme de poigne qui est mû par l\'ambition.]]></DESCRIPTION><TAGS><TAG type=\"Richesse\" value=\"Riche\" weight=\"50\"/><TAG type=\"Âge\" value=\"Vieux\" weight=\"80\"/><TAG type=\"Etat de Santé\" value=\"Mort\" weight=\"20\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:GRANDPERE&gt; ascendant direct de &lt;i:PÈRE&gt;\" is_bijective=\"false\" role_id=\"1121\" type=\"Parent (direct)\" weight=\"100\"/><RELATION description=\"&lt;i:GRANDPERE est grand-parent de &lt;i:ENFANT&gt;\" is_bijective=\"false\" role_id=\"1123\" type=\"Parentée indirecte\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"11206\" title=\"\"><DESCRIPTION><![CDATA[Je sais que mes forces diminue et que mon héritier est prêt. Il faut qu\'il prenne sa place à la tête de notre famille dès maintenant…]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11201\" title=\"\"><DESCRIPTION><![CDATA[Cette année là, la guerre s\'est déclarée en <l:PaysEtrangerEnGuerre> avec mon pays d\'origine.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11204\" title=\"\"><DESCRIPTION><![CDATA[<i:PERE> est contraint par sa famille de retourner chez lui. Je crois que je suis enceinte de lui, mais qu\'est ce que ça m\'apporterai de le mettre au courant maintenant? Il me promet de revenir mais je n\'y crois pas trop.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11202\" title=\"\"><DESCRIPTION><![CDATA[J\'ai envoyé <i:none:PERE> à la guerre avec <l:none:PaysEtrangerEnGuerre>.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"test\" id=\"111014\" pipi=\"0\" pipr=\"5\" pjgp=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[fsef]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES/><EVENTS/></ROLE><ROLE code=\"PERE\" id=\"1121\" pipi=\"2\" pipr=\"3\" pjgp=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[Ambitieux, il a laissé son amante dans son pays et s\'est donné dans sa carrière pour l\'oublier.]]></DESCRIPTION><TAGS><TAG type=\"Trait de personnalité\" value=\"Ambitieux(se)\" weight=\"90\"/><TAG type=\"Âge\" value=\"Âge mûr\" weight=\"70\"/><TAG type=\"Richesse\" value=\"Riche\" weight=\"60\"/><TAG type=\"Sexe\" value=\"Homme\" weight=\"100\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:PÈRE&gt; est ascendant direct de &lt;i:ENFANT&gt;.\" is_bijective=\"false\" role_id=\"1123\" type=\"Parent (direct)\" weight=\"100\"/><RELATION description=\"&lt;i:GRANDPERE&gt; ascendant direct de &lt;i:PÈRE&gt;\" is_bijective=\"false\" role_id=\"1124\" type=\"Parent (direct)\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"11206\" title=\"\"><DESCRIPTION><![CDATA[Après plusieurs années à diriger ma famille <i:GRANDPERE> me laisse enfin sa place me propulsant à la tête de la jolie fortune familiale. J\'en profite à nouveau pour retrouver <i:MERE> mais j\'échoue. Inconsolable, je me réfugie dans le travail.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11202\" title=\"\"><DESCRIPTION><![CDATA[Mon père <i:none:GRANDPERE> homme de poigne, m\'envoie à l\'armée pour faire la guerre. Je ne m\'y suis pas vraiment opposé car cette expérience ambitieuse me plaît, je compte m\'illustrer pour revenir couronné de succès et de gloire.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11203\" title=\"\"><DESCRIPTION><![CDATA[Au cours de mes missions je rencontre <i:MERE>. Je passe du temps avec elle et en tombe éperdument amoureux. La guerre étant un temps difficile pour tous, je lui promets de la ramener avec moi quand je rentrerai dans mon pays.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11204\" title=\"\"><DESCRIPTION><![CDATA[Mon père <i:GRANDPERE> m\'ordonne de revenir dans mon pays d\'origine. Après hésitations du fait de mon amour pour <i:MERE>, la pression grandissante de ma famille m\'oblige à retourner chez moi en promettant à <i:MERE> de revenir la chercher un jour. Je lui offre ma <o:MEDAILLEMILITAIRE> en gage de bonne foi. De retour, dans mon pays d\'origine, je me noie dans le travail car malgré mes recherches, je ne parviens pas à reprendre contact avec <i:MERE>. Je suis désespéré.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11201\" title=\"\"><DESCRIPTION><![CDATA[Cette année là, la guerre s\'est déclarée entre mon pays d\'origine et <l:PaysEtrangerEnGuerre>.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"1122\" is_announced=\"true\"><TITLE><![CDATA[Découverte de ma décoration]]></TITLE><DESCRIPTION><![CDATA[<i:PERE> reconnait sa <i:MEDAILLEMILITAIRE> dans les affaires d\'<i:ENFANT>.]]></DESCRIPTION><COMMENT><![CDATA[<i:ENFANT> peut s\'en rendre compte ou non.]]></COMMENT><GENERIC_RESOURCES><GENERIC_RESOURCE generic_resource_id=\"1124\" quantity=\"1\"/></GENERIC_RESOURCES></EVENT><EVENT event_id=\"1121\" is_announced=\"true\"><TITLE><![CDATA[Découverte troublante et souvenirs]]></TITLE><DESCRIPTION><![CDATA[<i:PÈRE> découvre la <i:PHOTO> que <i:ENFANT> emporte avec lui.]]></DESCRIPTION><COMMENT><![CDATA[<i:ENFANT> peut s\'en rendre compte ou non.]]></COMMENT><GENERIC_RESOURCES><GENERIC_RESOURCE generic_resource_id=\"1122\" quantity=\"1\"/></GENERIC_RESOURCES></EVENT><EVENT event_id=\"1124\" is_announced=\"true\"><TITLE><![CDATA[Reaction]]></TITLE><DESCRIPTION><![CDATA[Choquée, <i:ENFANT> se rend compte que l\'homme en fasse de lui n\'est autre que le père qu\'il déteste depuis toujours.]]></DESCRIPTION><COMMENT><![CDATA[<i:ENFANT> peut s\'en rendre compte ou non.]]></COMMENT><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"ENFANT\" id=\"1123\" pipi=\"2\" pipr=\"3\" pjgp=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[Très marquée par la mort de sa mère. Il déteste son père qu\'il ne connaît pas.]]></DESCRIPTION><TAGS><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"20\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:ENFANT&gt; est descendant direct de &lt;i:PÈRE&gt;\" is_bijective=\"false\" role_id=\"1121\" type=\"Filiation\" weight=\"100\"/><RELATION description=\"&lt;i:GRANDPERE est grand-parent de &lt;i:ENFANT&gt;\" is_bijective=\"false\" role_id=\"1124\" type=\"Parentée indirecte\" weight=\"100\"/><RELATION description=\"&lt;i:ENFANT&gt; est descendant direct de &lt;i:MERE&gt;\" is_bijective=\"false\" role_id=\"1122\" type=\"Filiation\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"11205\" title=\"\"><DESCRIPTION><![CDATA[Je née dans une banlieue pauvre. Ma mère <i:MERE> travaille de l\'aube à la tombée de la nuit pour pouvoir m\'élever, et reste très secrète sur l\'identité de mon père. Elle m\'a remis à ma naissance un souvenir de lui, une <o:MEDAILLEMILITAIRE> qu\'il lui avait offert, et que je porte toujours. Un soldat peut être ? D\'années en années, je vois sa santé décliner. Qui fut cet homme qui m\'a donné la vie et l\'a abandonnée ?]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11207\" title=\"\"><DESCRIPTION><![CDATA[Vivant dans la misère, et se tuant à la tache pour de petits travaux sous-payés, ma mère <i:MERE> finit par être terrassée par la maladie ou l\'épuisement sinon les deux. Avant de disparaître, elle me parle d\'un père sans lui donner son nom et dans un dernier effort, me remet le <o:portrait1> d\'elle que lui avait fait faire mon père.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11201\" title=\"\"><DESCRIPTION><![CDATA[Cette année là, la guerre s\'est déclarée en <l:PaysEtrangerEnGuerre>.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"1124\" is_announced=\"true\"><TITLE><![CDATA[Reaction]]></TITLE><DESCRIPTION><![CDATA[Après plusieurs discussions, <i:PERE> se rend compte que <i:ENFANT> est en fait la descendance de son ancien amour et que les dates collent pour qu\'il soit son père.]]></DESCRIPTION><COMMENT><![CDATA[<i:PERE> peut s\'en rendre compte ou non.]]></COMMENT><GENERIC_RESOURCES/></EVENT><EVENT event_id=\"1123\" is_announced=\"true\"><TITLE><![CDATA[Similitudes troublantes]]></TITLE><DESCRIPTION><![CDATA[<i:ENFANT> découvre que <i:PÈRE> possède le même <o:PEIGNE1> que celui de sa mère.]]></DESCRIPTION><COMMENT><![CDATA[<i:PERE> peut s\'en rendre compte ou non.]]></COMMENT><GENERIC_RESOURCES><GENERIC_RESOURCE generic_resource_id=\"1121\" quantity=\"1\"/><GENERIC_RESOURCE generic_resource_id=\"1123\" quantity=\"1\"/></GENERIC_RESOURCES></EVENT></EVENTS></ROLE><ROLE code=\"MERE\" id=\"1122\" pipi=\"0\" pipr=\"0\" pjgp=\"0\" type=\"PHJ\"><DESCRIPTION><![CDATA[Mère célibataire. Elle travaillera toute sa vie pour élever son enfant.]]></DESCRIPTION><TAGS><TAG type=\"Âge\" value=\"Âge mûr\" weight=\"70\"/><TAG type=\"Etat de Santé\" value=\"Mort\" weight=\"50\"/><TAG type=\"Sexe\" value=\"Femme\" weight=\"100\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"90\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:PÈRE&gt; et &lt;i:MERE&gt; ont été amants.\" is_bijective=\"true\" role_id=\"1121\" type=\"Amour\" weight=\"75\"/><RELATION description=\"&lt;i:MERE&gt; est ascendant direct de&lt;i:ENFANT&gt;.\" is_bijective=\"false\" role_id=\"1123\" type=\"Parent (direct)\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"11205\" title=\"\"><DESCRIPTION><![CDATA[Dans la pauvreté et la douleur, je donne naissance à <i:ENFANT>. Je ne peux pas lui donner l\'identité de son père. Elle doit le haïr mais tant pis. Je lui remets tout de même la <o:MEDAILLEMILITAIRE> qu\'il m\'a laissé avant de partir.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11203\" title=\"\"><DESCRIPTION><![CDATA[Durant la guerre, je rencontre <i:PERE> un soldat adverse. Malgré le danger, nous passons du temps ensemble. Je suis amoureuse, et il me promet même une vie ensemble dans son pays.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11207\" title=\"\"><DESCRIPTION><![CDATA[Je suis à bout de force. Je n\'ai plus d\'autre choix que de partir. <i:ENFANT> est une personne forte ! Il s\'en sortira j\'en suis sûre. Mais je dois encore une fois au mons lui parler de son père et au moins lui remettre ce <o:portrait1> qu\'il m\'avait offert…]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11204\" title=\"\"><DESCRIPTION><![CDATA[<i:PERE> est contraint par sa famille de retourner chez lui. Je crois que je suis enceinte de lui, mais qu\'est ce que ça m\'apporterai de le mettre au courant maintenant? Il me promet de revenir mais je n\'y crois pas trop.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"11201\" title=\"\"><DESCRIPTION><![CDATA[Cette année là, la guerre s\'est déclarée en <l:PaysEtrangerEnGuerre>.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"11204\" is_public=\"false\"><TITLE><![CDATA[Retour seul chez soi]]></TITLE><DESCRIPTION><![CDATA[<i:PERE> retourne de force dans son pays, seul car <i:GRANDPERE> refuse de voir la jeune femme <i:MERE>]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"11203\"/></PREDECESSORS><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1123\"/></GENERIC_PLACES><TIME><ABSOLUTE day=\"12\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"20\" month=\"7\" year=\"1995\"/></TIME></PAST_SCENE><PAST_SCENE id=\"11201\" is_public=\"true\"><TITLE><![CDATA[La Guerre]]></TITLE><DESCRIPTION><![CDATA[La guerre éclare en <l:PaysEtrangerEnGuerre>]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1123\"/></GENERIC_PLACES><TIME><ABSOLUTE day=\"12\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"20\" 