 par l\'un(e) d\'entre eux.</PITCH_PJ><TAGS><TAG type=\"Tag Univers\" value=\"Harry Potter Anglais Fantastique (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Grèce Antique (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Star Wars (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Espace2xxx - conquête spatiale\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"XiXème siècle Britannique (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Ancien Régime Fr (Univers)\" weight=\"90\"/><TAG type=\"Ambiance intrigue\" value=\"Huis-clos\" weight=\"100\"/><TAG type=\"Tag Univers\" value=\"Super-Héros U.S. (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"France Steampunk 1863-1912 (Jules Verne)-Univ\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Contemporain Anglais (Univers)\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Trône de Fer / Game of Thrones\" weight=\"90\"/><TAG type=\"Tag Univers\" value=\"Contemporain France (Univers)\" weight=\"90\"/><TAG type=\"Occasions Spéciales\" value=\"Fête\" weight=\"100\"/></TAGS><ROLES><ROLE code=\"hôte\" id=\"2024\" pipi=\"0\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[L\'hôte qui accueille tous les personnages en sa demeure <l:lieu> pour <r:TypeReception>, dont toute l\'organisation a été confiée a <i:aidant>]]></DESCRIPTION><TAGS/><RELATIONS><RELATION description=\"&lt;i:hôte&gt; et &lt;i:invité&gt; se connaissent\" is_bijective=\"true\" role_id=\"2026\" type=\"Connaît\" weight=\"100\"/><RELATION description=\"&lt;i:hôte&gt; et &lt;i:aidant&gt; se connaissent bien\" is_bijective=\"true\" role_id=\"2025\" type=\"Connaît\" weight=\"101\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"2017\" title=\"\"><DESCRIPTION><![CDATA[Aujourd\'hui, j\'ai pris une grande décision : je compte organiser <r:TypeReception> !\nJ\'en ai parlé avec <i:aidant> car je souhaitais bénéficier de son conseil pour ce qui est de l\'organisation. Après une brêve discussion, je me suis aperçu que <i:aidant>  avait beaucoup d\'idées sur la question, aussi je lui ai confié l\'intégralité de l\'organisation de <r:TypeReception> qui se tiendra à <l:lieu>. Je ne m\'occuperai que de sélectionner les invités. De son côté <i:aidant> était très enthousiaste et a accepté.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2018\" title=\"\"><DESCRIPTION><![CDATA[Après en avoir longuement débattu avec <i:aidant>, ça y est ! Les <o:carton>  d\'invitation pour ma  <r:TypeReception> partent !  Nous sommes tous deux très excités à la perspective de cette réception !\n(Quelques jours après, le flot des réponses, presque toutes positives, arrivent : j\'en informe <i:aidant>)]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2019\" title=\"\"><DESCRIPTION><![CDATA[Tout est en place, <i:aidant> a vraiment fait les choses bien, nous sommes tous deux ravis. Les invités ne vont plus tarder à arriver !\nJ\'ai prévu de faire un petit discours (à préparer) pour remercier mes invités de leur venue et particulièrement <i:aidant> de son aide.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"invité\" id=\"2026\" pipi=\"0\" pipr=\"2\" type=\"PJG\"><DESCRIPTION><![CDATA[Invité par <i:hôte> qui donne <r:TypeReception> organisé par <i:aidant>]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"2018\" title=\"\"><DESCRIPTION><![CDATA[J\'ai reçu un <o:carton>, une invitation pour la  <r:TypeReception> de <i:h[ote>. C\'est <i:aidant> qui s\'occupe d\'organiser la fête, et je lui renvoie ma confirmation que je participerai.\nIl va très certainement y avoir beaucoup de gens intéressant, je suis enchanté à la perspective de cette r2ception qui se tiendra à <l:lieu>.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2019\" title=\"\"><DESCRIPTION><![CDATA[Je ne dois pas me mettre en retard, c\'est l\'heure pour partir à la <r:TypeReception> de <i:hôte>. <i:aidant> est renommé pour savoir organiser des fêtes, cela va être un grand moment !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"TousParticipants\" id=\"2027\" pipi=\"0\" pipr=\"0\" type=\"TPJ\"><DESCRIPTION><![CDATA[Tous les participants à <r:TypeReception>]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES/><EVENTS><EVENT event_id=\"2014\" is_announced=\"true\"><TITLE><![CDATA[Ouverture buffet]]></TITLE><DESCRIPTION><![CDATA[Ouverture du buffet]]></DESCRIPTION><COMMENT/><GENERIC_RESOURCES><GENERIC_RESOURCE generic_resource_id=\"2021\" quantity=\"1\"/><GENERIC_RESOURCE generic_resource_id=\"2020\" quantity=\"1\"/></GENERIC_RESOURCES></EVENT></EVENTS></ROLE><ROLE code=\"aidant\" id=\"2025\" pipi=\"0\" pipr=\"2\" type=\"PJ\"><DESCRIPTION><![CDATA[<i:aidant> a aidé <i:hôte> à organiser <r:TypeReception> à <l:lieu>.]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"2017\" title=\"\"><DESCRIPTION><![CDATA[<i:hôte> est venu me trouver car il souhaitait donner un <r:TypeReception>\n<i:hôte> souhaitait avoir mon avis et mon conseil. Nous avons commencé à en discuter et je me suis montré très inspiré. Après une brêve discussion, <i:hôte> m\'a finalement confié l\'intégralité de l\'organisation de sa fête qui se tiendra à <l:lieu>, ne s\'occupant que de sélectionner les invités. De mon côté j\'étais très enthousiaste.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2018\" title=\"\"><DESCRIPTION><![CDATA[Après en avoir longuement débattu avec <i:hôte>, ça y est ! Les <o:carton> d\'invitation pour sa  <r:TypeReception> partent ! Nous sommes tous deux très excités à la perspective de cette  réception !\n(Quelques jours après, le flot des réponses, presque toutes positives, arrivent : j\'en informe <i:hôte>)]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"2019\" title=\"\"><DESCRIPTION><![CDATA[Tout est en place, je suis très satisfait de mon travail, et <i:hôte> semble ravi ! Les invités ne vont plus tarder à arriver ! Je sais que <i:hôte> a prévu de faire un petit discours pour