de &lt;i:Max&gt;&#13;\nNote : Issu des tables claudiennes (par JC Hoog.) - Transformation : Bastien</DESCRIPTION><PITCH_ORGA>Tensions amoureuses au sein de l\'association de malfaiteurs formée par le couple &lt;i:Marie&gt; et &lt;i:Max&gt;, le frère de ce dernier &lt;i:Theo&gt; et leur camarade &lt;i:Minna&gt;. Mais &lt;i:Minna&gt; découvre qu\'elle est enceinte de &lt;i:Max&gt;</PITCH_ORGA><TAGS><TAG type=\"Sentiments Intrigue\" value=\"Violence\" weight=\"10\"/><TAG type=\"Tag Univers\" value=\"XiXème siècle Britannique (Univers)\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Harry Potter Anglais Fantastique (Univers)\" weight=\"80\"/><TAG type=\"Sentiments Intrigue\" value=\"Amour\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Contemporain Anglais (Univers)\" weight=\"80\"/><TAG type=\"Type intrigue\" value=\"Remords - (Polti)\" weight=\"40\"/><TAG type=\"Tag Univers\" value=\"Star Wars (Univers)\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Super-Héros U.S. (Univers)\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Grèce Antique (Univers)\" weight=\"80\"/><TAG type=\"Tag Univers\" value=\"Ancien Régime Fr (Univers)\" weight=\"80\"/><TAG type=\"Type intrigue\" value=\"Jalousie - (Polti)\" weight=\"60\"/><TAG type=\"Tag Univers\" value=\"Contemporain France (Univers)\" weight=\"80\"/><TAG type=\"Type intrigue\" value=\"Adultère - (Polti)\" weight=\"90\"/><TAG type=\"Sentiments Intrigue\" value=\"Erotisme\" weight=\"30\"/><TAG type=\"Type intrigue\" value=\"Être traqué - (Polti)\" weight=\"15\"/></TAGS><ROLES><ROLE code=\"Max\" id=\"111004\" pipi=\"1\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[Anarchiste peu convaincu. Il aime <i:Marie>. Il a été chamboulé par l\'arrestation de <i:Marie>. Il s\'est consolé dans les bras de <i:Minna> et regrette aujourd\'hui. Il supporte de moins en moins l\'exaltation de <i:Marie>.\nTout ce qu\'il souhaite c\'est éviter que <i:Minna> mette le grappin sur son frère <i:Theo>]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Homme\" weight=\"100\"/><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Situation Maritale\" value=\"Célibataire\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Sympathique\" weight=\"60\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"70\"/><TAG type=\"Trait de personnalité\" value=\"Charismatique\" weight=\"60\"/></TAGS><RELATIONS><RELATION description=\"Je l\'aime mais je doute\" is_bijective=\"false\" role_id=\"111001\" type=\"Amour\" weight=\"80\"/><RELATION description=\"Elle est plutôt cool\" is_bijective=\"false\" role_id=\"111003\" type=\"Amour\" weight=\"60\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111001\" title=\"\"><DESCRIPTION><![CDATA[J\'ai organisé un super coup. Un cambriolage de haute volée. J\'ai mis toute mon équipe sur le coup : <i:Max> l\'amour de ma vie et <I:Minna>. J\'ai dû aussi prendre dans l\'équipe <I:Theo>, le frère de <I:Max> même s\'il est un peu lourd à supporter.\n\nTout était réglé comme du papier à musique, on ne pouvait pas échouer !\n\nMais <I:Theo> a merdé et je me suis faite choper pour permettre aux autres de s\'enfuir.\n\n20 ans fermes, voilà ce que je me suis prise à cause des conneries de <I:Theo>. Heureusement je sais que <I:Max> m\'attend dehors.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111003\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie> vient de débarquer, elle a réussi à s\'évader !\nJe suis fou de joie, mais ça n\'arrange pas mes dilemmes. Ma relation avec <i:Minna> va être compliquée!\n\nEn plus, maintenant il va falloir cacher <i:Marie>, mais ça devrait aller, elle est pas connue dans le coin.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111000\" title=\"\"><DESCRIPTION><![CDATA[Ma petite amie <i:Marie>, ma grande amie <i:Minna>, et mon frère cadet <i:Theo> et moi avons décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111001\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie>, a organisé un coup, il est un peu bancal mais elle insiste pour qu\'on le fasse. Elle est tellement exaltée que personne dans \"la bande\" n\'a jamais eu le cœur de dire non.\n<i:Theo> veut en être je lui ai dit non : pas prêt, pas assez mature…  mais il m\'a court-circuité et <i:Marie> a annoncé qu\'elle l\'emmenait.\nAinsi elle a dfinalement cédé.\n\nComme c\'était à craindre, tout s\'est mal passé, <i:Theo> a foiré et <I:Marie> s\'est faite choper. 20 ans fermes. Je ne sais pas si j\'aurai la force de l\'attendre.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Theo\" id=\"111002\" pipi=\"1\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Frère de <i:Max>, il l\'admire et le révère. Un peu jaloux de sa relation avec son frère il a du mal à supporter <i:Marie>.\nIl voudrait bien se taper <i:Minna>]]></DESCRIPTION><TAGS><TAG type=\"Trait de personnalité\" value=\"Naïf\" weight=\"60\"/><TAG type=\"Situation Maritale\" value=\"Célibataire\" weight=\"80\"/><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"80\"/><TAG type=\"Statut Affectif\" value=\"Amoureux(se)\" weight=\"80\"/><TAG type=\"Sexe\" value=\"Homme\" weight=\"100\"/><TAG type=\"Trait de personnalité\" value=\"Charismatique\" weight=\"-30\"/></TAGS><RELATIONS><RELATION description=\"Elle me tape un peu sur le système\" is_bijective=\"false\" role_id=\"111001\" type=\"Haine/Conflit/rivalité\" weight=\"15\"/><RELATION description=\"Je l\'aime !\" is_bijective=\"false\" role_id=\"111003\" type=\"Amour\" weight=\"80\"/><RELATION description=\"On est frangins (&lt;i:Max&gt; est l\'aîné)\" is_bijective=\"true\" role_id=\"111004\" type=\"Fratrie\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111001\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie>, a organisé un coup, j\'ai réussis à la convaincre de me prendre, la belle <i:Minna> m\'a arangée le coup. Je sais que mon frère <i:Max> s\'est opposé à ça, il me trouvait pas prêt et il avait peut être raison.\nTout s\'est pas passé comme prévu, j\'ai foiré et <i:Marie> s\'est faite choper.\nJe crois que du coup mes chances de me faire <i:Minna> sont minces.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111000\" title=\"\"><DESCRIPTION><![CDATA[Mon frère <i:Max>, la petite amie de ce dernier <i:Marie>, ma belle amie <i:Minna>, et moi avons tous décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111002\" title=\"\"><DESCRIPTION><![CDATA[J\'ai chopé <i:Max> en train de tromper <i:Marie> avec <i:Minna>. Putain ça fait chier !  Non que j\'apprécie particulièrement <i:Marie>, mais pour moi <i:Max> était le grand frère idéalisé, aujourd\'hui j\'ai réalisé que ce n\'était qu\'un homme.\nEt puis je suis dingue de <i:Minna>, je l\'aime à mourir, comment je vais faire maintenant ? <i:Max> est tellement mieux que moi…]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111003\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie> vient de débarquer, elle a réussi à s\'évader !\nElle ne me manquait pas vraiment, mais c\'est vrai que je me sentait un peu coupable, et puis <i:Max> était au trente-sixième dessous, donc c\'est plutôt cool.\n\nMaintenant il va falloir la cacher, mais ça devrait aller, elle est pas connue dans le coin.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Minna\" id=\"111003\" pipi=\"1\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[Jouisseuse, elle est frivole et hésite encore entre <i:Theo> et <i:Max>, mais après tout, pourquoi choisir ?\nElle a profité que <i:Marie> était en taule pour se payer un avant-goût dans le lit de <i:Max>]]></DESCRIPTION><TAGS><TAG type=\"Situation Maritale\" value=\"Célibataire\" weight=\"80\"/><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"90\"/><TAG type=\"Traits physiques\" value=\"Séduisant(e )\" weight=\"70\"/><TAG type=\"Trait de personnalité\" value=\"Fourberie\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Fou\" weight=\"50\"/><TAG type=\"Sexe\" value=\"Femme\" weight=\"100\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:Marie&gt; est plutôt le boss\" is_bijective=\"false\" role_id=\"111001\" type=\"Hiérarchie Asc\" weight=\"10\"/><RELATION description=\"&lt;i:Max&gt; est plutôt cool\" is_bijective=\"false\" role_id=\"111004\" type=\"Amour\" weight=\"25\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111002\" title=\"\"><DESCRIPTION><![CDATA[Ca y est !\nJ\'ai enfin réussis à me taper <i:Max> ! Plus que <i:Theo>, le petit frère, et j\'ai fait le grand chelem !\nPutain c\'était cool, je me suis bien éclaté. Enfin jusqu\'à ce que <i:Theo> débarque dans la chambre, après ça <i:Max> n\'était plus tellement à ce qu\'il faisait.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111000\" title=\"\"><DESCRIPTION><![CDATA[Mon ami <i:Max>, son petit fère <i:Theo>, la petite amie de <i:Max>, la jolie <i:Marie>,  et moi, avons tous décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111001\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie>, l\'autre pouffe, a organisé un coup, il est un peu bancal mais elle insiste pour qu\'on le fasse. Elle est tellement exaltée que je n\'ai pas eu le cœur de dire non.\n<I:Theo> a insisté pour en faire partie, je ne suis pas sûre qu\'il soit assez mature mais il a court-circuité tout le monde en allant directement voir <i:Marie> : elle a vraiment une mauvaise influence sur lui.\n\nTout s\'est mal passé, comme je le craignais <i:Theo> a tout foiré, et <I:Minna> s\'est faite choper : elle en a pris pour 20 ans fermes. Je ne sais pas si j\'aurai la force de l\'attendre.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111004\" title=\"\"><DESCRIPTION><![CDATA[Putain de merde ! Fais chier !\nJ\'ai une semaine de retard, je suis tombée enceinte : c\'était pas du tout prévu, et je sais pas quoi faire ! \nCa ne peut être que <i:Max>, je me suis tapé personne d\'autre depuis longtemps…\n\nComment je vais faire bordel… Je peux pas m\'occuper d\'un gosse toute seule, j\'arrive même pas à m\'occuper de moi-même, je suis qu\'une paumée…\nFaut que je récupère <i:Max>, malgré ses grands airs je sais que s\'est un type bien qui ne fuira pas ses responsabilités. Mais maintenant que <i:Marie> est revenue ça va être plus compliqué.\nSurtout qu\'avec ma réputation de trainée et de menteuse, comment je vais faire pour le convaincre que le gamin est de lui si je décide de lui dire la vérité ?\n\nPutain j\'ai trop déconné, c\'est la merde!]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111003\" title=\"\"><DESCRIPTION><![CDATA[<i:Marie> vient de débarquer, elle a réussi à s\'évader !\nElle me manquait pas vraiment, mais je pense qu\'en m\'arrangeant bien, ça peut faire du drama ! Cool … cool, cool, cool...\n\nMaintenant il va falloir la cacher, mais ça devrait aller, elle est pas connue dans le coin.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Marie\" id=\"111001\" pipi=\"3\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Rebelle pure et dure,  condamnée à 20 ans de réclusion criminelle, elle vient de s\'échapper au bout de 3 mois. Elle aime <i:Max> et en veut à <i:Theo> pour l\'avoir fait tombée.]]></DESCRIPTION><TAGS><TAG type=\"Âge\" value=\"Jeune adulte\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Fou\" weight=\"30\"/><TAG type=\"Trait de personnalité\" value=\"Sanguin\" weight=\"70\"/><TAG type=\"Statut Affectif\" value=\"Amoureux(se)\" weight=\"80\"/><TAG type=\"Richesse\" value=\"Pauvre et Humble\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Charismatique\" weight=\"70\"/><TAG type=\"Sexe\" value=\"Femme\" weight=\"100\"/></TAGS><RELATIONS><RELATION description=\"Elle tourne un peu trop autour de &lt;i:Max&gt;\" is_bijective=\"false\" role_id=\"111003\" type=\"Haine/Conflit/rivalité\" weight=\"50\"/><RELATION description=\"Je l\'aime, c\'est mon compagnon de combat !\" is_bijective=\"false\" role_id=\"111004\" type=\"Amour\" weight=\"80\"/><RELATION description=\"C\'est à cause de lui la tôle !\" is_bijective=\"false\" role_id=\"111002\" type=\"Haine/Conflit/rivalité\" weight=\"60\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111003\" title=\"\"><DESCRIPTION><![CDATA[Saloperie ! Je l\'ai fait ! J\'ai juste pété la tête de ce gardien et je suis dehors.\n\nJ\'ai réussi à m\'échapper, je ne purgerai pas ma peine, je suis libre !\n\nJe suis direct allé retrouvé ma bande, ils sauront me cacher.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111000\" title=\"\"><DESCRIPTION><![CDATA[Mon petit ami <i:Max>, le petit frère de ce dernier <i:Theo>, notre amie <i:Minna> et moi, avons tous décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111001\" title=\"\"><DESCRIPTION><![CDATA[J\'ai organisé un super coup. Un cambriolage de haute volée. J\'ai mis toute mon équipe sur le coup : <i:Max> l\'amour de ma vie et <I:Minna>. J\'ai dû aussi prendre dans l\'équipe <I:Theo>, le frère de <I:Max> même s\'il est un peu lourd à supporter.\n\nTout était réglé comme du papier à musique, on ne pouvait pas échouer !\n\nMais <I:Theo> a merdé et je me suis faite choper pour permettre aux autres de s\'enfuir.\n\n20 ans fermes, voilà ce que je me suis prise à cause des conneries de <I:Theo>. Heureusement je sais que <I:Max> m\'attend dehors.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"111001\" is_public=\"true\"><TITLE><![CDATA[L\'Arrestation]]></TITLE><DESCRIPTION><![CDATA[<i:Marie>, <i:Max>, <i:Minna> aidés par <i:Theo> ont organisé un braquage. Mais tout ne s\'est pas passé comme prévu, <i:Theo> a merdé et <i:Marie> s\'est faite chopée. Les autres ont pu s\'enfuir]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"31\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"2\" year=\"1\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111002\" is_public=\"false\"><TITLE><![CDATA[La faute]]></TITLE><DESCRIPTION><![CDATA[<i:Minna> profite de la dépression de <i:Max>, causée par l\'enfermement de <i:Marie>, pour s\'infiltrer dans son lit. <i:Theo> les a surpris.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"15\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"0\" year=\"1\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111000\" is_public=\"false\"><TITLE><![CDATA[Association de malfaiteurs]]></TITLE><DESCRIPTION><![CDATA[<i:Marie>, <i:Max>, <i:Minna>et <i:Theo> s\'associent au sein d\'une association criminelle.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"30\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"5\" year=\"1\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111003\" is_public=\"true\"><TITLE><![CDATA[L\'évasion]]></TITLE><DESCRIPTION><![CDATA[Le casse du siècle ! <i:Marie> s\'évade de son lieu de détention. Elle rejoint aussitôt son groupe.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"0\" year=\"1\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111004\" is_public=\"false\"><TITLE><![CDATA[Les fâcheuses conséquences]]></TITLE><DESCRIPTION><![CDATA[<i:Minna>  fait un test de grossesse et s\'est le drame, elle est enceinte de <i:Max>]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"0\" year=\"1\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS/><GENERIC_PLACES/><GENERIC_RESOURCES/></PLOT><PLOT author=\"3\" creation_date=\"1386802800000\" id=\"999898\" is_evenemential=\"false\" is_mainstream=\"false\" is_public=\"false\" last_update_date=\"1400796000000\" title=\"Life\"><DESCRIPTION>Life</DESCRIPTION><TAGS/><ROLES><ROLE code=\"Life\" id=\"999898\" pipi=\"0\" pipr=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[Vie du personnage]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1000012\" title=\"\"><DESCRIPTION><![CDATA[Premier flirt]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000002\" title=\"\"><DESCRIPTION><![CDATA[Entrée à l\'école primaire]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"999998\" title=\"\"><DESCRIPTION><![CDATA[Naissance]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000017\" title=\"\"><DESCRIPTION><![CDATA[Overdose de drogue]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1000007\" title=\"\"><DESCRIPTION><![CDATA[S\'étouffe avec un bonbon]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"1000012\" is_public=\"true\"><TITLE><![CDATA[Evénement passé à l\'age de 15 ans]]></TITLE><DESCRIPTION><![CDATA[Past Scene de 15]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"31\" hour=\"0\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYea