lue=\"&gt;&gt; Document\" weight=\"100\"/><TAG type=\"&gt; Type Ressource\" value=\"&gt; Messages et Invitations (Document)\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Message à remettre à <i:TUEUR> de la part de <i:CHEF>, durant la soirée :\n\n\"Tue <i:SCI> et débarasse-toi de son corps. N\'en parle pas à <i:CONTRE>.]]></COMMENT></GENERIC_RESOURCE></GENERIC_RESOURCES></PLOT><PLOT author=\"1\" creation_date=\"1385313489000\" id=\"113\" is_evenemential=\"true\" is_mainstream=\"false\" is_public=\"true\" last_update_date=\"1385313489000\" title=\"(Evt) Célébration Retour d\'un ami\"><DESCRIPTION>Les personnages sont venus assister à une réception donnée dans son &lt;l:Demeure&gt; à &lt;l:LieuDemeure&gt; par &lt;i:Hote&gt; pour célébrer son retour de &lt;l:LieuLointain&gt;, absent depuis 1 an</DESCRIPTION><PITCH_ORGA>Les personnages sont venus assister à une réception donnée dans son &lt;l:Demeure&gt; à &lt;l:LieuDemeure&gt; par &lt;i:Hote&gt; pour célébrer son retour de &lt;l:LieuLointain&gt;, absent depuis 1 an</PITCH_ORGA><PITCH_PNJ>Les personnages sont venus assister à une réception donnée dans son &lt;l:Demeure&gt; à &lt;l:LieuDemeure&gt; par &lt;i:Hôte&gt; pour célébrer son retour de &lt;l:LieuLointain&gt;, absent depuis 1 an</PITCH_PNJ><PITCH_PJ>&lt;i:Hote&gt; vous a invité, vous et plusieurs de ses proches, à une réception donnée dans sa &lt;l:Demeure&gt; à &lt;l:LieuDemeure&gt; pour célébrer son retour de &lt;l:LieuLointain&gt;, où il était parti depuis 1 an.</PITCH_PJ><TAGS/><ROLES><ROLE code=\"Hote\" id=\"1130\" pipi=\"0\" pipr=\"5\" type=\"PJ\"><DESCRIPTION><![CDATA[Accueille et organise une réception pour fêter son retour.]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1132\" title=\"\"><DESCRIPTION><![CDATA[Je suis rentré de <l:LieuLointain>, où ma mission s\'est bien déroulée ce qui m\'a pas mal enrichi. J\'ai pris une belle <l:Demeure> à <l:LieuDemeure> et j\'ai contacté tous mes proches afin de célébrer mon retour. Je leur ai envoyé un message leur annonçant \"Je suis de retour de <l:lieulointain> et j\'organise une grande fête où j\'espère que vous pourrez assister\"\n\nIl faudra d\'ailleurs que je prépare quelques lignes d\'un court discours, et me préparer à répondre à de nombreuses questions !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1131\" title=\"\"><DESCRIPTION><![CDATA[Il y a un an, je suis parti à <l:lieulointain> qui était alors en proie à de forts troubles et rapidement tombé guerre. J\'ai prévenu tous mes amis de mon départ sans leur préciser mon lieu de destination.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS><EVENT event_id=\"1131\" is_announced=\"true\"><TITLE><![CDATA[Fête]]></TITLE><DESCRIPTION><![CDATA[La fête]]></DESCRIPTION><COMMENT><![CDATA[Buffet avec banderolle welcome back, etc.]]></COMMENT><GENERIC_RESOURCES/></EVENT></EVENTS></ROLE><ROLE code=\"Invite\" id=\"1131\" pipi=\"0\" pipr=\"0\" type=\"PJG\"><DESCRIPTION><![CDATA[<i:Invite> connaît <i:Hote>]]></DESCRIPTION><TAGS/><RELATIONS><RELATION description=\"Nous nous connaissons bien.\" is_bijective=\"true\" role_id=\"1130\" type=\"Connaît\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"1132\" title=\"\"><DESCRIPTION><![CDATA[J\'ai  reçu un message de <i:Hote>, quelle chance ! \nLe message disait que <i:Hote> rentrait de <l:LieuLointain>, visiblement sa mystérieuse destination, et il s\'est installé dans une belle <l:Demeure> à <l:LieuDemeure> où il organise prochainement une réception pour célébrer son retour : j\'ai hâte de retrouver <i:hote> là-bas !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1131\" title=\"\"><DESCRIPTION><![CDATA[Il y a un an, je suis parti à <l:lieulointain> qui était alors en proie à de forts troubles et rapidement tombé guerre. J\'ai prévenu tous mes amis de mon départ sans leur préciser mon lieu de destination.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"1131\" is_public=\"true\"><TITLE><![CDATA[Départ d\'<i:Hote> pour <l:LieuLointain>]]></TITLE><DESCRIPTION><![CDATA[<i:Hote> part, ce que savent les autres]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"5\" year=\"2014\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1132\" is_public=\"true\"><TITLE><![CDATA[Retour d\'<i:Hote> pour <l:LieuLointain>]]></TITLE><DESCRIPTION><![CDATA[<i:Hote> revient, ce que savent les autres. Envoi d\'invitations pour une fête en sa <l:Demeure> à <l:LieuDemeure>.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"17\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"4\" year=\"2015\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS><EVENT absolute_timing=\"01/06/2015 11:06\" duration=\"2\" id=\"1131\" is_planned=\"true\" is_public=\"true\" timing=\"1\"><TITLE><![CDATA[Fête]]></TITLE><DESCRIPTION><![CDATA[Fête donnée en sa <l:Demeure> à <l:LieuDemeure>.pour tous les invités (buffet)]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1131\"/></GENERIC_PLACES></EVENT></EVENTS><GENERIC_PLACES><GENERIC_PLACE code=\"LieuLointain\" id=\"1131\" object_type_id=\"0\"><TAGS><TAG type=\"&gt; Lieu Superficie\" value=\"&gt; Pays-Planète\" weight=\"100\"/><TAG type=\"Situation politique\" value=\"EnGuerre\" weight=\"100\"/></TAGS><COMMENT><![CDATA[<l:LieuLointain> est en guerre]]></COMMENT></GENERIC_PLACE></GENERIC_PLACES><GENERIC_RESOURCES/></PLOT><PLOT author=\"4\" creation_date=\"1386543600000\" id=\"999901\" is_evenemential=\"false\" is_mainstream=\"false\" is_public=\"false\" last_update_date=\"1386543600000\" title=\"Life\"><DESCRIPTION>Life</DESCRIPTION><TAGS/><ROLES><ROLE code=\"Life\" id=\"999901\" pipi=\"0\" pipr=\"0\" type=\"PJ\"><DESC