\" minute=\"0\" month=\"5\" year=\"1981\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1000331\" is_public=\"true\"><TITLE><![CDATA[Evénement passé à l\'age de 34 ans]]></TITLE><DESCRIPTION><![CDATA[Past Scene de 34]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"5\" year=\"2010\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS/><GENERIC_PLACES/><GENERIC_RESOURCES/></PLOT><PLOT author=\"1\" creation_date=\"1406148356000\" id=\"114\" is_evenemential=\"false\" is_mainstream=\"false\" is_public=\"true\" last_update_date=\"1400796000000\" title=\"Rencontre embarassante - VF1\"><DESCRIPTION>&lt;i:Servante&gt;, la servante de &lt;i:Dominus&gt; et &lt;i:Domina&gt;, s\'absente pendant ses heures de service pour discrètement retrouver son petit ami &lt;i:PetitAmi&gt;: si &lt;i:Domina&gt; la surprend, elle est fichue. Malheureusement pendant son escapade, elle tombe nez à nez avec son maître &lt;i:Dominus&gt; avec son amante &lt;i:Maîtresse&gt;.</DESCRIPTION><PITCH_ORGA>&lt;i:Servante&gt;, la servante de &lt;i:Dominus&gt; et &lt;i:Domina&gt;, s\'absente pendant ses heures de service pour discrètement retrouver son petit ami &lt;i:PetitAmi&gt;: si &lt;i:Domina&gt; la surprend, elle est fichue. Malheureusement pendant son escapade, elle tombe nez à nez avec son maître &lt;i:Dominus&gt; avec son amante &lt;i:Maîtresse&gt;.</PITCH_ORGA><PITCH_PNJ/><PITCH_PJ/><TAGS><TAG type=\"Sentiments Intrigue\" value=\"Amour\" weight=\"50\"/><TAG type=\"Tag Univers\" value=\"Trône de Fer / Game of Thrones\" weight=\"101\"/></TAGS><ROLES><ROLE code=\"Domina\" id=\"111007\" pipi=\"2\" pipr=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[Est mariée avec <i:Dominus> , ils ont embauché <i:Servante> comme servante en fixant son jour hebdomadaire de congés à aujourd\'hui.]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Femme\" weight=\"101\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:Domina&gt; a &lt;i:Servante&gt; comme servante\" is_bijective=\"false\" role_id=\"111006\" type=\"Hiérarchie Desc\" weight=\"101\"/><RELATION description=\"&lt;i:Domina&gt; et &lt;i:Dominus&gt; sont officiellement mariés\" is_bijective=\"true\" role_id=\"111008\" type=\"Mariage\" weight=\"101\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111007\" title=\"\"><DESCRIPTION><![CDATA[Depuis 3 mois, cela ne va pas bien entre mon époux <i:Dominus> et moi, et nous sommes tout le temps en train de nous chamailler pour un rien. Je crois que depuis le temps que nous sommes mariés, nous nous sommes un peu éloignés l\'un de l\'autre. La moindre occasion est devenu le prétexte à une dispute.\nJ\'espère au moins qu\'il ne fréquente personne d\'autre que moi !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111008\" title=\"\"><DESCRIPTION><![CDATA[Mais où est-elle passée ? Ce n\'est pas son jour de congés pourtant aujourd\'hui elle devrait être à son service : son congés c\'est DEMAIN !\nQuand je la reverrai, je lui demanderai où ellle est passé. Je la paye pour faire son service, pas pour disparaître quand je la cherche !\nDe plus je ne peux demander à mon mari de m\'aider à reprendre <i:Servante>, d\'une part parce qu\'il ne s\'occupe guère des affaires du personnel, d\'autre part parce qu\'il m\'a dit qu\'il rentrerait très tard ce soir, ayant beaucoup de travail aujourd\'hui.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Servante\" id=\"111006\" pipi=\"3\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Servante pour <i:Dominus> et <i:Domina>. S\'absentant régulièrement pendant son service pour rejoindre au <l:Spectacle>  son petit ami <i:PetitAmi> (depuis quelques mois) et notamment hier (alors que son jour de congés est aujourd\'hui).  Sauf qu\'hier elle y a surpris <i:Dominus> avec sa maîtresse <i:Maîtresse>.]]></DESCRIPTION><TAGS/><RELATIONS><RELATION description=\"&lt;i:Servante&gt; et &lt;i:PetitAmi&gt; sont amants.\" is_bijective=\"true\" role_id=\"111010\" type=\"Amour\" weight=\"100\"/><RELATION description=\"&lt;i:Servante&gt; est au service de &lt;i:Domina&gt; sa maîtresse\" is_bijective=\"false\" role_id=\"111007\" type=\"Hiérarchie Asc\" weight=\"101\"/><RELATION description=\"&lt;i:Servante&gt; est au service de &lt;i:Dominus&gt; son maître\" is_bijective=\"false\" role_id=\"111008\" type=\"Hiérarchie Asc\" weight=\"101\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111009\" title=\"\"><DESCRIPTION><![CDATA[Je me rends donc au <l:Spectacle>. Les lieux sont dans la pénombre et j\'ai beaucoup de mal à retrouver <i:PetitAmi> au milieu de toute cette foule. \nIl a belle allure et d\'une élégance irrésistible. Moi aussi je me suis mise sur mon 31, enfin...  aussi vite que j\'ai pu.\nUne fois assis, il me prend par les épaules, j\'adore quand il fait cela. Ces instants me paraissent aussi délicieux qu\'interminables quand un peu de lumière regagne la salle: c\'est l\'entracte.\nUn homme deux rangs devant nous se lève et se retourne, sans doute pour rejoindre les lavabos : Ciel ! c\'est <i:Dominus> ! Il me regarde, voit la main de <i:PetitAmi> (qu\'il connaît peut-être qui sait ?) autour de mes épaules, et je vois une jeune femme penchée sur <i:Dominus> : ce n\'est pas <i:Domina>.\nJe ne peux distinguer à cette distance qui est cette femme... Sans doute la poule de Monsieur ? Nos regards se croisent avec  <i:Dominus> je suis bouleversée d\'embarras, mais il le semble autant. \nIl sait que je me suis absenté pendant mon services et pourrait me licencier sans mes gages ! mais cette poule ? si Madame <i:Domina> venait à l\'apprendre.... \nJe crois qu\'à présente nous nous tenons l\'un l\'autre ! \nNous sortons de la salle du <l:Spectacle> sans nous dire un mot avec <i:Dominus>]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111008\" title=\"\"><DESCRIPTION><![CDATA[Merveilleuse Catastrophe ! <i:PetitAmi> vient de me laisser un petit billet doux où il me dit qu\'il m\'attend à la séance de 16h30 au <l:Spectacle> , où nous avons l\'habitude de nous retrouver !  \nIl a dû changer son programme, nous ne devions y aller que DEMAIN, car c\'est mon jour de congés hebdomadaire !\nTant pis j\'y avais… Il faudra que je prépare malgré tout une bonne explication auprès de <i:Domina> qui ne manquera pas de surprendre - et s\'offusquer - de mon absence...]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111006\" title=\"\"><DESCRIPTION><![CDATA[Aujourd\'hui je vais au <l:Spectacle> : la place est fort chère pour moi et catastrophe, je me suis trompée sur le prix de la place : il me manque quelques sous pour rentrer, et le caissier ne veut rien savoir. \nUn galant jeune homme sort de la file pour déposer au caissier les quelques sous manquant et nous rentrons ainsi tous deux. Je le gratifie d\'un sourire, il se présente et me dit s\'appeler <i:PetitAmi>. Je le trouve charmant avec ses airs assurés et son élégance toute naturelle. \nNous faisons connaissances, il vit bourgeoisement, je lui dit que je ne suis \"que\" domestique en la <l:Demeure> de <i:Domina> et <i:Dominus> mais cela ne semble pas le gêner que nous ne soyons pas vraiment de la même condition sociale.\n\nQuelques jours se sont écoulés, et nous flirtons ensemble. Il a découvert que j\'aime beaucoup le <l:Spectacle> et il m\'offre la place chaque semaine pour que puissions nous retrouver, enfin quand son emploi du temps le permet (parfois, il me faut m\'y rendre secrètement pendant mes heures de service).]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"PetitAmi\" id=\"111010\" pipi=\"0\" pipr=\"2\" type=\"PJ\"><DESCRIPTION><![CDATA[Le petit ami depuis quelques mois de <i:Servante>, ils se retrouvent régulièrement au <l:Spectacle>.]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Homme\" weight=\"101\"/></TAGS><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"111009\" title=\"\"><DESCRIPTION><![CDATA[Je retrouve <i:Servante> au <l:Spectacle> comme convenu, toujours ravissante. Moi aussi je me suis mis sur mon 31.\nIl y a énormément de monde dans la pénombre, j\'ai beaucoup de mal à la retrouver dans la foule. Une fois assis dans la pénombre, je la prends par les épaules, je la sens heureuse de se lover contre moi.\nCes instants me paraissent aussi délicieux qu\'interminables quand un peu de lumière regagne la salle : c\'est l\'entracte.\nBeaucoup de gens en profitent pour se lever et se diriger vers les lavabos, j\'ai l\'impression que cet entracte brise le charme de ce tendre moment avec <i:Servante>, et j\'aimerais que le <l:Spectacle> reprenne le fil au plus vite.\nQuand le <l:Spectacle> reprend, je sens <i:Servante> plus tendue... Je n\'ose lui en parler sur le moment. Quand nous nous reverrons, j\'aborderai peut être les raisons de sa contrariété : ai-je fait ou dit  quelque chose ? ou plutôt omis de faire/dire quelque chose ?\nAh! ce que les femmes sont compliquées parfois !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111006\" title=\"\"><DESCRIPTION><![CDATA[Aujourd\'hui je me suis rendu au <l:Spectacle> et dans la file d\'attente, il y a une jeune femme qui visiblement s\'est trompée sur le prix de la place et à laquelle il manque quelques sous pour rentrer. Le caissier ne veut rien savoir. Je sors de la file et offre les quelques sous manquant à la jolie malheureuse, qui me gratifie du plus charmant des sourires. Elle me dit s\'appeler <i:Servante>. Nous faisons connaissance, et me dit être domestique en la <l:Demeure> de <i:Dominus> et <i:Domina> où elle travaille dur, n\'ayant qu\'une journée de congés par semaine pour aller se divertir.\nJe suis immédiatement séduit par son sourire.\nQuelques jours se sont écoulés et nous flirtons déjà ensemble. J\'ai découvert que <i:Servante> adore le <l:Spectacle>, et je lui offre la place chaque semaine pour que nous puissions nous retrouver, enfin,... quand mon emploi du temps le permet (je crois qu\'elle me retrouve ainsi parfois pendant ses heures de service).]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111005\" title=\"\"><DESCRIPTION/></PAST_SCENE><PAST_SCENE past_scene_id=\"111008\" title=\"\"><DESCRIPTION><![CDATA[Demain c\'est le jour de congés de <i:Servante> et nous devions nous retrouver au <l:Spectacle>. Malheureusement, j\'ai une journée bien chargée demain, et nous ne pourrons sans doute pas nous retrouver au <l:Spectacle> comme nous en avons l\'habitude.\nJe viens de faire porter à <i:Servante> un petit biller doux et je lui dis que je l\'attends à 16h30 au <l:Spectacle> : elle est si maligne qu\'elle arrive toujours à s\'absenter pendant ses heures de services sans que sa maîtresse <i:Domina> ne lui créée trop de soucis.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Maîtresse\" id=\"111009\" pipi=\"1\" pipr=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[A une liaison avec <i:Dominus> , un homme marié, qu\'elle rencontre chaque semaine en secret. Hier ils se sont vu au <l:Spectacle>]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"111007\" title=\"\"><DESCRIPTION><![CDATA[Il y a deux mois, j\'ai rencontré, puis me suis rapproché de <i:Dominus>, un homme marié. Entre nous est née bien vite une passion torride et nous essayons de nous voir le plus souvent possible, dans des endroits chaque fois différents.... avec elle j\'ai l\'impression d\'avoir retrouvé mes 20ans.\nOh ! nous ne nous racontons pas grand chose de bien sorcieurs, nous sommes juste heureux de nous retrouver, nous amuser, et passer du bon temps si vous voyez ce que je veux dire !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111009\" title=\"\"><DESCRIPTION><![CDATA[<i:Dominus> m\'a fait porter ce matin une belle surprise : une place pour aller le retrouver au <l:Spectacle> ! J\'en suis ravie. \nJe me mets un peu sur mon 31 et je l\'y retrouve à 17h. Il y a énormément de monde et dans la pénombre, j\'ai beaucoup de mal à le retrouver dans la foule.\nIl m\'a acheté quelques chocolats que nous dégustons pendant le <l:Spectacle> comme deux enfants. \n\nA l\'entracte, nous réalisons que nous avons du chocolat plein les doigts et convenons d\'aller nous laver les mains. Il semble bouleversé en revenant, mais ne dit pourquoi. Je n\'ose lui poser de question sur le coup : il a certainement du reconnaître une connaissance avec laquelle il est en affaire, et du fait du caractère particulier et récent de notre liaison, nous ne faisons que commencer à parler de nos affaires privées : peut-être est-il gêné d\'être vu avec moi (et non son épouse <i:Domina>) ?]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Dominus\" id=\"111008\" pipi=\"3\" pipr=\"0\" type=\"PJ\"><DESCRIPTION><![CDATA[<i:Dominus> est marié avec <i:Domina>,ils ont embauché <i:Servante> comme servante en fixant son jour hebdomadaire de congés à aujourd\'hui.\n<i:Dominus> a depuis quelques mois une liaison avec <i:Maîtresse> qu\'il rencontre en secret. Hier il l\'a rencontrée au <l:Spectacle> mais malheureusement, il s\'y est fait surprendre par <i:Servante>, qui se divertit pendant ses heures de service !]]></DESCRIPTION><TAGS><TAG type=\"Sexe\" value=\"Homme\" weight=\"101\"/></TAGS><RELATIONS><RELATION description=\"&lt;i:Dominus&gt; et &lt;i:Domina&gt; sont secrètement amants.\" is_bijective=\"true\" role_id=\"111009\" type=\"Amour\" weight=\"101\"/><RELATION description=\"&lt;i:Dominus&gt; a &lt;i:Servante&gt; comme servante\" is_bijective=\"false\" role_id=\"111006\" type=\"Hiérarchie Desc\" weight=\"101\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"111009\" title=\"\"><DESCRIPTION><![CDATA[J\'ai fait porter ce matin à <i:Maîtresse> une surprise : une place pour aller le retrouver au <l:Spectacle> ! \nNous n\'y sommes jamais allé ensemble, et j\'ai raconté à mon épouse <i:Domina> que je rentrerai tard ce soir du fait d\'une surcharge de travail.\n<i:Maitresse> me retrouve, toujours aussi élégante.\nIl y a énormément de monde dans la pénombre et j\'ai beaucoup de mal à le retrouver dans la foule. Je lui ai acheté à l\'accueil quelques chocolats que nous dégustons pendant le <l:Spectacle> comme deux enfants !\nA l\'entracte, nous réalisons que avons du chocolat plein les doigts et convenons d\'aller nous laver les mains. Dès que je me lève pour rejoindre les lavabos, je découvre que peu derrière nous se trouve <i:Servante>, avec un jeune homme. Nos regards se croisent.\nLe jeune homme regarde ailleurs et dans la faible luminosité, je le distingue trop mal pour le reconnaître. Mais si j\'en crois la main du jeune homme autour des épaules de <i:Servante>, ils sont proches ! \nIl est évident qu\'elle a remarqué que je n\'étais pas avec mon épouse, et connaît peut-être même <i:Maîtresse>. Je suis bouleversé d\'embarras, mais elle le semble autant. Je viens de réaliser que ce n\'est pas son jour de congés aujourd\'hui, et que si mon épouse découvre les raisons de son absence, elle est licenciée sur le champ et sans ses gages ! Bref nous nous tenons l\'un l\'autre ! \nNous sortons de la salle du Spectacle sans nous dire un mot avec <i:Servante>]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"111007\" title=\"\"><DESCRIPTION><![CDATA[Depuis 3 mois, cela ne va pas bien entre mon épouse <i:Domina> et moi, et nous sommes tout le temps en train de nous chamailler pour un rien. Je crois que depuis le temps que nous sommes mariés, nous nous sommes un peu éloignés l\'un de l\'autre. La moindre occasion est devenue le prétexte à une dispute.\nJ\'espère au moins qu\'elle ne fréquente personne d\'autre que moi. Pas comme moi !....\nEn effet, il y a deux mois j\'ai rencontré - puis me suis rapproché - de <i:Maîtresse>. Entre nous est née bien vite une passion torride et nous essayons de nous voir le plus souvent possible, dans des endroits chaque fois différents.... \nAvec elle j\'ai l\'impression d\'avoir retrouvé mes 20ans !\nOh ! nous ne nous racontons pas grand-chose de bien sorciers, nous sommes juste heureux de nous retrouver, nous amuser, et passer du bon temps si vous voyez ce que je veux dire !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"111008\" is_public=\"false\"><TITLE><![CDATA[Absence de <i:Servante>]]></TITLE><DESCRIPTION><![CDATA[<i:Servante> quitte discrètement <l:Demeure> pendant ses heures de service pour rejoindre son flirt <i:PetitAmi>. Malheureusement <i:Domina> s\'en aperçoit.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1135\"/></GENERIC_PLACES><TIME><ABSOLUTE day=\"31\" hour=\"3\" isAbsoluteDay=\"false\" isAbsoluteHour=\"true\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"4\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111005\" is_public=\"false\"><TITLE><![CDATA[Embauche de <i:Servante>]]></TITLE><DESCRIPTION><![CDATA[<i:Dominus> et <i:Domina>  embauchent <i:Servante> comme servante à leur <l:Demeure>]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"5\" year=\"2014\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111009\" is_public=\"false\"><TITLE><![CDATA[Au <l:Spectacle>]]></TITLE><DESCRIPTION><![CDATA[Au <l:Spectacle> se retrouvent <i:Servante> (pendant ses heures de service) avec <i:PetitAmi>  (comme d\'habitude) et <i:Dominus> avec sa maîtresse <i:Maîtresse> (c\'est la première fois qu\'ils se retrouvent là).\nMalheureusement <i:Servante> et  <i:Dominus> vont tomber nez à nez l\'un sur l\'autre]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"111008\"/></PREDECESSORS><GENERIC_PLACES><GENERIC_PLACE generic_place_id=\"1134\"/></GENERIC_PLACES><TIME><ABSOLUTE day=\"31\" hour=\"5\" isAbsoluteDay=\"false\" isAbsoluteHour=\"true\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"4\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111006\" is_public=\"false\"><TITLE><![CDATA[Flirt <i:PetitAmi> et <i:Servante>]]></TITLE><DESCRIPTION><![CDATA[<i:PetitAmi> et <i:Servante> flirtent ensemble.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"2\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"111007\" is_public=\"false\"><TITLE><![CDATA[Liaison <i:Dominus> et <i:Maîtresse>]]></TITLE><DESCRIPTION><![CDATA[<i:Dominus> a pris <i:Maîtresse> pour maîtresse, en secret de son épouse <i:Domina>.]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"3\" year=\"2015\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS><EVENT absolute_timing=\"01/06/2015 11:25\" duration=\"5\" id=\"10803\" is_planned=\"false\" is_public=\"false\" timing=\"5\"><TITLE><![CDATA[Démasqués !]]></TITLE><DESCRIPTION><![CDATA[1 PNJ / Orga\n- Montrer à <i:Dominus> le joueur incarnant <i:PetitAmi> (sans lui donner son nom) et lui dire que c\'est l\'homme qui était \" avec \" <i:Servante> au <l:Spectacle> hier\n- Montrer à <i:Servante> la joueuse incarnant  <i:Maîtresse> (sans lui donner son nom) et lui dire que c\'est la femme qui était \" avec \" <i:Dominus> au <l:Spectacle> hier]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/></EVENT></EVENTS><GENERIC_PLACES><GENERIC_PLACE code=\"Demeure\" id=\"1135\" object_type_id=\"1\"><TAGS><TAG type=\"Fonction Lieu\" value=\"Habitation et Résidence\" weight=\"100\"/><TAG type=\"&gt; Lieu Superficie\" value=\"&gt; Edifice - Batîment\" weight=\"100\"/><TAG type=\"Richesse\" value=\"Riche\" weight=\"100\"/></TAGS><COMMENT><![CDATA[La demeure de <i:Domina> et <i:Dominus>]]></COMMENT></GENERIC_PLACE><GENERIC_PLACE code=\"Spectacle\" id=\"1134\" object_type_id=\"2\"><TAGS><TAG type=\"&gt; Lieu Superficie\" value=\"&gt; Edifice - Batîment\" weight=\"100\"/><TAG type=\"Fonction Lieu\" value=\"Lieu Divertissement\" weight=\"100\"/></TAGS><COMMENT><![CDATA[Un lieu de spectacle]]></COMMENT></GENERIC_PLACE></GENERIC_PLACES><GENERIC_RESOURCES/></PLOT><PLOT author=\"4\" creation_date=\"1386543600000\" id=\"110\" is_evenemential=\"false\" is_mainstream=\"false\" is_public=\"true\" last_update_date=\"1386543600000\" title=\"La chasse au trésor\"><DESCRIPTION>Les 6 personnages sont dans un lieu clos et souhaitent trouver un trésor qui est caché à proximité. &#13;\n&lt;I:Kebab&gt;, &lt;I:BloodyMary&gt; et &lt;I:Armando&gt; possèdent un fragment de la carte et sont à la recherche des autres morceaux. Le but est de rassembler tous les fragments pour récupérer le trésor. Sauf qu\'à l\'emplacement du trésor, il n\'y a que des cailloux... Seul &lt;I:Armando&gt; sait que le trésor n\'existe pas car c\'est lui qui a créé la carte (en tant que &lt;I:Barberaze&gt;).</DESCRIPTION><TAGS><TAG type=\"Sources\" value=\"PRC-GN-SIGL2014\" weight=\"100\"/><TAG type=\"Sources\" value=\"Un pirate ne meurt jamais\" weight=\"100\"/><TAG type=\"Type intrigue\" value=\"Résoudre une énigme - (Polti)\" weight=\"80\"/></TAGS><ROLES><ROLE code=\"Ramon\" id=\"1105\" pipi=\"0\" pipr=\"2\" type=\"PJ\"><DESCRIPTION><![CDATA[Cherche le trésor de <i:Kebab>]]></DESCRIPTION><TAGS><TAG type=\"Trait de personnalité\" value=\"Sympathique\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Naïf\" weight=\"80\"/></TAGS><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1104\" title=\"\"><DESCRIPTION><![CDATA[J\'ai entendu parlé d\'une rumeur d\'un formidable trésor caché par <i:Barberaze>, un dangereux criminel qui sévit paraît il depuis tant d\'années qu\'il doit être au moins centenaire. Or on raconte que <i:Barberaze> est mort…. Si seulement j\'avais une piste, je saurais au moins par où commender pour mettre la main sur ce fabuleux trésor !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Dona\" id=\"1106\" pipi=\"0\" pipr=\"2\" type=\"PJ\"><DESCRIPTION><![CDATA[Cherche le trésor de Kebab]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1104\" title=\"\"><DESCRIPTION><![CDATA[J\'ai entendu parlé d\'une rumeur d\'un formidable trésor caché par <i:Barberaze>, un dangereux criminel qui sévit paraît il depuis tant d\'années qu\'il doit être au moins centenaire. Or on raconte que <i:Barberaze> est mort…. Si seulement j\'avais une piste, je saurais au moins par où commender pour mettre la main sur ce fabuleux trésor !]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Barberaze\" id=\"1103\" pipi=\"0\" pipr=\"3\" type=\"PHJ\"><DESCRIPTION><![CDATA[Un terrible criminel qui est mort il y a quelques années.]]></DESCRIPTION><TAGS><TAG type=\"Trait de personnalité\" value=\"Naïf\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Sympathique\" weight=\"80\"/></TAGS><RELATIONS><RELATION description=\"Ils sont amis\" is_bijective=\"true\" role_id=\"1107\" type=\"Amitié\" weight=\"80\"/><RELATION description=\"Ils sont amis\" is_bijective=\"true\" role_id=\"1104\" type=\"Amitié\" weight=\"80\"/></RELATIONS><PAST_SCENES/><EVENTS/></ROLE><ROLE code=\"Kebab\" id=\"1107\" pipi=\"0\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Autre meurtrier mort]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1105\" title=\"\"><DESCRIPTION><![CDATA[Cela faisait longtemps que je connaissais <i:Kebab> qui portait un masque en permanence peut être pour cacher d\'horribles cicatrices. Et puis tout le monde avait entendu parlé de son trésor… \nA cette époque, je m\'appelais encore <i:Gaspard>.\n\nEt puis un jour, j\'ai parlé avec <i:Kebab> pour lui tirer les verres du nez afin qu\'il partage son trésor avec moi. Malheureusement, on avait l\'un et l\'autre un peu trop bu et la discussion a tourné à la dispute, on en est venus aux mains. \nDans la fureur du moment, j\'ai perdu le contrôle et quand j\'ai récupéré mes esprits… <i:Kebab> gisait mort à mes pieds. J\'ai alors pensé que ce brigand avait sans doute donnait del\'information sur l\'emplacement de son trésor à quelqu\'un et me suis dit que ce serait plus aisé si je prenais son identité, donc son masque. C\'est ce que j\'ai fait, et depuis je me fait passer pour <i:Kebab>.\n<i:Gaspard> n\'est plus ! Vive <i:Kebab>\n\nJ\'espère que j\'arriverai à jouer le rôle sans être démasqué !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1101\" title=\"\"><DESCRIPTION><![CDATA[J\'ai fini par récupérer les affaires de <i:Kebab> en me débarassant du coprs  après l\'avoir tué. \nA ma grande surprise, en y regardant de plus prêt, j\'ai trouvé  <o:MorceauCarte3> : le bougre cachait un trésor : récupérer ce trésor est désormais mon but mais je n\'ai qu\'un morceau sur une carte qui doit être composée de 2, 3, 4 ou 5 morceaux…]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1103\" title=\"\"><DESCRIPTION><![CDATA[Je connais depuis longtemps <i:Barberaze>, qui est en fait un criminel, et qu\'on dit  fait fort riche. En effet, la légende prétend qu\'au fil de ses méfaits, il a accumulé un véritable trésor qu\'il cachait dans un lieu secret.\nUn jour il m\'a écrit un courrier donné un <o:MorceauCarte3>. Il me dit dans le courrier que sa vie est en danger, et qu\'il a disseminé des morceaux de carte pour accéder à son trésor le jour où il lui arriverait quelque chose. \nJe garde le document très précieusement.]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1102\" title=\"\"><DESCRIPTION><![CDATA[Il y a quelques jours j\'ai revu <i:BloodyMary>. J\'ai entraperçu dans un de ses sacs un vieux document qui paraissait fort ancien et qui semblait indiquer une carte. Cette question m\'obsédait, et j\'ai finalement réussi à le subtiliser sans que <i:BloodyMary> ne me découvrir ni ne s\'aperçoive de mon délicatesse. Car lorsque je l\'ai revu après, <i:BloodyMary> ne paraissait nullement inquiété de quoi que ce soit…\nPar contre quand j\'ai observé le document, j\'ai bien vu qu\'il s\'agissait d\'une sorte de carte, qui visiblement a été séparée en plusieurs morceaux. Très probablement une carte au trésor !!! Je dois mettre la main sur les autres bouts.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Armando\" id=\"1102\" pipi=\"0\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Est en fait <i:Barberaze>.]]></DESCRIPTION><TAGS><TAG type=\"Trait de personnalité\" value=\"Naïf\" weight=\"80\"/><TAG type=\"Trait de personnalité\" value=\"Sympathique\" weight=\"80\"/></TAGS><RELATIONS><RELATION description=\"Je connais\" is_bijective=\"true\" role_id=\"1104\" type=\"Connaît\" weight=\"100\"/><RELATION description=\"Je connais\" is_bijective=\"true\" role_id=\"1107\" type=\"Connaît\" weight=\"100\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"1106\" title=\"\"><DESCRIPTION><![CDATA[Je connais bien <i:Kebab> même s\'il ne sait pas que je le connais puisque je  l\'ai connu en tant que <I:Barberaze>. J\'ai remarqué qu\'il agissait étrangement depuis quelques jours… Serait-ce à cause du trésor qui le rend si nerveux ? Il semble avoir changé physiquement (plus petit)…]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1103\" title=\"\"><DESCRIPTION><![CDATA[J\'ai connu il y a quelques années <i:Barberaze> un dangereux criminel mais avec qui, quel hasard de la vie, nous étions devenu amis. La légende prétend qu\'au fil de ses méfaits, il avait accumulé un véritable trésor qu\'il cachait dans un lieu secret.\nEt puis un jour il m\'a écrit qu\'il était atteint d\'une incurable maladie. Lorsque je suis arrivé à son chevet, c\'était pour le découvrir mourrant mourrant, dans ses derniers instants. Il m\'expliqua alors que <i:Barberaze> n\'avait pas été son vrai nom, mais le nom qu\'il avait pris à son ami qui était mort dans ses bras. A présent, il me demandait de reprendre le nom mythique de <i:Barberaze> et de ses fabuleux trésors. J\'ai accepté sans hésiter, me voilà à présent <i:Barberaze>.\nSauf que depuis j\'ai réalisé que la légende. Les fabuleux trésors de <i:Barberaze> ne sont plus s\'ils n\'ont jamais existé. Mais qu\'importe, j\'avoue que cela m\'amuse : Tout le monde pense que <i:Barberaze> cache ses fabuleux trésors quelque part\n\nPour renforcer la légende, j\'ai eu l\'idée de créer une carte que je l\'ai découpée en 3 morceaux que j\'ai donnés à des amis, qui -peut-être qui sait ?- deviendront à leur tour <i:Barberaze> à leur tour.\nJ\'ai gardé un <o:MorceauCarte1>  évidemment pour que personne ne puisse la recréer. En tant que <i:Barberaze>, j\'ai envoyé un courrier contenant un <o:MorceauCarte2> à <i:BloodyMary> et  un autre courrier contenant <o:MorceauCarte3> à <i:Kebab> (un criminel). Je leur dit dans ce courrier que ma vie est en danger, et que j\'ai disseminé la carte pour accéder à mon trésor le jour où il m\'arriverait quelque chose.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"Gaspard\" id=\"1101\" pipi=\"0\" pipr=\"3\" type=\"PHJ\"><DESCRIPTION><![CDATA[Se fait passer pour <i:Kebab>]]></DESCRIPTION><TAGS/><RELATIONS/><PAST_SCENES><PAST_SCENE past_scene_id=\"1101\" title=\"\"><DESCRIPTION><![CDATA[Note au PHJ <i:Gaspard> qui est devenu <i:Kebab>\nJ\'ai récupéré les affaires de <i:Kebab> en me débarassant du corps  après l\'avoir tué. \nA ma grande surprise, en y regardant de plus prêt, j\'ai trouvé  <o:MorceauCarte3> : le bougre cachait un trésor : récupérer ce trésor est désormais mon but mais je n\'ai qu\'un morceau sur une carte qui doit être composée de 2, 3, 4 ou 5 morceaux…]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1105\" title=\"\"><DESCRIPTION><![CDATA[Côté PNJ : <i:Gaspard a parlé avec <i:Kebab> pour qu\'il partage son tréso. Malheureusement, <i:Gaspard> a un peu trop bu et la discution a tourné à la dispute. \nDans la fureur du moment, <i:Gaspard>  a perdu le contrôle et quand il récupère mes esprits… <i:Kebab>  est mort à mes pieds. <i:Gaspard>  décide alors de prendre l\'identité de de <i:Kebab>.\nPour cela il porte un masque et de se fait passer pour lui pour que personne ne se rende compte qu\'il est mort et pour récupérer le trésor. J\'espère que j\'arriverais à jouer le rôle sans être démasqué !\n\n<i:Gaspard> n\'est plus ! Vive <i:Kebab>]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE><ROLE code=\"BloodyMary\" id=\"1104\" pipi=\"0\" pipr=\"3\" type=\"PJ\"><DESCRIPTION><![CDATA[Cherche le trésor de <i:Barberaze>]]></DESCRIPTION><TAGS/><RELATIONS><RELATION description=\"Ils sont amis\" is_bijective=\"true\" role_id=\"1107\" type=\"Amitié\" weight=\"80\"/></RELATIONS><PAST_SCENES><PAST_SCENE past_scene_id=\"1106\" title=\"\"><DESCRIPTION><![CDATA[Je connais bien <i:Kebab> et j\'ai remarqué qu\'il agissait étrangement depuis quelques jours… Serait-ce à cause du trésor ? Je devrais aller lui en parler… Et récupérer mon morceau de la carte !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1102\" title=\"\"><DESCRIPTION><![CDATA[Le <o:MorceauCarte2> de <i:Barberaze> a disparu ! C\'est arrivé je pense il y a quelques jours, je suis à peu près sûr que c\'est <i:Kebab> qui me l\'a volé, je l\'ai senti tournant autour de moi ces derniers temps ! Je dois absolument la récupérer et trouver le trésor !]]></DESCRIPTION></PAST_SCENE><PAST_SCENE past_scene_id=\"1103\" title=\"\"><DESCRIPTION><![CDATA[Je connais depuis longtemps <i:Barberaze>, qui est en fait un criminel, et qu\'on dit  fait fort riche. En effet, la légende prétend qu\'au fil de ses méfaits, il a accumulé un véritable trésor qu\'il cachait dans un lieu secret.\nUn jour il m\'a écrit un courrier donné un <o:MorceauCarte2>. Il me dit dans le courrier que sa vie est en danger, et qu\'il a disseminé des morceaux de carte pour accéder à son trésor le jour où il lui arriverait quelque chose. \nJe garde le document très précieusement.]]></DESCRIPTION></PAST_SCENE></PAST_SCENES><EVENTS/></ROLE></ROLES><PAST_SCENES><PAST_SCENE id=\"1102\" is_public=\"false\"><TITLE><![CDATA[Récupération d\'une partie de la carte]]></TITLE><DESCRIPTION><![CDATA[<i:BloodyMary> : J\'avais un bout de la carte au trésor de <i:Barberaze>, mais il a disparu il y a quelques jours. Je suis à peu près sûr que c\'est <i:Kebab> qui me l\'a volé ! Je dois absolument la récupérer et trouver le trésor !]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"12\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"4\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1101\" is_public=\"false\"><TITLE><![CDATA[Récupération d\'une partie de la carte]]></TITLE><DESCRIPTION><![CDATA[<i:Gaspard> récupère un morceau de la carte sur le cadavre du vrai <i:Kebab> qu\'il vient de tuer.]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"1105\"/></PREDECESSORS><GENERIC_PLACES/><TIME><ABSOLUTE day=\"30\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"4\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1104\" is_public=\"false\"><TITLE><![CDATA[Le trésor]]></TITLE><DESCRIPTION><![CDATA[J\'ai entendu parlé d\'une rumeur d\'un formidable trésor caché par <i:Barberaze>, un dangereux criminel qui sévit paraît il depuis tant d\'années qu\'il doit être au moins centenaire. Or on raconte que <i:Barberaze> est mort…. Si seulement j\'avais une piste, je saurais au moins par où commender pour mettre la main sur ce fabuleux trésor !]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"1103\"/></PREDECESSORS><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"0\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1105\" is_public=\"false\"><TITLE><![CDATA[Le faux <i:Kebab>]]></TITLE><DESCRIPTION><![CDATA[Kebab est mort tué par <i:Kebab> qui a pris sa place. Personne n\'est au courant mais son comportement risque de le trahir.\n\nNote : le personnage est transféré à Kebab]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"20\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"4\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1106\" is_public=\"false\"><TITLE><![CDATA[Un étrange comportement]]></TITLE><DESCRIPTION><![CDATA[<i:Kebab> a un comportement étrange depuis quelques jours…]]></DESCRIPTION><PREDECESSORS><PREDECESSOR past_scene_id=\"1105\"/></PREDECESSORS><GENERIC_PLACES/><TIME><ABSOLUTE day=\"28\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"4\" year=\"2015\"/></TIME></PAST_SCENE><PAST_SCENE id=\"1103\" is_public=\"false\"><TITLE><![CDATA[Le trésor de <i:Barberaze>]]></TITLE><DESCRIPTION><![CDATA[<i:Barberaze> (l\'ancien) meurt das les bras de <i:Armando> qui, à sa demande, reprend l\'identité de <i:Barberaze>.\nLe nouveau <i:Barberaze> fait courir la légende sur sa richesse et son trésor, coupe la carte en trois et distribue un bout à <i:BloodyMary> et un autre à <i:Kebab>. <i:Barberaze> -on insiste qui est à présent en réalité <i:Armando> - garde le troisième bout]]></DESCRIPTION><PREDECESSORS/><GENERIC_PLACES/><TIME><ABSOLUTE day=\"1\" hour=\"11\" isAbsoluteDay=\"false\" isAbsoluteHour=\"false\" isAbsoluteMinute=\"false\" isAbsoluteMonth=\"false\" isAbsoluteYear=\"false\" minute=\"0\" month=\"3\" year=\"2014\"/></TIME></PAST_SCENE></PAST_SCENES><EVENTS><EVENT absolute_timi