INSERT INTO `pastscene` VALUES (1071,'2014-10-09 18:10:15','2013-08-15 00:00:00',3,'Un amour de jeunesse',25,NULL,NULL,NULL,NULL,25,'Y',1,'<i:DV> et <i:RA> se sont  connus sur <l:lieu1>, ils se sont aimés. A cette époque, <i:DV> était un être doux et gentil.',NULL,NULL,107,0,0,0,0,0),(1072,'2014-10-09 18:10:15','2013-08-15 00:00:00',3,'Très Méchant',24,NULL,NULL,NULL,NULL,24,'Y',1,'<i:DV>  est Jedi et bascule du côté obscur de la Force. Il devient très \'méchant\'.\r\n<i:DV> et <i:RA> se séparent. Elle accouche quelques jours après de deux faux jumeaux, <i:PL> et <i:LS> qui portent chacun une <o:medaille1>\r\n\r\n<i:DV> est furieux, tente sans succès de tuer <i:RA> qui s\'enfuit avec <i:PL>.\r\nNéanmoins <i:OB> parvient à \" voler \" <i:LS>.',NULL,NULL,107,0,0,0,0,0),(1073,'2014-10-09 18:10:15','2013-08-15 00:00:00',3,'Enfance Humble',21,NULL,NULL,NULL,NULL,21,'Y',1,'<i:OB> combat la force obscure et à <l:lieu1> tend un piège à <i:DV>.\n<i:OB> défigure <i:DV> qui tombe dans de la lave.\r\n<i:OB> rentre seul et fait élever <i:LS> dans une humble famille sur <l:lieu2> et lui cache son père (la famille humble pense que c\'est <i:OB>)',NULL,NULL,107,0,0,0,0,0),(1074,'2014-10-09 18:10:15','2013-08-15 00:00:00',3,'Enfance Riche',21,NULL,NULL,NULL,NULL,21,'Y',1,'<i:RA> élève seule <i:PL> à <l:lieu3> et occulte complètement la question de l\'identité du père de <i:PL>.',NULL,NULL,107,0,0,0,0,0),(1075,'2014-10-09 18:05:51','2013-08-15 00:00:00',2,'La rencontre',NULL,NULL,15,NULL,NULL,15,'d',1,'<i:LS> et <i:PL> se rencontrent sur <l:Lieu2> et tombent immédiatement amoureux.',NULL,NULL,107,0,0,0,0,0),(1101,'2014-05-23 00:00:00','2013-12-10 00:00:00',9,'Récupération d\'une partie de la carte',NULL,NULL,2,NULL,NULL,2,'d',0,'<i:Gaspard> récupère un morceau de la carte sur le cadavre du vrai <i:Kebab> qu\'il vient de tuer.',NULL,1105,110,0,0,0,0,0),(1102,'2014-05-23 00:00:00','2013-12-10 00:00:00',6,'Récupération d\'une partie de la carte',NULL,NULL,20,NULL,NULL,20,'d',0,'<i:BloodyMary> : J\'avais un bout de la carte au trésor de <i:Barberaze>, mais il a disparu il y a quelques jours. Je suis à peu près sûr que c\'est <i:Kebab> qui me l\'a volé ! Je dois absolument la récupérer et trouver le trésor !',NULL,NULL,110,0,0,0,0,0),(1103,'2014-05-23 00:00:00','2013-12-10 00:00:00',1,'Le trésor de <i:Barberaze>',NULL,14,NULL,NULL,NULL,14,'M',0,'<i:Barberaze> (l\'ancien) meurt das les bras de <i:Armando> qui, à sa demande, reprend l\'identité de <i:Barberaze>.\r\nLe nouveau <i:Barberaze> fait courir la légende sur sa richesse et son trésor, coupe la carte en trois et distribue un bout à <i:BloodyMary> et un autre à <i:Kebab>. <i:Barberaze> -on insiste qui est à présent en réalité <i:Armando> - garde le troisième bout',NULL,NULL,110,0,0,0,0,0),(1104,'2014-05-23 00:00:00','2013-12-12 00:00:00',3,'Le trésor',NULL,5,NULL,NULL,NULL,5,'M',0,'J\'ai entendu parlé d\'une rumeur d\'un formidable trésor caché par <i:Barberaze>, un dangereux criminel qui sévit paraît il depuis tant d\'années qu\'il doit être au moins centenaire. Or on raconte que <i:Barberaze> est mort…. Si seulement j\'avais une piste, je saurais au moins par où commender pour mettre la main sur ce fabuleux trésor !',NULL,1103,110,0,0,0,0,0),(1105,'2014-05-23 00:00:00','2013-12-12 00:00:00',6,'Le faux <i:Kebab>',NULL,NULL,12,NULL,NULL,12,'d',0,'Kebab est mort tué par <i:Kebab> qui a pris sa place. Personne n\'est au courant mais son comportement risque de le trahir.\r\n\r\nNote : le personnage est transféré à Kebab',NULL,NULL,110,0,0,0,0,0),(1106,'2014-05-23 00:00:00','2013-12-15 00:00:00',7,'Un étrange comportement',NULL,NULL,4,NULL,NULL,4,'d',0,'<i:Kebab> a un comportement étrange depuis quelques jours…',NULL,1105,110,0,0,0,0,0),(1131,'2014-10-09 18:05:52','2014-05-02 00:00:00',2,'Départ d\'<i:Hote> pour <l:LieuLointain>',1,NULL,NULL,NULL,NULL,1,'Y',1,'<i:Hote> part, ce que savent les autres',NULL,NULL,113,0,0,0,0,0),(1132,'2014-10-09 18:10:16','2014-05-02 00:00:00',3,'Retour d\'<i:Hote> pou