r mais ne sait pas que <i:JH> l\'aime.\r\n\r\n<i:JF> et <i:Ch> tentent de comploter avec <i:Le> et <i:Li> pour faire en sorte que <i:JH> et <i:Hôte> se marient. <i:Le> et <i:li> acceptent facilement',NULL,NULL,102,0,0,0,0,0),(10301,'2014-10-09 18:05:52','2013-08-15 00:00:00',2,'Un amour de jeunesse',1,NULL,NULL,NULL,NULL,1,'Y',0,'<i:Amant> et <i:Fille> sont devenus amants par une chaude nuit d\'été',NULL,NULL,103,0,0,0,0,0),(10302,'2014-10-09 18:05:52','2013-08-15 00:00:00',2,'L\'invitation du Prétendant 1',NULL,NULL,7,NULL,NULL,7,'d',0,'<i:Père> a envoyé une lettre pour inviter <i:Prétendant 1> à rencontrer <i:Fille>',NULL,NULL,103,0,0,0,0,0),(10303,'2014-10-09 18:05:52','2013-08-15 00:00:00',2,'L\'invitation du Prétendant2',NULL,NULL,7,NULL,NULL,7,'d',0,'<i:Père> a envoyé une lettre pour inviter <i:Prétendant 2> à rencontrer <i:Fille>',NULL,NULL,103,0,0,0,0,0),(10304,'2014-10-09 18:05:52','2013-08-15 00:00:00',2,'L\'invitation du Prétendant3',NULL,NULL,7,NULL,NULL,7,'d',0,'<i:Père> a envoyé une lettre pour inviter <i:Prétendant 3> à rencontrer <i:Fille>',NULL,NULL,103,0,0,0,0,0),(10305,'2014-10-09 18:05:52','2013-08-15 00:00:00',2,'Voyage du propriétaire campagnard',NULL,NULL,3,NULL,NULL,3,'d',0,'<i:Prétendant 1> se rend depuis <L:ferme horticole> sur le lieu de l\'intrigue.',NULL,NULL,103,0,0,0,0,0),(10401,'2014-10-09 18:05:52','2013-08-15 00:00:00',2,'Déception amoureuse',2,NULL,NULL,NULL,NULL,2,'Y',1,'<i:LE> vit une déception amoureuse.\nIl décide de partir parcourir le monde sous l\'identité de <R:Id1>, avec <i:AR>, afin de mieux connaître la nature humaine.',NULL,NULL,104,0,0,0,0,0),(10402,'2014-10-09 18:05:52','2013-08-15 00:00:00',2,'Sauvetage',1,NULL,NULL,NULL,NULL,1,'Y',1,'<i:LE> sauve <i:HO> de <R:Bande1>. <i:LE> passe quelques jours en compagine de <i:HO>. <i:LE> tombe amoureux de <i:HO> et réciproquement.',NULL,NULL,104,0,0,0,0,0),(10403,'2014-10-09 18:05:52','2013-08-15 00:00:00',2,'Veuvage',NULL,10,NULL,NULL,NULL,10,'M',1,'<i:HO> devient veuve.',NULL