INSERT INTO `plot` VALUES (101,'2014-05-23 00:00:00','2013-06-11 01:18:09',11,'Le jeu de l\' Amour et du Hasard',0,0,1,'<i:PR> a arrangé le mariage de sa fille <i:SI> en lui trouvant un prétendant <i:DO> et organise une rencontre. <i:SI> et <i:DO> souhaitent tous deux tester leur promis en se travestissant en leur domestiques respectifs qui sont <i:AR> et <i:Li>. <i:PR> et son fils <i:MA> (frère de <i:Do>) découvrent les deux double-jeux et décident de profiter de l\'occasion pour s\'amuser\r\nIssu de la pièce éponyme de Marivaux.',0,5,'<i:PR> a arrangé le mariage de sa fille <i:SI> en lui trouvant un prétendant <i:DO> et organise une rencontre. <i:SI> et <i:DO> souhaitent tous deux tester leur promis en se travestissant en leur domestiques respectifs qui sont <i:AR> et <i:Li>. <i:PR> et son fils <i:MA> (frère de <i:Do>) découvrent les deux double-jeux et décident de profiter de l\'occasion pour s\'amuser',NULL,NULL),(102,'2013-07-11 22:01:56','2013-06-11 01:18:09',2,'Le Legs (Marivaux) ou les entremetteurs',0,0,1,'Deux personnages <i:JH> et <i:JF> touchent un héritage s\'ils se marient, mais des proches ont un autre projet : marier <i:JH> à <i:Hôte>\r\nSource : Marivaux. Aurélien L',0,4,'Deux personnages <i:JH> et <i:JF> touchent un héritage s\'ils se marient, mais des proches ont un autre projet : marier <i:JH> à <i:Hôte>',NULL,'Deux personnages <i:JH> et <i:JF> touchent un héritage s\'ils se marient, mais des proches ont un autre projet : marier <i:JH> à <i:Hôte>'),(103,'2013-07-11 22:01:56','2013-06-11 01:18:09',2,'Le Père prudent et Equitable',0,0,1,'Source : Marivaux. Bastien F.\r\n\r\nArgument : 		Un couple va braver l\'adversité pour se marier, aidé par le valet de l\'un d\'eux\r\nObjectif de l\'intrigue : 		Que le deux amants puissent se marier',1,2,NULL,NULL,NULL),(104,'2013-07-11 22:01:56','2013-06-11 01:18:09',11,'Le Prince Travesti',0,0,1,'Source : Marivaux. Elodie N',1,9,NULL,NULL,NULL),(105,'2013-07-11 22:01:56','2013-06-11 01:18:09',11,'L\'Epreuve',0,0,1,'Source : Marivaux. Jean-François P.',1,6,NULL,NULL,NULL),(106,'2013-07-11 22:01:56','2013-06-11 01:18:09',11,'Le Petit Maître Corrigé',0,0,1,'Source : Marivaux. Chloé V',1,3,NULL,NULL,NULL),(107,'2013-11-24 18:18:09','2013-11-24 18:18:09',11,'LoveForce',0,0,1,'Les membres séparés d\'une famille s\'affrontent et vont se retrouver pendant le GN, sur fond de passion !\r\nObjectif de l\'intrigue	-	Que le deux enfants (amoureux) découvrent qui est leur père et qu\'ils sont frère et sœur\r\nSource : SW refact by HDU',0,1,'Les membres séparés d\'une famille s\'affrontent et vont se retrouver pendant le GN, sur fond de passion !\r\nObjectif de l\'intrigue	-	Que le deux enfants (amoureux) découvrent qui est leur père et qu\'ils sont frère et sœur.',NULL,NULL),(108,'2014-12-15 13:36:08','2013-11-24 18:18:09',8,'(Evt) Croisière Maritime',1,0,1,'Les personnages font une croisière sur un vaisseau de luxe entre deux endroits éloignés',0,1,'A bord du \"7 worlds Queen\", superbe <o:Vaisseau1>, les personnages font une magnifique croisière entre <l:                    DepartCroisière                > et <l:                    DestinationCroisière                >.','A bord du \"7 worlds Queen\", superbe <o:Vaisseau1>, vous participez à une magnifique croisière entre <l:                    DepartCroisière                > et <l:                    DestinationCroisière                >.','A bord du \"7 worlds Queen\", superbe <o:Vaisseau1>, vous participez à une magnifique croisière entre <l:                    DepartCroisière                > et <l:                    DestinationCroisière                >.'),(109,'2014-07-21 16:15:31','2014-01-22 00:00:00',3,'Réseau K',0,0,1,'Sous les dehors tranquilles de <l:LIEU-GN>, se cachent des gens bien peu scrupuleux - c\'est le repère du Réseau \" <i:LeReseau> \"',0,9,'Sous les dehors tranquilles de <l:LIEU-GN>, se cachent des gens bien peu scrupuleux - c\'est le repère du Réseau \" <i:LeReseau> \"','','Sous les dehors tranquilles de <l:LIEU-GN>, se cachent des gens bien peu scrupuleux - c\'est le repère du Réseau \" <i:LeReseau> \"'),(110,'2013-12-09 00:00:00','2013-12-09 00:00:00',1,'La chasse au trésor',0,0,1,'Les 6 personnages sont dans un lieu clos et souhaitent trouver un trésor qui est caché à proximité. \r\n<I:Kebab>, <I:BloodyMary> et <I:Armando> possèdent un fragment de la carte et sont à la recherche des autres morceaux. Le but est de rassembler tous les fragments pour récupérer le trésor. Sauf qu\'à l\'emplacement du trésor, il n\'y a que des cailloux... Seul <I:Armando> sait que le trésor n\'existe pas car c\'est lui qui a créé la carte (en tant que <I:Barberaze>).',0,4,NULL,NULL,NULL),(111,'2014-05-23 00:00:00','2013-12-14 00:00:00',2,'L\'amour ne connaît pas de loi',0,0,1,'Le couple <i:Marie> et <i:Max>, le frère de ce dernier <i:Theo> et leur camarade <i:Minna> s\'associent au sein d\'une association criminelle. <i:Marie>  se fait prendre dans un braquage et pendant sa prison <i:Minna> sort avec <i:Max>. Pendant le GN <i:Marie> vient de osrtir de prison <i:Minna>  découvre qu\'elle est enceinte de <i:Max>\r\nNote : Issu des tables claudiennes (par JC Hoog.) - Transformation : Bastien',0,2,'Tensions amoureuses au sein de l\'association de malfaiteurs formée par le couple <i:Marie> et <i:Max>, le frère de ce dernier <i:Theo> et leur camarade <i:Minna>. Mais <i:Minna> découvre qu\'elle est enceinte de <i:Max>',NULL,NULL),(112,'2014-05-23 00:00:00','2013-12-12 00:00:00',2,'Enfant inconnu dans un pays étranger',0,0,1,'Un homme tombe amoureux pendant qu\'il est en guerre dans un autre pays. Il y abandonne l\'amour de sa vie quand il revient chez lui. De cette union, naît un enfant dont ce père ignore l\'existence.',0,3,'Un homme tombe amoureux pendant qu\'il est en guerre dans un autre pays. Il y abandonne l\'amour de sa vie quand il revient chez lui. De cette union, naît un enfant dont ce père ignore l\'existence.',NULL,NULL),(113,'2013-11-24 18:18:09','2013-11-24 18:18:09',1,'(Evt) Célébration Retour d\'un ami',1,0,1,'Les personnages sont venus assister à une réception donnée dans son <l:Demeure> à <l:LieuDemeure> par <i:Hote> pour célébrer son retour de <l:LieuLointain>, absent depuis 1 an',0,1,'Les personnages sont venus assister à une réception donnée dans son <l:Demeure> à <l:LieuDemeure> par <i:Hote> pour célébrer son retour de <l:LieuLointain>, absent depuis 1 an','<i:Hote> vous a invité, vous et plusieurs de ses proches, à une réception donnée dans sa <l:Demeure> à <l:LieuDemeure> pour célébrer son retour de <l:LieuLointain>, où il était parti depuis 1 an.','Les personnages sont venus assister à une réception donnée dans son <l:Demeure> à <l:LieuDemeure> par <i:Hôte> pour célébrer son retour de <l:LieuLointain>, absent depuis 1 an'),(114,'2014-05-23 00:00:00','2014-07-23 22:45:56',12,'Rencontre embarassante - VF1',0,0,-1,'<i:Servante>, la servante de <i:Dominus> et <i:Domina>, s\'absente pendant ses heures de service pour discrètement retrouver son petit ami <i:PetitAmi>: si <i:Domina> la surprend, elle est fichue. Malheureusement pendant son escapade, elle tombe nez à nez avec son maître <i:Dominus> avec son amante <i:Maîtresse>.',0,1,'<i:Servante>, la servante de <i:Dominus> et <i:Domina>, s\'absente pendant ses heures de service pour discrètement retrouver son petit ami <i:PetitAmi>: si <i:Domina> la surprend, elle est fichue. Malheureusement pendant son escapade, elle tombe nez à nez avec son maître <i:Dominus> avec son amante <i:Maîtresse>.','',''),(115,'2014-07-30 00:49:21','2014-07-30 00:19:14',6,'Un refuge peu accommodant',1,0,0,'Après d\'être évadé et s\'être perdu dans la forêt, un <i:Groupe d\'évadés> arrivent devant <l:Petite habitation en forêt>.',1,1,'Les personnages arrivent devant <l:Petite habitation en forêt> au beau milieu de la forêt ou <i:hôte> les accueille.','Vous êtes devant <l:Petite habitation en forêt> au beau milieu de la forêt.',''),(202,'2015-03-30 10:24:41','2014-05-23 00:00:00',3,'(Evt) Annonce Anniversaire