se sont violement, des partisans des deux camps gardent une haine réciproque alors que la paix est signée. Certains vont même jusqu\'à chercher à nuire voir éliminer leurs anciens ennemis. Vous assistez aujourd\'hui à une exposition ayant pour thème les objets et reliques de cette guerre. C\'est l\'occasion de faire des découvertes, rencontrer des gens et apprendre !',NULL),(238,'2015-03-23 08:20:51','2015-03-12 23:20:28',19,'Valse',0,0,0,'L\'histoire se déroule durant une fête dans une pension. ',1,56,'C\'est la fête de <i:none:Frère> célébré dans la <l:none:Pension> et tous les personnages y sont invités sauf <i:none:Mari> qui viendra plus tard. ','Vous avez été invités à une fête qui se déroule <l:none:Pension> ','Vous avez été à une fête se déroulant <l:none:Pension>');
