INSERT INTO `role_has_pastscene` VALUES (2001,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2001,2001,'Ma fête d\'anniversaire','Cette année j\'ai décidé de fêter mon anniversaire !\nJ\'en ai parlé avec <i:aidant> car je souhaitais bénéficier de son conseil pour l\'organisation de la fête. Après une brêve discussion, je me suis aperçu que <i:aidant>  avait beaucoup d\'idées sur la question, aussi je lui confiais l\'intégralité de l\'organisation de la fête qui se tiendra à <l:lieu>, ne m\'occupant que de sélectionner les invités. De son côté <i:aidant> était très enthousiaste.'),(2002,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2002,2001,'La fête d\'anniversaire de <i:anniersé>','Cette année <i:anniversé> a décidé de fêter son anniversaire !\n<i:anniversé> est venu me parler de l\'organisation de cette fête pour avoir mon avis et mon conseil. Nous avons commencé à en discuter et je me suis montré très inspiré. Après une brêve discussion, <i:anniversé> m\'a finalement confié l\'intégralité de l\'organisation de sa fête qui se tiendra à <l:lieu>, ne s\'occupant que de sélectionner les invités. De mon côté j\'étais très enthousiaste.'),(2003,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2001,2002,'L\'invitation','Après en avoir longuement débattu avec <i:aidant>, ça y est ! Les <o:carton>  d\'invitation pour ma fête d\'anniversaire partent !  Nous sommes tous deux très excités à la perspective de cette fête !\n(Quelques jours après, le flot des réponses, presque toutes positives, arrivent : j\'en informe <i:aidant>)'),(2004,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2002,2002,'L\'invitation','Après en avoir longuement débattu avec <i:anniversé>, ça y est ! Les <o:carton> d\'invitation pour sa fête d\'anniversaire partent ! Nous sommes tous deux très excités à la perspective de cette fête !\n(Quelques jours après, le flot des réponses, presque toutes positives, arrivent : j\'en informe <i:anniversé>)\n\nJ\'ai coordonné un cadeau commun financé par tour les invités, qui se sont montrés bien généreux : nous offrirons à <i:anniversé> un bon pour un voyage pour 2 personnes à <l:lieudest>, ce qui lui fera une belle surpris !  J\'aurais le <o:bon> et nous lui offriront le jour de la fête;'),(2005,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2003,2002,'L\'invitation','J\'ai reçu un <o:carton>, une invitation pour la fête d\'anniversaire de <i:anniversé>. C\'est <i:aidant> qui s\'occupe d\'organiser la fête, et je lui renvoie ma confirmation que je participerai.\nIl va très certainement y avoir beaucoup de gens intéressant, je suis enchanté à la perspective de cette fête qui se tiendra à <l:lieu>.\n\n<i:aidant> a coordonné un cadeau commun financé par tour les invités : nous offrirons à <i:anniversé> un bon pour un voyage pour 2 personnes à <l:lieudest>, ce qui lui fera une belle surpris !  <i:aidant> lui remettra le <o:bon> lors de la fête;'),(2006,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2001,2003,'La fête est imminente !','Tout est en place, <i:aidant> a vraiment fait les choses bien, nous sommes tous deux ravis. Les invités ne vont plus tarder à arriver !\nJ\'ai prévu de faire un petit discours (à préparer) pour remercier mes invités de leur venue et particulièrement <i:aidant> de son aide.'),(2007,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2002,2003,'La fête est imminente !','Tout est en place, je suis très satisfait de mon travail, et <i:anniversé> semble ravi ! Les invités ne vont plus tarder à arriver !\nEvidemment nous n\'avons pas dérogé à la tradition , nous avons prévu un traditionnel gâteau pour son anniversaire qui arrivera, ses bougies allumées, comme clou de la soirée'),(2008,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2003,2003,'Le départ','Je ne dois pas me mettre en retard, c\'est l\'heure pour partir à la fête d\'anniversaire de <i:anniversé>. <i:aidant> est renommé pour savoir organiser des fêtes, cela va être un grand moment !'),(2009,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2004,2005,'La plus belle des promesses','<i:fiancée> et moi nous fréquentons depuis déjà pas mal de temps et nous avons parlé de passer aux choses \"sérieuses\".\nJe me souviendrai je pense toute ma vie du moment où j\'ai demandé à <i:fiancée> de se fiancer avec moi, et toute ma vue durant je me souviendrai de son \"oui\".'),(2010,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2005,2005,'La plus belle des promesses','<i:fiancé> et moi nous fréquentons depuis déjà pas mal de temps et nous avons parlé de passer aux choses \"sérieuses\".\nJe me souviendrai je pense toute ma vie du moment où il m\'a demandé de se fiancer avec moi, et toute ma vue durant je me souviendrai de mon \"oui\".'),(2011,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2004,2006,'Une fête en perspective','Nous avons décidé d\'organiser une fête pour nos fiançailles à <i:fiancée> et moi. Le choix n\'était guère facile, et nous avons pris du temps pour faire la liste. Et finalement, nous nous sentions bien fiers lorsque les <o:carton> pour la fête sont partis, et plus encore lorsque nous avons reçu les réponses réponses (presque) toutes positives. \nNous avons demandé à notre cher <i:aidant> de nous aider pour l\'organisation de la fête, mais bien vite il s\'est avéré que son talent d\'organisation était tel que nous lui avons confié intégralement l\'organisation de la fête.'),(2012,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2005,2006,'Une fête en perspective','Nous avons décidé d\'organiser une fête pour nos fiançailles à <i:fiancé> et moi. Le choix n\'était guère facile, et nous avons pris du temps pour faire la liste. Et finalement, nous nous sentions bien fiers lorsque les <o:carton> pour la fête sont partis, et plus encore lorsque nous avons reçu les réponses (presque) toutes positives.\nNous avons demandé à notre cher <i:aidant> de nous aider pour l\'organisation de la fête, mais bien vite il s\'est avéré que son talent d\'organisation était tel que nous lui avons confié intégralement l\'organisation de la fête.'),(2013,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2006,2006,'Un carton qui parle de bonheur','J\'ai reçu ce matin un <o:carton> pour la célébration des fiançailles de <i:fiancé> et <i:fiancée>. Cela fait déjà quelques temps qu\'ils se \"fréquentent\" et je suis très heureux de pouvoir partager avec eux ce moment pour célébrer leur bonheur.\nD\'après le carton, c\'est <i:aidant> qui a pris en charge l\'organisation de la fête, cela devrait être très réussi !'),(2014,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2007,2006,'Des amis qui célèbrent leur bonheur','<i:fiancée> et <i:fiancé> qui me sont si chers sont venus pour m\'annoncer une grande nouvelle : ils vont se fiancer ! Cela fait quelques temps qu\'ils se \"fréquentent\", je ne suis donc pas tant surpris que très heureux pour eux.\nIls souhaitent organiser une fête pour l\'occasion et sont venus quérir mon conseil. J\'ai pas mal d\'idées, et dépassées par ma créativité en la matière, ils me donnent carte blanche pour l\'organisation de la fête. La première urgence est de lancer les invitations, et bien vite les <o:carton> partent aux invités, tandis (presque) tous sont revenus avec une réponses positive\n'),(2015,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2006,2007,'Que de travail','En ce moment, je travaille beaucoup pour que la fête des fiançailles de <i:fiancée> et <i:fiancée> soit très réussie, je pense qu\'ils vont être ravis'),(2016,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2004,2008,'La fête est imminente !','Tout est en place, <i:aidant> a vraiment fait les choses bien et semble ravi. Les invités ne vont plus tarder à arriver ! Peu de temps après le début de la fête <i:fiancée> et moi avons d\'ailleurs préparé un petit discours (Note : à préparer par vous deux) pour remercier les invités de leur venue et particulièrement <i:aidant> pour son aide.'),(2017,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2005,2008,'La fête est imminente !','Tout est en place, <i:aidant> a vraiment fait les choses bien et semble ravi. Les invités ne vont plus tarder à arriver ! Peu de temps après le début de la fête <i:fiancé> et moi avons d\'ailleurs préparé un petit discours (Note : à préparer par vous deux) pour remercier les invités de leur venue et particulièrement <i:aidant> pour son aide.'),(2018,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2007,2008,'La fête est imminente !','Tout est en place, je suis très satisfait de mon travail, <i:fiancée> et <i:fiancé>semblent absolument ravis ! Les invités ne vont plus tarder à arriver !'),(2019,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2006,2008,'Le départ','Je ne dois pas me mettre en retard, c\'est l\'heure pour partir à la fête des fiançailles de <i:fiancée> et <i:fiancé>. <i:aidant> est renommé pour savoir organiser des fêtes, cela va être un grand moment !'),(2020,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2008,2009,'La bande','Nous nous sommes réunis <i:Terr2nd>, <i:Terr> et moi pour former une bande criminelle. Assez rapidement j\'ai pris la position du chef, tandis qu\'il devenait évident que <i:Terr2nd> était le n°2 de la bande. Il est vrai que nous nous connaissions depuis longtemps et que nous nous faisions confiance.\nL\'objectif pour notre bande était de nous enrichir en commettant quelques exactions, plus ou moins ambitieuses.'),(2021,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2009,2009,'La bande','Nous nous sommes réunis <i:Terr>, <i:TerrChef> et moi pour former une bande criminelle. Assez rapidement <i:TerrChef> a pris la position du chef, tandis qu\'il devenait évident que j\'étais le n°2 de la bande. Il est vrai que nous nous connaissions depuis longtemps et que nous nous faisions confiance.\nL\'objectif pour notre bande était de nous enrichir en commettant quelques exactions, plus ou moins ambitieuses.'),(2022,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2010,2009,'La bande','Nous nous sommes réunis <i:Terr2nd>, <i:TerrChef> et moi pour former une bande criminelle. Assez rapidement <i:TerrChef> a pris la position du chef, tandis qu\'il devenait évident que <i:Terr2nd> était le n°2 de la bande. Il est vrai que nous nous connaissions depuis longtemps et que nous nous faisions confiance.\nL\'objectif pour notre bande était de nous enrichir en commettant quelques exactions, plus ou moins ambitieuses.'),(2023,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2008,2010,'Le plan','<i:Terr2nd>, <i:Terr> et moi avons eu l\'idée de commettre un casse à <l:lieu2> Le casse paraît assez simple et paraît tout à fait atteignable par nous trois. Nous allons néanmoins devoir passer du temps pour le préparer, notamment en repérant les lieux et en observant les habitudes des gens sur place.'),(2024,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2009,2010,'Le plan','<i:Terr>, <i:TerrChef> et moi avons eu l\'idée de commettre un casse à <l:lieu2> Le casse paraît assez simple et paraît tout à fait atteignable par nous trois. Nous allons néanmoins devoir passer du temps pour le préparer, notamment en repérant les lieux et en observant les habitudes des gens sur place.'),(2025,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2010,2010,'Le plan','<i:Terr2nd>, <i:TerrChef> et moi avons eu l\'idée de commettre un casse à <l:lieu2> Le casse paraît assez simple et paraît tout à fait atteignable par nous trois. Nous allons néanmoins devoir passer du temps pour le préparer, notamment en repérant les lieux et en observant les habitudes des gens sur place.'),(2026,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2008,2011,'La préparation','<i:Terr2nd>, <i:Terr> et moi passons pas mal de temps en obervation et en repérage de <l:lieu2> : il importe que notre casse soit soigneusement préparé.'),(2027,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2009,2011,'La préparation','<i:Terr>, <i:TerrChef> et moi passons pas mal de temps en obervation et en repérage de <l:lieu2> : il importe que notre casse soit soigneusement préparé.'),(2028,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2010,2011,'La préparation','<i:Terr2nd>, <i:TerrChef> et moi passons pas mal de temps en obervation et en repérage de <l:lieu2> : il importe que notre casse soit soigneusement préparé.'),(2029,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2008,2012,'Un scénario qui tourne mal','Ca y est ! c\'est le grand jour ! \n<i:Terr2nd>, <i:Terr> et moi entamons le casse à <i:lieu2>. Au début tout se passe parfaitement comme prévu. Néanmoins l\'intervention inopinée et surtout très rapide de forces de l\'ordre, je ne sais prévenu par qui ou quoi,  a mis tôt fin à nos espoirs de succès.\nChacun a du prendre un peu de l\'énorme butin, sous forme de <o:butin>, que nous pouvions prendre sur nous et nous enfuit, non sans difficulté, et le plus discrètement possible par la porte arrière.\nA 1 minute près c\'était fichu car déjà les forces de l\'ordre encerclaient les lieux ! \nIls sont de plus en plus nombreux et commencent à encercler les alentours. Nous ne pouvons reprendre notre <o:véhicule> que nous avions prévu pour la fuite, nous courons à pied et nous entendons non loin derrière les forces de l\'ordre à nos trousses.\nFinalement nous tombons sur <l:lieu> il y a du monde dedans : tant pis ! Je prends une initiative irrémédiable : la prise d\'otage !\nRapidement nous maîtrisons les occupants des lieux, les forces de l\'ordre battent en retraite : c\'est le status quo. Il va falloir négocier notre sortie sauve contre les otages.'),(2030,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2009,2012,'Un scénario qui tourne mal','Ca y est ! c\'est le grand jour ! \n<i:Terr>, <i:TerrChef> et moi entamons le casse à <i:lieu2>. Au début tout se passe parfaitement comme prévu. Néanmoins l\'intervention inopinée et surtout très rapide de forces de l\'ordre, je ne sais prévenu par qui ou quoi,  a mis tôt fin à nos espoirs de succès.\nChacun a du prendre un peu de l\'énorme butin, sous forme de <o:butin>, que nous pouvions prendre sur nous et nous enfuit, non sans difficulté, et le plus discrètement possible par la porte arrière.\nA 1 minute près c\'était fichu car déjà les forces de l\'ordre encerclaient les lieux ! \nIls sont de plus en plus nombreux et commencent à encercler les alentours. Nous ne pouvons reprendre notre <o:véhicule> que nous avions prévu pour la fuite, nous courons à pied et nous entendons non loin derrière les forces de l\'ordre à nos trousses.\nFinalement nous tombons sur <l:lieu> il y a du monde dedans : tant pis ! <i:TerrChef> prend une initiative irrémédiable : la prise d\'otage.\nRapidement nous maîtrisons les occupants des lieux, les forces de l\'ordre battent en retraite : c\'est le status quo. Il va falloir négocier notre sortie sauve contre les otages.'),(2031,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2010,2012,'Un scénario qui tourne mal','Ca y est ! c\'est le grand jour ! \n<i:Terr2nd>, <i:TerrChef> et moi entamons le casse à <i:lieu2>. Au début tout se passe parfaitement comme prévu. Néanmoins l\'intervention inopinée et surtout très rapide de forces de l\'ordre, je ne sais prévenu par qui ou quoi,  a mis tôt fin à nos espoirs de succès.\nChacun a du prendre un peu de l\'énorme butin, sous forme de <o:butin>, que nous pouvions prendre sur nous et nous enfuit, non sans difficulté, et le plus discrètement possible par la porte arrière.\nA 1 minute près c\'était fichu car déjà les forces de l\'ordre encerclaient les lieux ! \nIls sont de plus en plus nombreux et commencent à encercler les alentours. Nous ne pouvons reprendre notre <o:véhicule> que nous avions prévu pour la fuite, nous courons à pied et nous entendons non loin derrière les forces de l\'ordre à nos trousses.\nFinalement nous tombons sur <l:lieu> il y a du monde dedans : tant pis ! <i:TerrChef> prend une initiative irrémédiable : la prise d\'otage.\nRapidement nous maîtrisons les occupants des lieux, les forces de l\'ordre battent en retraite : c\'est le status quo. Il va falloir négocier notre sortie sauve contre les otages. '),(2032,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2011,2012,'Au mauvais endroit, au mauvais moment','Aujourd\'hui j\'ai prévu d\'aller à <l:lieu>. Je m\'y rends sans me presser et je remarque en chemin le nombre impressionnant de <o:véhicule> de forces de l\'ordre qui semblent converger dans le quartier : au moins je ne crains rien ! \nJe rentre dans <l:lieu> et peu de temps après j\'entends du bruit et de l\'agitation.\nPuis soudain, 3 individus font irruption : ils sont armés ! \nIls nous indiquent qu\'il s\'agie d\'une prise d\'otage ! ils semblent particulièrement nerveux et agités, et rapidement ils parviennent à maîtriser les personnes présentes dans les lieux.\nMe voilà pris au piège avec ces gens.... \nJ\'entends que les forces de l\'ordre sont autour des lieux mais pour nous protéger n\'interviennent pas : c\'est le status quo. Ciel dans quelle situation me voilà !'),(2033,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2019,2012,'L\'annonce','Quelques instants après, on entend la voix d\'un individu, <i:Negociateur>, qui se présente comme négociateur pour les forces de l\'ordre et nous demande de ne faire aucun mal aux otages.'),(2034,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2012,2013,'Une mission ambitieuse','J\'ai été contacté pour participer à une mission scientifique ambitieuse et risquée, en <l:contrée>. L\'idée m\'enchantait beaucoup, j\'avais envie de faire quelque chose d\'extraordinaire dans ma vie ! \nJ\'ai d\'abord eu un rendez-vous, nous étions nombreux à avoir été pré-selectionnés, mais finalement j\'ai été retenu. \nAinsi au second rendez-vous je découvrais l\'équipe constituée visiblement d\'individus tous brillants dans leur domaine ou leurs compétences.\n\nPeu de temps après nous avons au moins le résultat des selections  : \n-je serai le chef de cette expédition scientifique\n- <i:SciDoc> sera le médecin de la base, c\'est aussi un scientifique\n- <i:intendant> sera le l\'intendant en charge du confort de chacun\n- <i:RespBase> sera le Scientifique en charge spécifiquement du bon fonctionnement des systèmes de la base et de la sécurité du site\n- il y aura d\'autres scientifiques, mais je n\'ai pas retenu leur nom.'),(2035,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2013,2013,'Une mission ambitieuse','J\'ai été contacté pour participer à une mission scientifique ambitieuse et risquée, en <l:contrée>. L\'idée m\'enchantait beaucoup, j\'avais envie de faire quelque chose d\'extraordinaire dans ma vie ! \nJ\'ai d\'abord eu un rendez-vous, nous étions nombreux à avoir été pré-selectionnés, mais finalement j\'ai été retenu. \nAinsi au second rendez-vous je découvrais l\'équipe constituée visiblement d\'individus tous brillants dans leur domaine ou leurs compétences.\n\nPeu de temps après nous avons au moins le résultat des selections  : \n- <i:Chef> sera le chef de cette expédition scientifique\n- moi en tant que médecin de la base, c\'est aussi un scientifique\n- <i:intendant> sera le l\'intendant en charge du confort de chacun\n- <i:RespBase> sera le Scientifique en charge spécifiquement du bon fonctionnement des systèmes de la base et de la sécurité du site\n- il y aura d\'autres scientifiques, mais je n\'ai pas retenu leur nom.'),(2036,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2014,2013,'Une mission ambitieuse','J\'ai été contacté pour participer à une mission scientifique ambitieuse et risquée, en <l:contrée>. L\'idée m\'enchantait beaucoup, j\'avais envie de faire quelque chose d\'extraordinaire dans ma vie ! \nJ\'ai d\'abord eu un rendez-vous, nous étions nombreux à avoir été pré-selectionnés, mais finalement j\'ai été retenu. \nAinsi au second rendez-vous je découvrais l\'équipe constituée visiblement d\'individus tous brillants dans leur domaine ou leurs compétences.\n\nPeu de temps après nous avons au moins le résultat des selections  : \n- <i:Chef> sera le chef de cette expédition scientifique\n- <i:SciDoc> sera le médecin de la base, c\'est aussi un scientifique\n- moi en tant qu\'intendant en charge du confort de chacun\n- <i:RespBase>