> sera le l\'intendant en charge du confort de chacun\n- <i:RespBase> sera le Scientifique en charge spécifiquement du bon fonctionnement des systèmes de la base et de la sécurité du site\n- il y aura d\'autres scientifiques, mais je n\'ai pas retenu leur nom.'),(2039,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2021,2014,'Une préparation intensive','Nous travaillons énormément pour nous préparer à l\'expédition : cartes, matériels, équipements, nourriture, instruments scientifiques… rien ne devait être laissé au hasard. \nL\'ambiance entre nous est bonne, souvent même conviviale, même si nous parlons peu de nos vies privées. Certains semblent d\'ailleurs se connaître. Mais tout notre esprit est fixé à ce se concerntre sur l\'objectif de l\'expédition, aux expériences scientifiques à mener sur place, à parer à des conditions d\'environnement qui pourraient s\'avérer bien plus hostiles ou rudes que nous l\'imaginons.\n\nPuis c\'est le grand jour, nous partons ! Chacun laisse les siens, la mission est censée durer 1an. Je sens que chacun de nous est excité tout en espérant que cela passera vite.'),(2040,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2021,2015,'Jour 0','Nous voici enfin arriver, après un long voyage en <o:véhicule> qui nous a ammené sur place. Les personnels à bord du vaisseau nous regardent bizarrement ils ne comprennent pas comment on peut s\'embarquer pour pareille aventure… Nous déchargeons tout et commençons à construire <l:lieu>.\n\nCe n\'est pas du tout comme nous l\'avions imaginé : l\'endroit au coeur de <l:contrée> semble plus isolé, plus rude, pas vraiment hostile mais l\'homme n\'y a pas en soi sa place. Une beauté étrange se dégage des lieux.\n\nC\'est notre jour 0. Le soir nous fêtons cela autour de quelques verres. L\'ambiance est émue, chacun veut se souvenir longtemps de ce moment.'),(2041,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2012,2016,'Un premier anniversaire','Un mois que nous sommes là ! \nJ\'assure une bonne coordination des différents rôles de chacun au sein de <l:lieu>, et chaque jour nous démontre que vivre au coeur de <l:contrée> demande du sérieux.\nJe mène de mon côté un suivi attentif de chacun pour s\'assurer qu\'en ce lieu isolé, nul d\'entre nous ne contracte une maladie ou une pathologie liée aux conditions particulières de notre existence ici.\n<i:Intendant> se débrouille bien, même si cela a été un coup dur quand nous avons découvert que des vivres avaient mal voyagé, du fait d\'une manutention un peu brutale du personnel du <l:véhicule> lors du chargement et du déchargement. Néanmoins les calculs de vivres étaient larges, l\'impact est mineur.\n<i:RespBase> mène un combat chaque jour pour assurer l\'étanchéité et la sécurité des lieux : ce <l:lieu> où nous vivons reste un site temporaire, et finalement assez fragile face à toutes les menaces et problèmes auxquels nous sommes ici exposés.\nLes expériences scientifiques ont pu commencer : nous sommes tous de formation scientifiques, mais pas trop vu le nombre et le travail que représente toutes les expériences à mener.\n\nDemain cela fera un mois que nous sommes là : <i:intendant> nous a annoncé qu\'il avait tout préparé afin que nous puission fêter la chose dignement, et je ferai un petit discours (Note : à préparer!).'),(2042,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2013,2016,'Un premier anniversaire','Un mois que nous sommes là ! \n<i:chef> assure une bonne coordination des différents rôles de chacun au sein de <l:lieu>, et chaque jour nous démontre que vivre au coeur de <l:contrée> demande du sérieux.\n<i:Scidoc> mène un suivi attentif de chacun pour s\'assurer qu\'en ce lieu isolé, nul d\'entre nous ne contracte une maladie ou une pathologie liée aux conditions particulières de notre existence ici.\n<i:Intendant> se débrouille bien, même si cela a été un coup dur quand nous avons découvert que des vivres avaient mal voyagé, du fait d\'une manutention un peu brutale du personnel du <l:véhicule> lors du chargement