iscussion, <i:hôte> m\'a finalement confié l\'intégralité de l\'organisation de sa fête qui se tiendra à <l:lieu>, ne s\'occupant que de sélectionner les invités. De mon côté j\'étais très enthousiaste.'),(2048,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2024,2018,'L\'invitation','Après en avoir longuement débattu avec <i:aidant>, ça y est ! Les <o:carton>  d\'invitation pour ma  <r:TypeReception> partent !  Nous sommes tous deux très excités à la perspective de cette réception !\n(Quelques jours après, le flot des réponses, presque toutes positives, arrivent : j\'en informe <i:aidant>)'),(2049,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2025,2018,'L\'invitation','Après en avoir longuement débattu avec <i:hôte>, ça y est ! Les <o:carton> d\'invitation pour sa  <r:TypeReception> partent ! Nous sommes tous deux très excités à la perspective de cette  réception !\n(Quelques jours après, le flot des réponses, presque toutes positives, arrivent : j\'en informe <i:hôte>)'),(2050,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2026,2018,'L\'invitation','J\'ai reçu un <o:carton>, une invitation pour la  <r:TypeReception> de <i:h[ote>. C\'est <i:aidant> qui s\'occupe d\'organiser la fête, et je lui renvoie ma confirmation que je participerai.\nIl va très certainement y avoir beaucoup de gens intéressant, je suis enchanté à la perspective de cette r2ception qui se tiendra à <l:lieu>.'),(2051,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2024,2019,'La fête est imminente !','Tout est en place, <i:aidant> a vraiment fait les choses bien, nous sommes tous deux ravis. Les invités ne vont plus tarder à arriver !\nJ\'ai prévu de faire un petit discours (à préparer) pour remercier mes invités de leur venue et particulièrement <i:aidant> de son aide.'),(2052,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2025,2019,'La fête est imminente !','Tout est en place, je suis très satisfait de mon travail, et <i:hôte> semble ravi ! Les invités ne vont plus tarder à arriver ! Je sais que <i:hôte> a prévu de faire un petit discours pour remercier les invités de leur venue.'),(2053,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,2026,2019,'Le départ','Je ne dois pas me mettre en retard, c\'est l\'heure pour partir à la <r:TypeReception> de <i:hôte>. <i:aidant> est renommé pour savoir organiser des fêtes, cela va être un grand moment !'),(10713,'2013-01-11 00:00:00','2013-01-11 00:00:00',1,1075,1071,'L\'amitié','A cette époque j\'avais déjà pas mal avancé sur la voie Jedi. J\'avais de nombreux amis, dont <i:RA> qui avait épousé <i:DV> un homme bon, avec lequel elle formait sur <l:lieu1> le couple parfait.'),(10723,'2013-01-11 00:00:00','2013-01-11 00:00:00',1,1075,1072,'Séparation','Ce jour là <i:RA> me contacte en pleine panique. Elle venait d\'accoucher de deux enfants jumeaux. J\'étais heureux pour elle mais <i:DV> avait basculé du côté obscur de la force et était devenu méchant et dangeeux. Elle avait peur pour ses deux enfants.\r\n\r\nElle me demande d\'emmener au loin son garçon <i:LS> pour le protéger. Elle me demande de ne pas me dire où, dans l\'intérêt de la sécurité de l\'enfant (si <i:DV> retrouvait <i:RA>, il ne valait mieux pas qu\'elle sache ou puisse avouer où se trouvait <i:LS>).\r\nJ\'accepte d\'emmener très loin <i:LS>.\r\n\r\nDe son côté, elle m\'annonce qu\'elle va fuir avec sa fille <i:LS> ailleurs, sans me dire où non plus, dans l\'intérêt de la sécurité de cette petite.\r\nJ\'abandonne <i:RA> en larmes, séparée de son fils….'),(10732,'2011-01-11 00:00:00','2011-01-11 00:00:00',1,1075,1073,'Poursuite','Inlassablement, <i:DV> me traque partout, tout comme il traque certainement <i:RA>  ! \r\nSa quête est sur le point d\'aboutir alors je lui tend un piège : je l\'attire dans un endroit dangereux de <l:lieu1> en lui faisant passer une information par un informateur, et <i:DV> vient à moi.\r\n\r\nIl arrive donc dans cette caverne au pied d\'un volcan bouillonant de lave, mon piège se referme sur lui et nous nous battons de façon épique : il perd le combat, englouti par des coulée de lave en train de refroidir….\r\nJ\'abandonne <i:DV> là, agonisant  atrocement jusqu\'à la mort. C\'est tout ce que mérite les partisans de la Force Obscure !\r\n\r\nRentré chez moi, je continue à élever <i:LS> avant de le confier à une famille de simples paysans, vivant humblement mais honnêtement sur <l:lieu2>\r\n\r\nJe sens déjà la Force en <i:LS>. Puis je m\'enfuis car d\'autres missions m\'appellent, et ma présence peut mettre <iLS> en danger. Il ne sait rien de sa vraie famille et la rupture avec cette dernière est sans doute son plus grand atout sécurité. Il ne lui reste finalement que cet étrange <o:médaillon1> que lui a laissé sa mère.'),(10733,'2011-01-11 00:00:00','2011-01-11 00:00:00',1,1074,1073,'Mon enfance','Petit, j\'ai été confié à une famille de simples paysans vivant humblement mais honnêtement à <l:lieu2>. Ils ont au début essayé de me faire croire qu\'ils étaient mes parents biologiques, mais ont finalement avoué par me dire que mon père m\'avait confié à eux quand j\'étais petit, un certain <i:OB>.\r\n\r\nJe ne le vois que rarement, et mon principal lien avec lui est ce <o:Médaille1>, sans doute un cadeau de naissance que je portais déjà quand j\'ai été confié à ma famille adoptive.'),(10742,'2012-01-11 00:00:00','2012-01-11 00:00:00',1,1073,1074,'Mon enfance','Ma mère m\'a élevée seule, sur une lointaine colonie, <l:lieu3>, j\'y ai passé une enfance heureuse dans une certaine aisance, ma mère et quelques domestiques se chargeant de mon éducation.\r\nElle m\'a avouée qu\'elle s\'était enfuie avec moi sur cette colonie pour fuir un vieux danger l\'ayant contrainte à une vie clandestine et exilée.\r\n\r\nEn grandissant, je lui ai demandé qui était son père mais elle me dit qu\'il était mort au combat dans une ancienne guerre. \r\nElle ne parle que peu de ces \"temps anciens\" et mon principal lien avec ce passé est ce <o:médaillon1>, sans doute un cadeau de naissance que je porte depuis que je suis née. Une tradition familiale m\'a dit ma mère. Mais quelle famille ?'),(10751,'2001-01-01 00:00:00','2011-01-01 00:00:00',1,1073,1075,'Merveilleuse Rencontre','Ma mère est est très malade et je dois aller sur <l:lieu2> pour lui trouver une plante rare, qui ne pousse qu\'à <l:lieu2>.\r\n\r\nJe m\'y rends. Arrivée sur place, on m\'explique qu\'il faut aller dans la campagne, que certaines fermes cultivent cette plante rare. Je fais un bout de chemin, j\'arrive à une ferme et je tombe nez à nez sur un garçon d\'à peu près mon âge, au regard doux et gentil, qui me trouble immédiatement. Mon cœur s\'emballe !\r\nJe lui demande la plante rare, il accepte : mais à peine il s\'absente quelques instants pour me l\'emballer que déjà il me manque.\r\n\r\nJe rentre sur <l:lieu3> et son visage m\'obsède : je crois que c\'est le coup de foudre'),(10752,'2001-01-01 00:00:00','2011-01-01 00:00:00',1,1074,1075,'Merveilleuse Rencontre','Ce jour là, une noble jeune femme d\'à peu près mon âge s\'est présentée à la porte de la ferme. Elle me dit qu\'elle cherchait une plante rare, dont on m\'a dit effectivement qu\'il était difficile d\'en trouver ailleurs que sur <l:lieu2>. Elle m\'en demande pour sa mère malade.\r\n\r\nMais je ne l’écoute guère. Les traits de son visage sont si fins que j’en suis presque ému, elle me trouble. Elle est noble et je ne suis que paysan, mais mon cœur s\'emballe.\r\nJ’accepte de lui donner de cette plante rare pour sa mère malade et à peine je m\'absente quelques instants pour en chercher et me l\'emballer que déjà elle me manque.\r\n\r\nElle m’annonce repartir sur <l:lieu3> où elle vit, et tandis que je contemple sa silhouette disparaître de ma vue, que déjà son visage m\'obsède : je crois que c\'est le coup de foudre !'),(11011,'2013-12-10 00:00:00','2013-12-10 00:00:00',3,1101,1101,'Récupération d\'une partie de la carte','Note au PHJ <i:Gaspard> qui est devenu <i:Kebab>\r\nJ\'ai récupéré les affaires de <i:Kebab> en me débarassant du corps  après l\'avoir tué. \r\nA ma grande surprise, en y regardant de plus prêt, j\'ai trouvé  <o:MorceauCarte3> : le bougre cachait un trésor : récupérer ce trésor est désormais mon but mais je n\'ai qu\'un morceau sur une carte qui doit être composée de 2, 3, 4 ou 5 morceaux…'),(11012,'2014-05-23 00:00:00','2013-12-10 00:00:00',4,1107,1101,'Récupération d\'une partie de la carte','J\'ai fini par récupérer les affaires de <i:Kebab> en me débarassant du coprs  après l\'avoir tué. \r\nA ma grande surprise, en y regardant de plus prêt, j\'ai trouvé  <o:MorceauCarte3> : le bougre cachait un trésor : récupérer ce trésor est désormais mon but mais je n\'ai qu\'un morceau sur une carte qui doit être composée de 2, 3, 4 ou 5 morceaux…'),(11021,'2013-12-15 00:00:00','2013-12-15 00:00:00',2,1104,1102,'Récupération d\'une partie de la carte','Le <o:MorceauCarte2> de <i:Barberaze> a disparu ! C\'est arrivé je pense il y a quelques jours, je suis à peu près sûr que c\'est <i:Kebab> qui me l\'a volé, je l\'ai senti tournant autour de moi ces derniers temps ! Je dois absolument la récupérer et trouver le trésor !'),(11022,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,1107,1102,'Un petit vol pour une grande joie !','Il y a quelques jours j\'ai revu <i:BloodyMary>. J\'ai entraperçu dans un de ses sacs un vieux document qui paraissait fort ancien et qui semblait indiquer une carte. Cette question m\'obsédait, et j\'ai finalement réussi à le subtiliser sans que <i:BloodyMary> ne me découvrir ni ne s\'aperçoive de mon délicatesse. Car lorsque je l\'ai revu après, <i:BloodyMary> ne paraissait nullement inquiété de quoi que ce soit…\r\nPar contre quand j\'ai observé le document, j\'ai bien vu qu\'il s\'agissait d\'une sorte de carte, qui visiblement a été séparée en plusieurs morceaux. Très probablement une carte au trésor !!! Je dois mettre la main sur les autres bouts.'),(11031,'2014-05-23 00:00:00','2013-12-15 00:00:00',2,1102,1103,'Le trésor','J\'ai connu il y a quelques années <i:Barberaze> un dangereux criminel mais avec qui, quel hasard de la vie, nous étions devenu amis. La légende prétend qu\'au fil de ses méfaits, il avait accumulé un véritable trésor qu\'il cachait dans un lieu secret.\r\nEt puis un jour il m\'a écrit qu\'il était atteint d\'une incurable maladie. Lorsque je suis arrivé à son chevet, c\'était pour le découvrir mourrant mourrant, dans ses derniers instants. Il m\'expliqua alors que <i:Barberaze> n\'avait pas été son vrai nom, mais le nom qu\'il avait pris à son ami qui était mort dans ses bras. A présent, il me demandait de reprendre le nom mythique de <i:Barberaze> et de ses fabuleux trésors. J\'ai accepté sans hésiter, me voilà à présent <i:Barberaze>.\r\nSauf que depuis j\'ai réalisé que la légende. Les fabuleux trésors de <i:Barberaze> ne sont plus s\'ils n\'ont jamais existé. Mais qu\'importe, j\'avoue que cela m\'amuse : Tout le monde pense que <i:Barberaze> cache ses fabuleux trésors quelque part\r\n\r\nPour renforcer la légende, j\'ai eu l\'idée de créer une carte que je l\'ai découpée en 3 morceaux que j\'ai donnés à des amis, qui -peut-être qui sait ?- deviendront à leur tour <i:Barberaze> à leur tour.\r\nJ\'ai gardé un <o:MorceauCarte1>  évidemment pour que personne ne puisse la recréer. En tant que <i:Barberaze>, j\'ai envoyé un courrier contenant un <o:MorceauCarte2> à <i:BloodyMary> et  un autre courrier contenant <o:MorceauCarte3> à <i:Kebab> (un criminel). Je leur dit dans ce courrier que ma vie est en danger, et que j\'ai disseminé la carte pour accéder à mon trésor le jour où il m\'arriverait quelque chose.'),(11032,'2014-05-23 00:00:00','2013-12-15 00:00:00',2,1104,1103,'Mon bout du trésor !','Je connais depuis longtemps <i:Barberaze>, qui est en fait un criminel, et qu\'on dit  fait fort riche. En effet, la légende prétend qu\'au fil de ses méfaits, il a accumulé un véritable trésor qu\'il cachait dans un lieu secret.\r\nUn jour il m\'a écrit un courrier donné un <o:MorceauCarte2>. Il me dit dans le courrier que sa vie est en danger, et qu\'il a disseminé des morceaux de carte pour accéder à son trésor le jour où il lui arriverait quelque chose. \r\nJe garde le document très précieusement.'),(11033,'2014-05-23 00:00:00','2014-05-23 00:00:00',1,1107,1103,'Mon bout du trésor !','Je connais depuis longtemps <i:Barberaze>, qui est en fait un criminel, et qu\'on dit  fait fort riche. En effet, la légende prétend qu\'au fil de ses méfaits, il a accumulé un véritable trésor qu\'il cachait dans un lieu secret.\r\nUn jour il m\'a écrit un courrier donné un <o:MorceauCarte3>. Il me dit dans le courrier que sa vie est en danger, et qu\'il a disseminé des morceaux de carte pour accéder à son trésor le jour où il lui arriverait quelque chose. \r\nJe garde le document très précieusement.'),(11041,'2014-05-23 00:00:00','2013-12-12 00:00:00',3,1106,1104,'Le trésor','J\'ai entendu parlé d\'une rumeur d\'un formidable trésor caché par <i:Barberaze>, un dangereux criminel qui sévit paraît il depuis tant d\'années qu\'il doit être au moins centenaire. Or on raconte que <i:Barberaze> est mort…. Si seulement j\'avais une piste, je saurais au moins par où commender pour mettre la main sur ce fabuleux trésor !'),(11042,'2014-05-23 00:00:00','2013-12-12 00:00:00',3,1105,1104,'Le trésor','J\'ai entendu parlé d\'une rumeur d\'un formidable trésor caché par <i:Barberaze>, un dangereux criminel qui sévit paraît il depuis tant d\'années qu\'il doit être au moins centenaire. Or on raconte que <i:Barberaze> est mort…. Si seulement j\'avais une piste, je saurais au moins par où commender pour mettre la main sur ce fabuleux trésor !'),(11051,'2013-12-15 00:00:00','2013-12-15 00:00:00',1,1101,1105,'<i:Gaspard> devient <i:Kebab>','Côté PNJ : <i:Gaspard a parlé avec <i:Kebab> pour qu\'il partage son tréso. Malheureusement, <i:Gaspard> a un peu trop bu et la discution a tourné à la dispute. \r\nDans la fureur du moment, <i:Gaspard>  a perdu le contrôle et quand il récupère mes esprits… <i:Kebab>  est mort à mes pieds. <i:Gaspard>  décide alors de prendre l\'identité de de <i:Kebab>.\r\nPour cela il porte un masque et de se fait passer pour lui pour que personne ne se rende compte qu\'il est mort et pour récupérer le trésor. J\'espère que j\'arriverais à jouer le rôle sans être démasqué !\r\n\r\n<i:Gaspard> n\'est plus ! Vive <i:Kebab>'),(11052,'2013-12-16 00:00:00','2013-12-16 00:00:00',2,1107,1105,'<i:Gaspard> devient <i:Kebab>','Cela faisait longtemps que je connaissais <i:Kebab> qui portait un masque en permanence peut être pour cacher d\'horribles cicatrices. Et puis tout le monde avait entendu parlé de son trésor… \r\nA cette époque, je m\'appelais encore <i:Gaspard>.\r\n\r\nEt puis un jour, j\'ai parlé avec <i:Kebab> pour lui tirer les verres du nez afin qu\'il partage son trésor avec moi. Malheureusement, on avait l\'un et l\'autre un peu trop bu et la discussion a tourné à la dispute, on en est venus aux mains. \r\nDans la fureur du moment, j\'ai perdu le contrôle et quand j\'ai récupéré mes esprits… <i:Kebab> gisait mort à mes pieds. J\'ai alors pensé que ce brigand avait sans doute donnait del\'information sur l\'emplacement de son trésor à quelqu\'un et me suis dit que ce serait plus aisé si je prenais son identité, donc son masque. C\'est ce que j\'ai fait, et depuis je me fait passer pour <i:Kebab>.\r\n<i:Gaspard> n\'est plus ! Vive <i:Kebab>\r\n\r\nJ\'espère que j\'arriverai à jouer le rôle sans être démasqué !'),(11061,'2013-12-15 00:00:00','2013-12-15 00:00:00',2,1102,1106,'Un étrange comportement','Je connais bien <i:Kebab> même s\'il ne sait pas que je le connais puisque je  l\'ai connu en tant que <I:Barberaze>. J\'ai remarqué qu\'il agissait étrangement depuis quelques jours… Serait-ce à cause du trésor qui le rend si nerveux ? Il semble avoir changé physiquement (plus petit)…'),(11062,'2013-12-15 00:00:00','2013-12-15 00:00:00',1,1104,1106,'Un étrange comportement','Je connais bien <i:Kebab> et j\'ai remarqué qu\'il agissait étrangement depuis quelques jours… Serait-ce à cause du trésor ? Je devrais aller lui en parler… Et récupérer mon morceau de la carte !'),(11311,'2014-05-02 00:00:00','2014-05-02 00:00:00',1,1130,1131,'Départ d\'<i:Hote> pour <l:LieuLointain>','Il y a un an, je suis parti à <l:lieulointain> qui était alors en proie à de forts troubles et rapidement tombé guerre. J\'ai prévenu tous mes amis de mon départ sans leur préciser mon lieu de destination.'),(11311,'2014-05-02 00:00:00','2014-05-02 00:00:00',1,1131,1131,'Départ d\'<i:Hote> pour <l:LieuLointain>','Il y a un an, <i:Hote> a fait savoir à ses proches qu\'il s\'absentait et partait loin, sans donner guère d\'explication. Nous étions tous pour le moins surpris !'),(11321,'2014-05-02 00:00:00','2014-05-02 00:00:00',1,1130,1132,'Retour d\'<i:Hôte> pour <l:LieuLointain>','Je suis rentré de <l:LieuLointain>, où ma mission s\'est bien déroulée ce qui m\'a pas mal enrichi. J\'ai pris une belle <l:Demeure> à <l:LieuDemeure> et j\'ai contacté tous mes proches afin de célébrer mon retour. Je leur ai envoyé un message leur annonçant \"Je suis de retour de <l:lieulointain> et j\'organise une grande fête où j\'espère que vous pourrez assister\"\r\n\r\nIl faudra d\'ailleurs que je prépare quelques lignes d\'un court discours, et me préparer à répondre à de nombreuses questions !'),(11322,'2014-05-02 00:00:00','2014-05-02 00:00:00',1,1131,1132,'Retour d\'<i:Hôte> pour <l:LieuLointain>','J\'ai  reçu un message de <i:Hote>, quelle chance ! \r\nLe message disait que <i:Hote> rentrait de <l:LieuLointain>, visiblement sa mystérieuse destination, et il s\'est installé dans une belle <l:Demeure> à <l:LieuDemeure> où il organise prochainement une réception pour célébrer son retour : j\'ai hâte de retrouver <i:hote> là-bas !'),(101011,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1015,10101,'Le mariage de ma fille','J\'ai arrangé le mariage de ma fille <i:SI> en lui trouvant un prétendant <i:DO>. <i:DO> est un gentilhomme fort bien éduqué et sa situation sociale me serait fort profitable si celui-ci se mariait à ma fille <i:SI>. J\'ai trouvé opportun d\'organiser une rencontre ma fille <i:SI> et <i:DO>.'),(101011,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1016,10101,'Le mariage de ma sœur','Mon père <i:PR> a arrangé le mariage de ma sœur <i:SI> en lui trouvant un prétendant <i:DO> et a trouvé opportun d\'organiser une rencontre entre <i:SI> et <i:DO>.'),(101012,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1011,10101,'Mon mariage','Mon père <i:PR> a arrangé mon mariage en me trouvant un prétendant <i:DO>. Il a trouvé opportun d\'organiser une rencontre.  Je ne connais pas <i:DO> et j\'apréhende difficilement notre première rencontre.'),(101013,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1012,10101,'Mon mariage','<i:PR> a arrangé le mariage de sa fille <i:SI> avec moi. Il a trouvé opportun d\'organiser une rencontre. Je ne connais pas <i:Si> et j\'apréhende difficilement notre première rencontre.'),(101021,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1012,10102,'Changement de costume !','Je décide d\'échanger mon rôle de jeune prétendant avec celui de mon domestique <i:Li> pour étudier ma promise <i:SI> sous un angle différent. Je lui ai demandé de la tester, j\'espère qu\'il n\'ira pas trop loin. Pendant ce temps, je prendrait donc le rôle de <i:AR> dont je serai le domestique.'),(101022,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1014,10102,'Changement de costume !','<i:DO> veut changer de rôle avec moi pour étudier sa future épouse <i:SI> à laquelle il va se marier prochainement mais qu\'il n\'a jamais vue. Je trouve ce jeu intéressant je vais tenter de profiter de cette situation pour qu\'il se rende compte de mon quotidien car <i:DO> sera maintenant mon domestique. Il m\'a donné l\'ordre d\'insister la séduction de <i:SI>.'),(101023,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1011,10102,'Changement de costume !','Je décide d\'échanger mon rôle de jeune promise avec celui de mon domestique <i:Li> pour étudier mon promis <i:Do> sous un angle différent. Je lui ai demandée de le tester, j\'espère qu\'elle n\'ira pas trop loin. Pendant ce temps, je prendrait donc le rôle de <i:Li> dont je serai la domestique.'),(101024,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1013,10102,'Changement de costume !','<i:Si> veut changer de rôle avec moi pour étudier son futur époux <i:Do> auquel elle doit prochainement se marier (du fait de l\'arrangement de son père <i:PR>) mais qu\'elle n\'a jamais vu. Je trouve ce jeu intéressant je vais tenter de profiter de cette situation pour qu\'elle se rende compte de mon quotidien car <i:Si> sera maintenant ma domestique.'),(101031,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1015,10103,'La pré-rencontre','Avec <i:Ma> nous les avons espionnés, et on a tout découvert ! C\'est intéressant, <i:DO> et <i:AR> ont inversé leurs rôles, tout comme <i:SI> et <i:LI> aussi.\r\nJe vais profiter de la situation pour m\'amuser avec <i:MA> en essayant de faire tenir le jeu le plus longtemps possible'),(101031,'2013-01-01 00:00:00','2013-01-01 00:00:00',1,1016,10103,'La pré-rencontre','Avec <i:Pr> nous les avons espionnés, et on a tout découvert ! C\'est intéressant, <i:DO> et <i:AR> ont inversé leurs rôles, tout comme <i:SI> et <i:LI> aussi.\r\nJe vais profiter de la situation pour m\'amuser avec <i:Pr> en essayant de faire tenir le jeu le plus longtemps possible'),(102011,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1023,10201,'La Mort de <i:Défunt>','J\'ai appris par courrier <i:Défunt>, un de mes parents éloignés mais très riche. C\'est son avocat, <i:Avocat> qui m\'a envoyé un mot pour me convoquer aux légations testamentaires.'),(102011,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1028,10201,'La Mort de <i:Défunt>','J\'avais depuis longtemps pour client <i:Défunt>, et celui-ci m\'avait confié la rédaction et l\'execution de son tesament le jour où il décèderait.\r\nMalheureusement ce fut le cas ce funeste jour, j\'appris sa mort par son médecin personnel.\r\nExecutant ses dernières volontés, je convoquais donc <i:JH>, <i:JF>, <i:Hôte>, <i:Ch>, <i:Li> et <i:Le>.'),(102012,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1022,10201,'La Mort de <i:Défunt>','J\'ai appris par courrier <i:Défunt>, un de mes parents éloignés mais très riche. C\'est son avocat, <i:Avocat> qui m\'a envoyé un mot pour me convoquer aux légations testamentaires.'),(102013,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1024,10201,'La Mort de <i:Défunt>','J\'ai appris par courrier <i:Défunt>, un de mes parents éloignés mais très riche. C\'est son avocat, <i:Avocat> qui m\'a envoyé un mot pour me convoquer aux légations testamentaires.'),(102014,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1021,10201,'La Mort de <i:Défunt>','J\'ai appris par courrier <i:Défunt>, un de mes parents éloignés mais très riche. C\'est son avocat, <i:Avocat> qui m\'a envoyé un mot pour me convoquer aux légations testamentaires.'),(102015,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1025,10201,'La Mort de <i:Défunt>','J\'ai appris par courrier <i:Défunt>, un de mes parents éloignés mais très riche. C\'est son avocat, <i:Avocat> qui m\'a envoyé un mot pour me convoquer aux légations testamentaires.'),(102016,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1026,10201,'La Mort de <i:Défunt>','J\'ai appris par courrier <i:Défunt>, un de mes parents éloignés mais très riche. C\'est son avocat, <i:Avocat> qui m\'a envoyé un mot pour me convoquer aux légations testamentaires.'),(102021,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1028,10202,'Un héritage commun','J\'ai organisé la lecture des dispositions testamentaires de <i:Défunt> en présence de ses bénéficiaires <i:JH>, <i:JF>, <i:Hôte>, <i:Ch>, <i:Li> et <i:Le>.\r\n\r\n<i:Défunt> lègue donc une forte somme d\'argent à <i:JH> et <i:JF>, et peu aux autres.\r\n\r\nNéanmoins <i:JH> et <i:JF> doivent s\'épouser sous 3 mois sinon celui qui brise l\'engagement devra donner sa somme du legs à l\'autre. Et si aucun ne souhaite se marier, alors l