iciaires <i:JH>, <i:JF>, <i:Ch>, <i:Hôte>, <i:Le> et moi-même.\r\n\r\n<i:Défunt> lègue donc une forte somme d\'argent à <i:JH> et <i:JF>, et peu aux autres.\r\n\r\nNéanmoins <i:JH> et <i:JF> doivent s\'épouser sous 3 mois sinon celui qui brise l\'engagement devra donner sa somme du legs à l\'autre. Et si aucun ne souhaite se marier, alors l\'argent ira à des œuvres de charité.\r\n\r\nIl n\'y avait pas besoin d\'être grand clair pour deviner immédiatement que malheureusement <i:JH> et <i:JF>  ne s\'aiment pas.'),(102025,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1026,10202,'Aux Légations Testamentaires de <i:Défunt>','J\'ai participé à la lecture des dispositions testamentaires de <i:Défunt> organisée par <i:Avocat> qui avait invité tous ses bénéficiaires <i:JH>, <i:JF>, <i:Ch>, <i:Li>, <i:Hôte> et moi-même.\r\n\r\n<i:Défunt> lègue donc une forte somme d\'argent à <i:JH> et <i:JF>, et peu aux autres.\r\n\r\nNéanmoins <i:JH> et <i:JF> doivent s\'épouser sous 3 mois sinon celui qui brise l\'engagement devra donner sa somme du legs à l\'autre. Et si aucun ne souhaite se marier, alors l\'argent ira à des œuvres de charité.\r\n\r\nIl n\'y avait pas besoin d\'être grand clair pour deviner immédiatement que malheureusement <i:JH> et <i:JF>  ne s\'aiment pas.'),(102026,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1023,10202,'Aux Légations Testamentaires de <i:Défunt>','J\'ai participé à la lecture des dispositions testamentaires de <i:Défunt> organisée par <i:Avocat> qui avait invité tous ses bénéficiaires <i:JH>, <i:Ch>, <i:Li>, <i:Hôte>, <i:Le> et moi-même.\r\n\r\n<i:Défunt> lègue donc une forte somme d\'argent à <i:JH> et moi-même, et peu aux autres.\r\n\r\nNéanmoins <i:JH> et moi devons nous marier sous 3 mois sinon celui qui brise l\'engagement devra donner sa somme du legs à l\'autre. Et si aucun ne souhaite se marier, alors l\'argent ira à des œuvres de charité.\r\n\r\nJ\'ai été totalement abasourdi par cette révélation  : et quand je vois <i:JH> il est clair que je l\'apprécie pas, c\'est totalement impossible : je ne l\'épouserai jamais !!!'),(102027,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1022,10202,'Aux Légations Testamentaires de <i:Défunt>','J\'ai participé à la lecture des dispositions testamentaires de <i:Défunt> organisée par <i:Avocat> qui avait invité tous ses bénéficiaires <i:JF>, <i:Ch>, <i:Li>, <i:Hôte>, <i:Le> et moi-même.\r\n\r\n<i:Défunt> lègue donc une forte somme d\'argent à <i:JF> et moi-même, et peu aux autres.\r\n\r\nNéanmoins <i:JF> et moi devons nous marier sous 3 mois sinon celui qui brise l\'engagement devra donner sa somme du legs à l\'autre. Et si aucun ne souhaite se marier, alors l\'argent ira à des œuvres de charité.\r\n\r\nJ\'ai été totalement abasourdi par cette révélation  : et quand je vois <i:JF> il est clair que je l\'apprécie pas, c\'est totalement impossible : je ne l\'épouserai jamais !!!'),(102031,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,1021,10203,'Le Complot','En arrivant, j\'ai entraperçu <i:JH>. A la bonne heure ! \r\nJe vais en profiter pour tenter de séduire <i:JH> que je trouve très attirant. J\'aimerais bien me remarié et je crois qu\'il serait un mari idéal'),(102032,'2014-05-02 00:00:00','2014-05-02 00:00:00',1,1022,10203,'Le Complot','En arrivant, j\'ai entraperçu <i:Hôte>. A la bonne heure !  Je vais en profiter pour séduire <i:Hôte> dont je pense être amoureux. Pas sûr que ce sentiment soit réciproque néanmoisn !...\r\nJ\'ai vu aussi <i:JF>, je vais l\'éviter et tenter de lui parler le moins possible.'),(102033,'2014-05-02 00:00:00','2014-05-02 00:00:00',1,1023,10203,'Le Complot','En arrivant, j\'ai entraperçu <i:JH>. Je vais l\'éviter et tenter de lui parler le moins possible. D\'autant que j\'ai bien vu la façon qu\'il regardait <i:Hôte>, je vois bien qu\'il est amoureux.\r\nNous avons parlé avec <i:Ch>, <i:Li> et <i:Le> que j\'avais entraperçus également en arrivant: <i:Ch> et moi avons proposé de \"comploter\" pour faire en sorte que <i:JH> et <i:Hôte> se raprochent, se mettent ensemble, et qui sait? Se marient ! \r\nJ\'ai trouvé l\'idée très amusante et accepté facilement !'),(102034,'2014-05-02 00:00:00','2014-05-02 00:00:00',1,1024,10203,'Le Complot','En arrivant, j\'ai entraperçu <i:JH>, <i:JF>, <i:Le>, <i:Li> et <i:Hôte>.\r\nMais j\'ai surtout remarqué la façon si particulière dont <i:JH> regardait <i:Hôte>, je vois bien qu\'il est amoureux. \r\nNous avons parlé avec <i:JF>, <i:Li> et <i:Le> : <i:JF> et moi avons proposé de \"comploter\" pour faire en sorte que <i:JH> et <i:Hôte> se raprochent, se mettent ensemble, et qui sait? Se marient ! \r\nJ\'ai trouvé l\'idée très amusante et accepté facilement !'),(102035,'2014-05-02 00:00:00','2014-05-02 00:00:00',1,1025,10203,'Le Complot','En arrivant, j\'ai entraperçu <i:JH>, <i:JF>, <i:Ch>, <i:Le> et <i:Hôte>.\r\nMais j\'ai surtout remarqué la façon si particulière dont <i:JH> regardait <i:Hôte>, je vois bien qu\'il est amoureux. \r\nNous avons parlé avec <i:JF>, <i:Le> et <i:Ch> : <i:JF> et <i:Ch> ont proposé de \"comploter\" pour faire en sorte que <i:JH> et <i:Hôte> se raprochent, se mettent ensemble, et qui sait? Se marient ! \r\nJ\'ai trouvé l\'idée très amusante et accepté facilement !'),(102035,'2014-05-02 00:00:00','2014-05-02 00:00:00',1,1026,10203,'Le Complot','En arrivant, j\'ai entraperçu <i:JH>, <i:JF>, <i:Ch>, <i:Li> et <i:Hôte>.\r\nMais j\'ai surtout remarqué la façon si particulière dont <i:JH> regardait <i:Hôte>, je vois bien qu\'il est amoureux. \r\nNous avons parlé avec <i:JF>, <i:Li> et <i:Ch> : <i:JF> et <i:Ch> ont proposé de \"comploter\" pour faire en sorte que <i:JH> et <i:Hôte> se raprochent, se mettent ensemble, et qui sait? Se marient ! \r\nJ\'ai trouvé l\'idée très amusante et accepté facilement !'),(103011,'2013-12-08 00:00:00','2013-12-08 00:00:00',1,1032,10301,'Un amour de jeunesse','Ma fille <i:fillle> a eu une enfance heureuse. Enfant elle jouait souvent avec <i:amant> et je crains même qu\'elle ne se soit quelque peu amourachée de lui. Mais il est issu d\'une famille humble alors que nous sommes fortunés, aussi j\'ai dû demander il y a un an  à ma fille de mettre un terme à cette inopportune fréquentation.'),(103011,'2013-12-08 00:00:00','2013-12-08 00:00:00',1,1034,10301,'Un amour de jeunesse','J\'ai eu une enfance heureuse et j\'ai toujours connu <i:fille> depuis avec lequel je jouais quand nous étions enfants.\r\nAdolescent, elle devint mon premier amour et depuis mon sentiment n\'a jamais faibli. Hélas sa famille est fort riche tandis que je suis assez humble, et son père n\'a jamais eu une haute opinion de moi pour cette raison. Se doutant sans doute de notre sentiment, il a demandé il y a un an  à <i:fille> de mettre un terme à notre fréquentation mais nous avons continué à nous voir en cachette.'),(103012,'2013-12-08 00:00:00','2013-12-08 00:00:00',1,1031,10301,'Un amour de jeunesse','J\'ai eu une enfance heureuse et j\'ai toujours connu <i:amant> depuis avec lequel je jouais quand nous étions enfants.\r\nAdolescente, elle devint mon premier amour et depuis mon sentiment n\'a jamais faibli. Hélas sa famille est fort humble par rapport à la mienne, et mon père n\'a jamais eu une haute opinion de lui pour cette raison. Il m\'a demandé il y a un an d\'arrêter de fréquenter <i:amant> mais j\'ai continué à le voir en cachette.'),(108021,'2014-07-29 00:24:36','2013-01-01 00:00:00',2,10807,10802,'Demain la croisière','La croisière commence demain, je suis très excité ! Nous partons de <l:DepartCroisière> et rejoignons <l:Destination>'),(108022,'2014-05-01 00:00:00','2014-05-01 00:00:00',1,10801,10802,'Préparatif de croisière','Pour démarrer cette première croisière sur le \"7 Worlds Queen\", j\'ai demandé à <i:Staff2-RespDivertissements> de nous organiser un cocktail d\'arrivée.\r\n\r\nDe même, un buffet pour se restaurer devra avoir lieu un peu plus tard.'),(108023,'2014-07-29 00:25:49','2014-05-01 00:00:00',2,10802,10802,'Préparatif de croisière','Pour démarrer cette première croisière sur le \"7 Worlds Queen\", le commandant <i:Commandant> m\'a demandé de nous organiser un cocktail d\'arrivée. J\'ai demandé à <i:StaffGenBateau> de m\'aider.\r\n\r\nDe même, un buffet pour se restaurer devra avoir lieu un peu plus tard.'),(108024,'2014-07-29 00:25:49','2014-05-01 00:00:00',2,10806,10802,'Préparatif de croisière','Pour démarrer cette première croisière sur le \"7 Worlds Queen\", le Commandant <i:Commandant> a demandé  à <i:Staff2-RespDivertissements> de nous organiser un cocktail d\'arrivée, qui a sollicité mon aide pour cela.\r\n\r\nDe même, un buffet pour se restaurer devra avoir lieu un peu plus tard.'),(108031,'2014-07-29 00:26:43','2014-05-01 00:00:00',2,10807,10803,'Début de Croisière &amp; Cocktail!','Je suis à <l:DepartCroisière>. Cette  croisière sur le \"7 worlds Queen\" commence enfin et va nous emmener sous deux semaines à  <l:Destination>.\r\nUn magnifique cocktail marque notre départ, tandis que le <o:Vaisseau1> quitte doucement <l:DepartCroisière>'),(112011,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1121,11201,'La Guerre','Cette année là, la guerre s\'est déclarée entre mon pays d\'origine et <l:PaysEtrangerEnGuerre>.'),(112012,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1122,11201,'La Guerre','Cette année là, la guerre s\'est déclarée en <l:PaysEtrangerEnGuerre>.'),(112013,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1123,11201,'La Guerre','Cette année là, la guerre s\'est déclarée en <l:PaysEtrangerEnGuerre>.'),(112014,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1124,11201,'La Guerre','Cette année là, la guerre s\'est déclarée en <l:PaysEtrangerEnGuerre> avec mon pays d\'origine.'),(112021,'2015-01-11 12:10:44','2013-12-13 00:00:00',2,1121,11202,'Engagement dans l\'armée','Mon père <i:none:GRANDPERE> homme de poigne, m\'envoie à l\'armée pour faire la guerre. Je ne m\'y suis pas vraiment opposé car cette expérience ambitieuse me plaît, je compte m\'illustrer pour revenir couronné de succès et de gloire.'),(112024,'2015-01-11 12:10:43','2013-12-13 00:00:00',2,1124,11202,'Engagement dans l\'armée','J\'ai envoyé <i:none:PERE> à la guerre avec <l:none:PaysEtrangerEnGuerre>.'),(112031,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1121,11203,'Tomber amoureux durant la guerre','Au cours de mes missions je rencontre <i:MERE>. Je passe du temps avec elle et en tombe éperdument amoureux. La guerre étant un temps difficile pour tous, je lui promets de la ramener avec moi quand je rentrerai dans mon pays.'),(112032,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1122,11203,'Tomber amoureux durant la guerre','Durant la guerre, je rencontre <i:PERE> un soldat adverse. Malgré le danger, nous passons du temps ensemble. Je suis amoureuse, et il me promet même une vie ensemble dans son pays.'),(112041,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1121,11204,'Retour seul chez soi','Mon père <i:GRANDPERE> m\'ordonne de revenir dans mon pays d\'origine. Après hésitations du fait de mon amour pour <i:MERE>, la pression grandissante de ma famille m\'oblige à retourner chez moi en promettant à <i:MERE> de revenir la chercher un jour. Je lui offre ma <o:MEDAILLEMILITAIRE> en gage de bonne foi. De retour, dans mon pays d\'origine, je me noie dans le travail car malgré mes recherches, je ne parviens pas à reprendre contact avec <i:MERE>. Je suis désespéré.'),(112042,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1122,11204,'Retour seul chez soi','<i:PERE> est contraint par sa famille de retourner chez lui. Je crois que je suis enceinte de lui, mais qu\'est ce que ça m\'apporterai de le mettre au courant maintenant? Il me promet de revenir mais je n\'y crois pas trop.'),(112042,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1124,11204,'Retour seul chez soi','J\'ai entendu parlé d\'une amourette de mon fils dans <l:PaysEtrangerEnGuerre>. Je lui ordonne donc de rentrer.'),(112051,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1121,11206,'Le leader laisse la place à son fils','Après plusieurs années à diriger ma famille <i:GRANDPERE> me laisse enfin sa place me propulsant à la tête de la jolie fortune familiale. J\'en profite à nouveau pour retrouver <i:MERE> mais j\'échoue. Inconsolable, je me réfugie dans le travail.'),(112052,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1122,11205,'Naissance de l\'enfant non désiré','Dans la pauvreté et la douleur, je donne naissance à <i:ENFANT>. Je ne peux pas lui donner l\'identité de son père. Elle doit le haïr mais tant pis. Je lui remets tout de même la <o:MEDAILLEMILITAIRE> qu\'il m\'a laissé avant de partir.'),(112053,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1123,11205,'Naissance de l\'enfant non désiré','Je née dans une banlieue pauvre. Ma mère <i:MERE> travaille de l\'aube à la tombée de la nuit pour pouvoir m\'élever, et reste très secrète sur l\'identité de mon père. Elle m\'a remis à ma naissance un souvenir de lui, une <o:MEDAILLEMILITAIRE> qu\'il lui avait offert, et que je porte toujours. Un soldat peut être ? D\'années en années, je vois sa santé décliner. Qui fut cet homme qui m\'a donné la vie et l\'a abandonnée ?'),(112064,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1124,11206,'Le leader laisse la place à son fils','Je sais que mes forces diminue et que mon héritier est prêt. Il faut qu\'il prenne sa place à la tête de notre famille dès maintenant…'),(112072,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1122,11207,'Disparition de la mère','Je suis à bout de force. Je n\'ai plus d\'autre choix que de partir. <i:ENFANT> est une personne forte ! Il s\'en sortira j\'en suis sûre. Mais je dois encore une fois au mons lui parler de son père et au moins lui remettre ce <o:portrait1> qu\'il m\'avait offert…'),(112073,'2013-12-13 00:00:00','2013-12-13 00:00:00',1,1123,11207,'Disparition de la mère','Vivant dans la misère, et se tuant à la tache pour de petits travaux sous-payés, ma mère <i:MERE> finit par être terrassée par la maladie ou l\'épuisement sinon les deux. Avant de disparaître, elle me parle d\'un père sans lui donner son nom et dans un dernier effort, me remet le <o:portrait1> d\'elle que lui avait fait faire mon père.'),(1110001,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111001,111000,'Association de malfaiteurs','Mon petit ami <i:Max>, le petit frère de ce dernier <i:Theo>, notre amie <i:Minna> et moi, avons tous décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.'),(1110002,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111002,111000,'Association de malfaiteurs','Mon frère <i:Max>, la petite amie de ce dernier <i:Marie>, ma belle amie <i:Minna>, et moi avons tous décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.'),(1110003,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111003,111000,'Association de malfaiteurs','Mon ami <i:Max>, son petit fère <i:Theo>, la petite amie de <i:Max>, la jolie <i:Marie>,  et moi, avons tous décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.'),(1110004,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111004,111000,'Association de malfaiteurs','Ma petite amie <i:Marie>, ma grande amie <i:Minna>, et mon frère cadet <i:Theo> et moi avons décidé de nous associer au sein d\'une association criminelle, qu\'on appelle tout simplement \"La bande\". L\'idée était de monter quelques grands coups.'),(1110012,'2013-11-28 00:00:00','2013-11-28 00:00:00',1,111002,111001,'L\'arrestation','<i:Marie>, a organisé un coup, j\'ai réussis à la convaincre de me prendre, la belle <i:Minna> m\'a arangée le coup. Je sais que mon frère <i:Max> s\'est opposé à ça, il me trouvait pas prêt et il avait peut être raison.\r\nTout s\'est pas passé comme prévu, j\'ai foiré et <i:Marie> s\'est faite choper.\r\nJe crois que du coup mes chances de me faire <i:Minna> sont minces.'),(1110013,'2013-11-28 00:00:00','2013-11-28 00:00:00',1,111003,111001,'L\'arrestation','<i:Marie>, l\'autre pouffe, a organisé un coup, il est un peu bancal mais elle insiste pour qu\'on le fasse. Elle est tellement exaltée que je n\'ai pas eu le cœur de dire non.\r\n<I:Theo> a insisté pour en faire partie, je ne suis pas sûre qu\'il soit assez mature mais il a court-circuité tout le monde en allant directement voir <i:Marie> : elle a vraiment une mauvaise influence sur lui.\r\n\r\nTout s\'est mal passé, comme je le craignais <i:Theo> a tout foiré, et <I:Minna> s\'est faite choper : elle en a pris pour 20 ans fermes. Je ne sais pas si j\'aurai la force de l\'attendre.'),(1110014,'2013-11-28 00:00:00','2013-11-28 00:00:00',1,111004,111001,'L\'arrestation','<i:Marie>, a organisé un coup, il est un peu bancal mais elle insiste pour qu\'on le fasse. Elle est tellement exaltée que personne dans \"la bande\" n\'a jamais eu le cœur de dire non.\r\n<i:Theo> veut en être je lui ai dit non : pas prêt, pas assez mature…  mais il m\'a court-circuité et <i:Marie> a annoncé qu\'elle l\'emmenait.\r\nAinsi elle a dfinalement cédé.\r\n\r\nComme c\'était à craindre, tout s\'est mal passé, <i:Theo> a foiré et <I:Marie> s\'est faite choper. 20 ans fermes. Je ne sais pas si j\'aurai la force de l\'attendre.'),(1110021,'2013-11-28 00:00:00','2013-11-28 00:00:00',1,111001,111001,'L\'arrestation','J\'ai organisé un super coup. Un cambriolage de haute volée. J\'ai mis toute mon équipe sur le coup : <i:Max> l\'amour de ma vie et <I:Minna>. J\'ai dû aussi prendre dans l\'équipe <I:Theo>, le frère de <I:Max> même s\'il est un peu lourd à supporter.\r\n\r\nTout était réglé comme du papier à musique, on ne pouvait pas échouer !\r\n\r\nMais <I:Theo> a merdé et je me suis faite choper pour permettre aux autres de s\'enfuir.\r\n\r\n20 ans fermes, voilà ce que je me suis prise à cause des conneries de <I:Theo>. Heureusement je sais que <I:Max> m\'attend dehors.'),(1110021,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111004,111002,'La faute','<i:Marie> était enfermée depuis 15j et <i:Theo> commençait à déconner grave. Ma vie n\'avait plus de saveur. Seule <i:Minna> restait auprès de moi pour me soutenir. Elle a profité de ma faiblesse et un soir où j\'avais particulièrement le cafard, elle s\'est retrouvée dans mon lit.\r\n<i:Theo> nous a surpris et il est parti en claquant la porte, nous n\'en avons plus rediscuté depuis.\r\n\r\nJ\'aime toujours <i:Marie> mais c\'est vrai que je me remets en doute maintenant qu\'elle est enfermée pour 20 ans. Et <i:Minna> est plutôt cool.'),(1110022,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111003,111002,'La faute','Ca y est !\r\nJ\'ai enfin réussis à me taper <i:Max> ! Plus que <i:Theo>, le petit frère, et j\'ai fait le grand chelem !\r\nPutain c\'était cool, je me suis bien éclaté. Enfin jusqu\'à ce que <i:Theo> débarque dans la chambre, après ça <i:Max> n\'était plus tellement à ce qu\'il faisait.'),(1110023,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111002,111002,'La faute','J\'ai chopé <i:Max> en train de tromper <i:Marie> avec <i:Minna>. Putain ça fait chier !  Non que j\'apprécie particulièrement <i:Marie>, mais pour moi <i:Max> était le grand frère idéalisé, aujourd\'hui j\'ai réalisé que ce n\'était qu\'un homme.\r\nEt puis je suis dingue de <i:Minna>, je l\'aime à mourir, comment je vais faire maintenant ? <i:Max> est tellement mieux que moi…'),(1110031,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111001,111003,'L\'évasion','Saloperie ! Je l\'ai fait ! J\'ai juste pété la tête de ce gardien et je suis dehors.\r\n\r\nJ\'ai réussi à m\'échapper, je ne purgerai pas ma peine, je suis libre !\r\n\r\nJe suis direct allé retrouvé ma bande, ils sauront me cacher.'),(1110032,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111002,111003,'L\'évasion','<i:Marie> vient de débarquer, elle a réussi à s\'évader !\r\nElle ne me manquait pas vraiment, mais c\'est vrai que je me sentait un peu coupable, et puis <i:Max> était au trente-sixième dessous, donc c\'est plutôt cool.\r\n\r\nMaintenant il va falloir la cacher, mais ça devrait aller, elle est pas connue dans le coin.'),(1110033,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111003,111003,'L\'évasion','<i:Marie> vient de débarquer, elle a réussi à s\'évader !\r\nElle me manquait pas vraiment, mais je pense qu\'en m\'arrangeant bien, ça peut faire du drama ! Cool … cool, cool, cool...\r\n\r\nMaintenant il va falloir la cacher, mais ça devrait aller, elle est pas connue dans le coin.'),(1110034,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111004,111003,'L\'évasion','<i:Marie> vient de débarquer, elle a réussi à s\'évader !\r\nJe suis fou de joie, mais ça n\'arrange pas mes dilemmes. Ma relation avec <i:Minna> va être compliquée!\r\n\r\nEn plus, maintenant il va falloir cacher <i:Marie>, mais ça devrait aller, elle est pas connue dans le coin.'),(1110041,'2013-12-12 00:00:00','2013-12-12 00:00:00',1,111003,111004,'Les facheuses conséquences','Putain de merde ! Fais chier !\r\nJ\'ai une semaine de retard, je suis tombée enceinte : c\'était pas du tout prévu, et je sais pas quoi faire ! \r\nCa ne peut être que <i:Max>, je me suis tapé personne d\'autre depuis longtemps…\r\n\r\nComment je vais faire bordel… Je peux pas m\'occuper d\'un gosse toute seule, j\'arrive même pas à m\'occuper de moi-même, je suis qu\'une paumée…\r\nFaut que je récupère <i:Max>, malgré ses grands airs je sais que s\'est un type bien qui ne fuira pas ses responsabilités. Mais maintenant que <i:Marie> est revenue ça va être plus compliqué.\r\nSurtout qu\'avec ma réputation de trainée et de menteuse, comment je vais faire pour le convaincre que le gamin est de lui si je décide de lui dire la vérité ?\r\n\r\nPutain j\'ai trop déconné, c\'est la merde!'),(1110047,'2014-07-21 15:54:42','2014-07-21 15:54:42',1,1071,1073,'Poursuite','Inlassablement, je traque <i:RA> et <i:OB> partout ! Ma quête est longue mais un jour un informateur m\'annonce savoir où se trouve <i:OB> : je le fais parler et au pied d\'un volcan bouillonnant de lave, je me rends dans une caverne à <l:lieu1>.\r\nC\'est un piège que m\'a tendu <i:OB> !\r\nNous nous battons de façon épique et je perds le combat, englouti par des coulée de lave en train de refroidir….\r\n\r\n<i:OB> m\'abandonne agonisant, me croyant mort…. Mais mes amis de la force obscure me soigne et finalement, quoique diminué, je survis et continue à le traquer… plus discrètement.'),(1110048,'2014-07-21 15:54:42','2014-07-21 15:54:42',1,1071,1072,'Très Méchant','Le côté obscur de la force m\'a attiré irrésistiblement et j\'ai basculé, devenant chaque jour plus dangereux et effrayant, et surtout puissant.\r\nNos relations sont devenues très tendues avec <i:RA> et nous nous sommes séparés alors qu\'elle était sur le point d\'accoucher (ce qu\'elle fit très peu de temps après notre séparation). Elle avait très peur de moi.\r\nElle ne m\'intéressait guère mais je voulais récupérer mes enfants, un garçon et une fille. Hélas, elle s\'est enfuie je ne sais où, ayant de surcroût demandé à un complice d\'emmener loin de moi mes enfants. Cela m\'a mis dans une colère noire, car je compris à cet instant que sans doute je ne reverrai plus mes enfants.\r\n\r\nJ\'ai tenté sans succès de la pourchasser et la tuer mais elle parvint à échapper à mon courroux, visiblement avec l\'aide de <i:OB> qui m\'a trahi…'),(1110049,'2014-07-21 15:54:42','2014-07-21 15:54:42',1,1071,1075,'',''),(1110050,'2014-07-21 15:54:42','2014-07-21 15:54:42',1,1071,1074,'',''),(1110051,'2014-07-21 15:54:42','2014-07-21 15:54:42',1,1071,1071,'Un amour de jeunesse','Je pourrais dire que dès que j\'ai rencontré <i:RA>, nous nous sommes aimés.\r\nNous nous sommes rapidement mis en couple, vivions sur sur <l :lieu1>, et n\'avons pas tardé à avoir deux enfants : <i:RA> était tellement séduisante, je dois dire que nous formions un couple parfait.\r\nNous avions beaucoup d\'amis, dont <i:OB>, qui avait suivi la voie Jedi.'),(1110057,'2014-07-21 15:55:18','2014-07-21 15:55:18',1,1072,1073,'',''),(1110058,'2014-07-21 15:55:18','2014-07-21 15:55:18',1,1072,1072,'Séparation','Le côté obscur de la forcea attiré irrésistiblement <i:DV> qui est devenu chaque jour plus dangereux et effrayant, et surtout puissant.\r\nNos relations sont devenues très tendues avec <i:DV> et nous nous sommes séparés alors que j\'étais sur le point d\'accoucher (ce que je fis très peu de temps après notre séparation). J\'avais  très peur de lui.\r\nJ\'accouchais finalement de <i:PL> et <i:LS>, une fille et un  garçon. A leur nécessance, conformément à la tradition familiale, j\'offrais un <o:médaillon1> identique ) <i:Ls> et <i:PL>. \r\n\r\nMais <iDV> voulait récupérer ses enfants. Alors j\'ai fait appel à <i:OB>, mon vieil ami, pour m\'aider. Je luis confiais <i:LS> pour l\'élever en lui demandant de ne pas me dire où, pour la propre sécurité de l\'enfant.\r\n\r\nDe mon côté je m\'enfuyais très loin avec <i:PL> sur <l:lieu3>. Je savais que probablement je ne reverrai jamais plus <i:LS>. J\'étais très triste.'),(1110059,'2014-07-21 15:55:18','2014-07-21 15:55:18',1,1072,1075,'Maladie','Je suis tombée très malade. \r\nJ\'ai demandé à <i:RA> de me procurer une certaine plante rare qui ne pousse que sur <l:lieu2> où elle va se rendre.'),(1110060,'2014-07-21 15:55:18','2014-07-21 15:55:18',1,1072,1074,'La fuite','Inlassablement, <i:DV> me traque partout, tout comme il traque certainement <i:OB>  ! \r\nJe me suis enfuie sur une de nos lointaines colonies, <l:lieu3>, adoptant une fausse identité.\r\nLà j\'élève seule ma fille, avec l\'aide de quelques domestiques. Innocente dans mon drame, j\'offrais à ma fille une vie assez opulente.\r\n\r\nEn grandissant, <i:PL> me demande qui est son père mais j\'élude la question et lui dit qu\'il est mort au combat dans une ancienne guerre. Je lui avouais néanmoins que je m\'étais enfuie sur cette colonie pour fuir un vieux danger m\'ayant contrainte à cette vie clandestine et exilée.'),(1110061,'2014-07-21 15:55:18','2014-07-21 15:55:18',1,1072,1071,'Un amour de jeunesse','Je pourrais dire que dès que j\'ai rencontré <i:RA>, nous nous sommes aimés.\r\nNous nous sommes rapidement mis en couple, vivions sur sur <l :lieu1>, et n\'avons pas tardé à avoir deux enfants : <i:DV> était un homme merveilleux, je dois dire que nous formions un couple parfait.\r\nNous avions beaucoup d\'amis, dont <i:OB>, qui avait suivi la voie Jedi.'),(1110067,'2014-07-28 18:51:15','2014-07-26 00:22:55',7,111010,111006,'Quand <i:Servante> entre dans ma vie','Aujourd\'hui je me suis rendu au <l:Spectacle> et dans la file d\'attente, il y a une jeune femme qui visiblement s\'est trompée sur le prix de la place et à laquelle il manque quelques sous pour rentrer. Le caissier ne veut rien savoir. Je sors de la file et offre les quelques sous manquant à la jolie malheureuse, qui me gratifie du plus charmant des sourires. Elle me dit s\'appeler <i:Servante>. Nous faisons connaissance, et me dit être domestique en la <l:Demeure> de <i:Dominus> et <i:Domina> où elle travaille dur, n\'ayant qu\'une journée de congés par semaine pour aller se divertir.\r\nJe suis immédiatement séduit par son sourire.\r\nQuelques jours se sont écoulés et nous flirtons déjà ensemble. J\'ai découvert que <i:Servante> adore le <l:Spectacle>, et je lui offre la place chaque semaine pour que nous puissions nous retrouver, enfin,... quand mon emploi du temps le permet (je crois qu\'elle me retrouve ainsi parfois pendant ses heures de service).'),(1110068,'2014-07-28 18:55:16','2014-07-26 00:22:55',8,111006,111006,'Quand <i:PetitAmi> entre dans ma vie','Aujourd\'hui je vais au <l:Spectacle> : la place est fort chère pour moi et catastrophe, je me suis trompée sur le prix de la place : il me manque quelques sous pour rentrer, et le caissier ne veut rien savoir. \r\nUn galant jeune homme sort de la file pour déposer au caissier les quelques sous manquant et nous rentrons ainsi tous deux. Je le gratifie d\'un sourire, il se présente et me dit s\'appeler <i:PetitAmi>. Je le trouve charmant avec ses airs assurés et son élégance toute naturelle. \r\nNous faisons connaissances, il vit bourgeoisement, je lui dit que je ne suis \"que\" domestique en la <l:Demeure> de <i:Domina> et <i:Dominus> mais cela ne semble pas le gêner que nous ne soyons pas vraiment de la même condition sociale.\r\n\r\nQuelques jours se sont écoulés, et nous flirtons ensemble. Il a découvert que j\'aime beaucoup le <l:Spectacle> et il m\'offre la place chaque semaine pour que puissions nous retrouver, enfin quand son emploi du temps le permet (parfois, il me faut m\'y rendre secrètement pendant mes heures de service).'),(1110074,'2014-07-28 19:09:33','2014-07-26 00:25:09',2,111009,111007,'Le début d\'une passion avec <i:Dominus>','Il y a deux mois, j\'ai rencontré, puis me suis rapproché de <i:Dominus>, un homme marié. Entre nous est née bien vite une passion torride et nous essayons de nous voir le plus souvent possible, dans des endroits chaque fois différents.... avec elle j\'ai l\'impression d\'avoir retrouvé mes 20ans.\r\nOh ! nous ne nous racontons pas grand chose de bien sorcieurs, nous sommes juste heureux de nous retrouver, nous amuser, et passer du bon temps si vous voyez ce que je veux dire !'),(1110090,'2014-07-29 18:47:36','2014-07-26 07:34:57',3,111007,111007,'Les hauts et les bas dans un couple','Depuis 3 mois, cela ne va pas bien entre mon époux <i:Dominus> et moi, et nous sommes tout le temps en train de nous chamailler pour un rien. Je crois que depuis le temps que nous sommes mariés, nous nous sommes un peu éloignés l\'un de l\'autre. La moindre occasion est devenu le prétexte à une dispute.\r\nJ\'espère au moins qu\'il ne fréquente personne d\'autre que moi !'),(1110095,'2014-07-29 18:47:36','2014-07-26 07:35:09',5,111008,111007,'Le début d\'une passion avec <i:Maîtresse>','Depuis 3 mois, cela ne va pas bien entre mon épouse <i:Domina> et moi, et nous sommes tout le temps en train de nous chamailler pour un rien. Je crois que depuis le temps que nous sommes mariés, nous nous sommes un peu éloignés l\'un de l\'autre. La moindre occasion est devenue le prétexte à une dispute.\r\nJ\'espère au moins qu\'elle ne fréquente personne d\'autre que moi. Pas comme moi !....\r\nEn effet, il y a deux mois j\'ai rencontré - puis me suis rapproché - de <i:Maîtresse>. Entre nous est née bien vite une passion torride et nous essayons de nous voir le plus souvent possible, dans des endroits chaque fois différents.... \r\nAvec elle j\'ai l\'impression d\'avoir retrouvé mes 20ans !\r\nOh ! nous ne nous racontons pas grand-chose de bien sorciers, nous sommes juste heureux de nous retrouver, nous amuser, et passer du bon temps si vous voyez ce que je veux dire !'),(1110097,'2014-07-28 18:59:55','2014-07-28 18:59:55',1,111010,111005,'\r\n','\r\n'),(1110098,'2014-07-28 19:22:16','2014-07-28 19:13:39',3,111006,111008,'La poudre d\'escampette…','Merveilleuse Catastrophe ! <i:PetitAmi> vient de me laisser un petit billet doux où il me dit qu\'il m\'attend à la séance de 16h30 au <l:Spectacle> , où nous avons l\'habitude de nous retrouver !  \r\nIl a dû changer son programme, nous ne devions y aller que DEMAIN, car c\'est mon jour de congés hebdomadaire !\r\nTant pis j\'y avais… Il faudra que je prépare malgré tout une bonne explication auprès de <i:Domina> qui ne manquera pas de surprendre - et s\'offusquer - de mon absence...\r\n'),(1110099,'2014-07-28 19:22:16','2014-07-28 19:19:58',2,111010,111008,'Un billet doux\r\n','Demain c\'est le jour de congés de <i:Servante> et nous devions nous retrouver au <l:Spectacle>. Malheureusement, j\'ai une journée bien chargée demain, et nous ne pourrons sans doute pas nous retrouver au <l:Spectacle> comme nous en avons l\'habitude.\r\nJe viens de faire porter à <i:Servante> un petit biller doux et je lui dis que je l\'attends à 16h30 au <l:Spectacle> : elle est si maligne qu\'elle arrive toujours à s\'absenter pendant ses heures de services sans que sa maîtresse <i:Domina> ne lui créée trop de soucis.'),(1110100,'2014-07-28 19:27:59','2014-07-28 19:19:58',3,111007,111008,'Où est passée <i:Servante> ?','Mais où est-elle passée ? Ce n\'est pas son jour de congés pourtant aujourd\'hui elle devrait être à son service : son congés c\'est DEMAIN !\r\nQuand je la reverrai, je lui demanderai où ellle est passé. Je la paye pour faire son service, pas pour disparaître quand je la cherche !\r\nDe plus je ne peux demander à mon mari de m\'aider à reprendre <i:Servante>, d\'une part parce qu\'il ne s\'occupe guère des affaires du personnel, d\'autre part parce qu\'il m\'a dit qu\'il rentrerait très tard ce soir, ayant beaucoup de travail aujourd\'hui.\r\n'),(1110101,'2014-07-28 19:50:32','2014-07-28 19:24:18',5,111008,111009,'Au <l:Spectacle>','J\'ai fait porter ce matin à <i:Maîtresse> une surprise : une place pour aller le retrouver au <l:Spectacle> ! \r\nNous n\'y sommes jamais allé ensemble, et j\'ai raconté à mon épouse <i:Domina> que je rentrerai tard ce soir du fait d\'une surcharge de travail.\r\n<i:Maitresse> me retrouve, toujours aussi élégante.\r\nIl y a énormément de monde dans la pénombre et j\'ai beaucoup de mal à le retrouver dans la foule. Je lui ai acheté à l\'accueil quelques chocolats que nous dégustons pendant le <l:Spectacle> comme deux enfants !\r\nA l\'entracte, nous réalisons que avons du chocolat plein les doigts et convenons d\'aller nous laver les mains. Dès que je me lève pour rejoindre les lavabos, je découvre que peu derrière nous se trouve <i:Servante>, avec un jeune homme. Nos regards se croisent.\r\nLe jeune homme regarde ailleurs et dans la faible luminosité, je le distingue trop mal pour le reconnaître. Mais si j\'en crois la main du jeune homme autour des épaules de <i:Servante>, ils sont proches ! \r\nIl est évident qu\'elle a remarqué que je n\'étais pas avec mon épouse, et connaît peut-être même <i:Maîtresse>. Je suis bouleversé d\'embarras, mais elle le semble autant. Je viens de réaliser que ce n\'est pas son jour de congés aujourd\'hui, et que si mon épouse découvre les raisons de son absence, elle est licenciée sur le champ et sans ses gages ! Bref nous nous tenons l\'un l\'autre ! \r\nNous sortons de la salle du Spectacle sans nous dire un mot avec <i:Servante>'),(1110102,'2014-07-28 19:50:32','2014-07-28 19:33:37',3,111006,111009,'Au <l:Spectacle>','Je me rends donc au <l:Spectacle>. Les lieux sont dans la pénombre et j\'ai beaucoup de mal à retrouver <i:PetitAmi> au milieu de toute cette foule. \r\nIl a belle allure et d\'une élégance irrésistible. Moi aussi je me suis mise sur mon 31, enfin...  aussi vite que j\'ai pu.\r\nUne fois assis, il me prend par les épaules, j\'adore quand il fait cela. Ces instants me paraissent aussi délicieux qu\'interminables quand un peu de lumière regagne la salle: c\'est l\'entracte.\r\nUn homme deux rangs devant nous se lève et se retourne, sans doute pour rejoindre les lavabos : Ciel ! c\'est <i:Dominus> ! Il me regarde, voit la main de <i:PetitAmi> (qu\'il connaît peut-être qui sait ?) autour de mes épaules, et je vois une jeune femme penchée sur <i:Dominus> : ce n\'est pas <i:Domina>.\r\nJe ne peux distinguer à cette distance qui est cette femme... Sans doute la poule de Monsieur ? Nos regards se croisent avec  <i:Dominus> je suis bouleversée d\'embarras, mais il le semble autant. \r\nIl sait que je me suis absenté pendant mon services et pourrait me licencier sans mes gages ! mais cette poule ? si Madame <i:Domina> venait à l\'apprendre.... \r\nJe crois qu\'à présente nous nous tenons l\'un l\'autre ! \r\nNous sortons de la salle du <l:Spectacle> sans nous dire un mot avec <i:Dominus>'),(1110103,'2014-07-28 19:50:32','2014-07-28 19:45:40',2,111010,111009,'Au <l:Spectacle>','Je retrouve <i:Servante> au <l:Spectacle> comme convenu, toujours ravissante. Moi aussi je me suis mis sur mon 31.\r\nIl y a énormément de monde dans la pénombre, j\'ai beaucoup de mal à la retrouver dans la foule. Une fois assis dans la pénombre, je la prends par les épaules, je la sens heureuse de se lover contre moi.\r\nCes instants me paraissent aussi délicieux qu\'interminables quand un peu de lumière regagne la salle : c\'est l\'entracte.\r\nBeaucoup de gens en profitent pour se lever et se diriger vers les lavabos, j\'ai l\'impression que cet entracte brise le charme de ce tendre moment avec <i:Servante>, et j\'aimerais que le <l:Spectacle> reprenne le fil au plus vite.\r\nQuand le <l:Spectacle> reprend, je sens <i:Servante> plus tendue... Je n\'ose lui en parler sur le moment. Quand nous nous reverrons, j\'aborderai peut être les raisons de sa contrariété : ai-je fait ou dit  quelque chose ? ou plutôt omis de faire/dire quelque chose ?\r\nAh! ce que les femmes sont compliquées parfois !'),(1110104,'2014-07-28 19:50:32','2014-07-28 19:45:40',3,111009,111009,'Au <l:Spectacle>','<i:Dominus> m\'a fait porter ce matin une belle surprise : une place pour aller le retrouver au <l:Spectacle> ! J\'en suis ravie. \r\nJe me mets un peu sur mon 31 et je l\'y retrouve à 17h. Il y a énormément de monde et dans la pénombre, j\'ai beaucoup de mal à le retrouver dans la foule.\r\nIl m\'a acheté quelques chocolats que nous dégustons pendant le <l:Spectacle> comme deux enfants. \r\n\r\nA l\'entracte, nous réalisons que nous avons du chocolat plein les doigts et convenons d\'aller nous laver les mains. Il semble bouleversé en revenant, mais ne dit pourquoi. Je n\'ose lui poser de question sur le coup : il a certainement du reconnaître une connaissance avec laquelle il est en affaire, et du fait du caractère particulier et récent de notre liaison, nous ne faisons que commencer à parler de nos affaires privées : peut-être est-il gêné d\'être vu avec moi (et non son épouse <i:Domina>) ?'),(1110111,'2014-07-29 00:34:03','2014-07-29 00:32:58',2,10801,111010,'Mon embauche sur le \"7 worlds Queen\"','J\'ai été embauché pour prendre le commandement du \"7 worlds Queen\", magnifique <o:Vaisseau1> qui venait d\'être construit et destiné à faire les plus extraordinaires croisières..\r\nPeu de temps après, j\'ai dû constituer l\'équipe, et c\'est ainsi que m\'ont rejoint pour gérer le vaisseau <i:Staff2-RespDivertissements> (responsable divertissements), <i:Staff3-Doc> (Médecin), <i:Staff4-RespSécurité> (responsable securité) et <i:StaffGenBateau> (staff, qui s\'occupe d\'un peu tout)'),(1110114,'2014-05-23 00:00:00','2014-07-29 00:35:01',3,10806,111010,'Mon embauche sur le \"7 worlds Queen\"','J\'ai été recruté pour rejoindre l\'équipe du \"7 worlds Queen\", magnifique <o:Vaisseau1> qui venait d\'être construit et destiné à faire les plus extraordinaires croisières, par le Commandant <i:Commandant> qui venait lui aussi d\'être recruté.\r\nJ\'ai été embauché comme \"staff\", ma mission est d\'assister le reste de l\'équipe du vaisseau dans ces missions \r\nLe commandant <i:Commandant>  a ainsi rapidement formé son équipe avec également <i:Staff2-RespDivertissements> (responsable divertissements), <i:Staff3-Doc> (Médecin) et <i:Staff4-RespSécurité> (responsable securité)'),(1110115,'2014-07-29 00:37:36','2014-07-29 00:36:25',2,10802,111010,'Mon embauche sur le \"7 worlds Queen\"','J\'ai été recruté pour rejoindre l\'équipe du \"7 worlds Queen\", magnifique <o:Vaisseau1> qui venait d\'être construit et destiné à faire les plus extraordinaires croisières, par le Commandant <i:Commandant> qui venait lui aussi d\'être recruté..\r\nJ\'ai été embauché comme \"staff\", ma mission est de gérer les divertissements sur le \"7 worlds Queen\" et s\'assurer ainsi que les passagers passent un bon moment.\r\nLe commandant <i:Commandant> a ainsi rapidement formé son équipe avec également <i:Staff3-Doc> (Médecin), <i:Staff4-RespSécurité> (responsable securité) et <i:StaffGenBateau> (staff, qui s\'occupe d\'un peu tout)'),(1110116,'2014-05-23 00:00:00','2014-07-29 00:36:25',2,10804,111010,'Mon embauche sur le \"7 worlds Queen\"','J\'ai été recruté pour rejoindre l\'équipe du \"7 worlds Queen\", magnifique <o:Vaisseau1> qui venait d\'être construit et destiné à faire les plus extraordinaires croisières, par le Commandant <i:Commandant> qui venait lui aussi d\'être recruté.\r\nJ\'ai été embauché comme responsable de la sécurité du vaisseau.\r\nLe commandant <i:Commandant>  a ainsi rapidement formé son équipe avec également <i:Staff2-RespDivertissements> (responsable divertissements), <i:Staff3-Doc> (Médecin) et <i:StaffGenBateau> (staff, qui s\'occupe d\'un peu tout).'),(1110117,'2014-07-29 00:39:21','2014-07-29 00:36:25',3,10803,111010,'Mon embauche sur le \"7 worlds Queen\"','J\'ai été recruté pour rejoindre l\'équipe du \"7 worlds Queen\", magnifique <o:Vaisseau1> qui venait d\'être construit et destiné à faire les plus extraordinaires croisières, par le Commandant <i:Commandant> qui venait lui aussi d\'être recruté..\r\nJ\'ai été embauché comme médecin du \"7 worlds Queen\".\r\n\r\n<i:Commandant> a ainsi rapidement formé son équipe avec également <i:Staff2-RespDivertissements> (responsable divertissements), <i:Staff4-RespSécurité> (responsable securité) et <i:StaffGenBateau> (staff, qui s\'occupe d\'un peu tout)'),(1110118,'2014-05-23 00:00:00','2014-07-29 00:40:14',2,10805,111010,'Une idée de voyage...','J\'ai entendu parler du \"7 worlds Queen\", un magnifique <o:Vaisseau1> qui venait d\'être construit et destiné à faire les plus extraordinaires croisières.\r\nL\'idée d\'inaugurer la première croisière sur ce formidable vaisseau me paraît attractive, je décide de m\'inscrire pour la première traversée, entre <l:DepartCroisière> jusqu\'à <l:DestinationCroisière>.'),(1110119,'2014-07-29 00:42:20','2014-07-29 00:42:20',1,10801,10801,'Mon embauche sur le \"7 worlds Queen\"','J\'ai été embauché pour prendre le commandement du \"7 worlds Queen\", magnifique <o:Vaisseau1> qui venait d\'être construit et destiné à faire les plus extraordinaires croisières..\r\nPeu de temps après, j\'ai dû constituer l\'équipe, et c\'est ainsi que m\'ont rejoint pour gérer le vaisseau <i:Staff2-RespDivertissements> (responsable divertissements), <i:Staff3-Doc> (Médecin), <i:Staff4-RespSécurité> (responsable securité) et <i:StaffGenBateau> (staff, qui s\'occupe d\'un peu tout)'),(1110121,'2014-07-30 16:02:38','2014-07-30 15:40:18',2,111013,111011,'De nouveaux clients.','Un groupe de personne arrivent devant <l:Petite habitation en forêt>. <i:hôte> va les accueillir.'),(1110122,'2014-07-31 15:52:52','2014-07-31 15:52:52',1,111011,111011,'Arrivée devant ','Les'),(1110124,'2015-03-24 11:09:01','2015-03-15 11:27:55',2,111019,111013,'Présente lors de l\'accident','Dans le <o:none:Transport accidenté> avec <i:none:Fiancé>. Arrivée au niveau de <l:none:Lieu de l\'accident>, l\'accident se produit. <i:none:Lazare> perd la mémoire.'),(1110125,'2015-03-24 11:09:01','2015-03-15 11:27:55',2,111027,111013,'Présent lors de l\'accident','Dans le <o:none:Transport accidenté> avec <i:none:Lazare>. Arrivé au niveau de <l:none:Lieu de l\'accident>, l\'accident a lieu.<i:none:Fiancé> perd la vie.'),(1110126,'2015-03-24 15:14:33','2015-03-15 11:31:28',3,111028,111014,'Organisateur de l\'accident','<i:none:Amant> prevoit de tuer <i:none:Lazare> et <i:none:Fiancé>. Il veut prendre la place de <i:none:Fiancé> pour profiter de l\'argent de la famille de <i:none:Lazare>.'),(1110127,'2015-03-15 20:22:23','2015-03-15 20:22:23',1,111040,111019,'',''),(1110128,'2015-03-15 20:22:23','2015-03-15 20:22:23',1,111019,111019,'Liaison avec <i:none:Amant>','Liaison de plus d\'un an avec <i:none:Amant>'),(1110129,'2015-03-15 20:22:23','2015-03-15 20:22:23',1,111028,111019,'Liaison avec <i:none:Lazare>','Liaison de plus d\'un an avec <i:none:Lazare>'),(1110132,'2015-03-23 08:24:50','2015-03-23 08:24:50',1,111044,111022,'Mari',''),(1110133,'2015-03-23 08:24:50','2015-03-23 08:24:50',1,111048,111022,'Mariée',''),(1110134,'2015-03-23 08:27:39','2015-03-23 08:27:39',1,111046,111023,'Mère','Émet des doutes violents concernant le mariage entre <i:none:Fugueuse> et <i:none:Mari>.'),(1110135,'2015-03-23 08:27:39','2015-03-23 08:27:39',1,111045,111023,'Père','Défend le mariage entre <i:none:Fugueuse> et <i:none:Mari>'),(1110136,'2015-03-23 08:30:09','2015-03-23 08:30:09',1,111045,111024,'Bourreau','Torture <i:none:Fugueuse> avec <o:none:Bâton>'),(1110137,'2015-03-23 08:30:09','2015-03-23 08:30:09',1,111048,111024,'Torturé','A subi des sévisses de <i:none:Mari> avec <o:none:Bâton> dans <l:none:Tour noire>.'),(1110138,'2015-03-23 10:49:47','2015-03-23 10:49:47',1,111021,111020,'Crime de guerre','Alors que je me pensais en sécurité dans ma résidence, loin de tout et de la guerre passée, une espionne du camp adverse a tenté d\'infiltrer ma demeure dans le but de me tuer. Grâce aux différents systèmes de sécurité mis en place, j\'ai pu l\'assomer et la capturer avant qu\'elle n\'arrive à moi. Au lieu de la tuer, j\'ai décider de m\'amuser un peu. Toujours inconsciente, j\'ai décidé de la violer. Certains appelle ça un crime de guerre, je préfère y penser comme une manière d\'honorer les traditions de nos ancêtres.\r\nJ\'ai ensuite relaché la fille en pleine forêt où elle est certainement morte. Sa surprise a du être totale au reveil.'),(1110139,'2015-03-24 10:54:40','2015-03-23 16:37:42',4,111037,111026,'Relation incestueuse','Après la mort de sa mère, <i:none:Fille 1> s\'est rapprochée de son père, <i:none:Nouveau mari>, et a noué des liens amoureux avec celui-ci. Cette relation a pris fin après la rencontre entre <i:none:Nouveau mari> et <i:none:Croqueuse de mari> mais <i:none:Fille 1> est toujours amoureuse'),(1110140,'2015-03-25 18:43:15','2015-03-25 18:43:15',1,111023,111020,'Sale boulot','Il y a 20 ans, alors que je travaillais pour <i:none:Papi N> à une heure indécente, j\'ai vu une intruse entrer dans la maison, arme à la main. J\'ai pu l’assommer avant qu\'elle ne me voit. J\'ai ensuite proposé à <i:none:Papi N> de la tuer et de la jeter dans la rivière d\'à côté mais il n\'a rien voulu savoir. Il a préféré en faire son objet sexuel... Et quand il en a eu marre, j\'ai du la traîner dans la forêt sur plusieurs kilomètres... Une vraie plaie...\r\nJe l\'ai reconnue comme <i:none:Maman M>, probablement morte dans cette forêt.'),(1110141,'2015-04-01 10:20:40','2015-04-01 10:16:00',2,111025,111029,'Amour interdit','Cette mission... Elle était pourtant simple... Je devais intercepter un messager, récupérer le message qu\'il portait et le rapporter. Je l\'avais déjà effectué ce genre de mission des dizaines de fois... sauf que cette fois ... elle était la. Alors que je me dirigeai vers le messager que je regardai sans quitter les yeux, j\'ai senti que je percutai quelqu\'un. Alors l\'ai remarquée : rayonnante, agile, douce. J\'en ai presque oublié ma mission... Le temps que je me relève, le messager avait disparu. J\'en ai profité pour passer du temps avec la demoiselle. Je crois que j\'en suis tombé amoureux le soir même et pour une raison que j\'ignore, nous nous sommes confiés l\'un à l\'autre. Elle était du camp opposé... J\'étais anéanti et ne savais plus quoi penser. Nous nous sommes finalement endormis dans les bras l\'un de l\'autre. Elle est partie quand je me suis reveillé. Depuis je n\'ai pas cessé de penser à elle et à mon envie de la revoir. Je ne peux en parler à personne, surtout pas mes parents qui me comprendraient pas...'),(1110142,'2015-04-01 22:32:47','2015-04-01 22:32:47',1,111024,111020,'Un échec totale','Il y a maintenant 20 ans, alors que l\'ont m\'avait confié la mission d\'éliminer les habitants d\'une maison où se terrait un de nos ennemis... j\'ai échoué... Alors que j\'entrais dans la propriété, j\'ai senti une vive douleur puis plus rien... le trou noir...\r\nJ\'ai péniblement repris connaissance dans un endroit inconnu, en pleine forêt. J\'étais déshydratée, transie de froid et très endolorie. J\'ignore combien de temps j\'ai été inconsciente mais ce que je sais, c\'est que j\'ai failli mourir dans cette forêt... Après 3 jours d\'errance, j\'ai fini par trouver un village où j\'ai pu m\'habriter.'),(1110143,'2015-04-01 22:45:11','2015-04-01 22:45:11',1,111022,111029,'Amour interdit','Je l\'ai rencontré pour la première fois, il y a peu, lors d\'une mission de routine. A vrai dire je le connaissais avant d\'une certaine manière... Dans les dossiers de mon grand père, l\'un portait son nom, accompagné d\'un portrait, il ne sait pas que j\'y avais accès. J\'ai fait en sorte d\'entrer en contact avec <i:none:Fils M>. Pour une raison que j\'ignore, quelque chose en moi m\'a poussé à le faire. J\'ai passé la nuit avec lui, je me sentais bien. J\'ai décidé de me confier à lui, sur qui j\'étais, sur nos différences par rapport à cette guerre.... Je l\'ai senti perdu et j\'ai pris peur... Je ne savais plus quoi faire... J\'ai tout de même passé la nuit avec lui, je suis parti avant qu\'il ne se réveille.\r\nDepuis, je ne pense plus qu\'à lui... Je veux nous laisser une chance malgré tout...');
